(19, 41793, 'TL-SG3210', '9802', 'LAN Tp-Link Switch Gigabit Managed JetStream 8+2sfp port - TL-SG3210', '', '85176200', 23, 'LANCRDSWM', 'Managelhető Switch', 2, 1, '5/8/2014', 1, '\n    <div class=\"box title\">\n      <h1>JetStream 8 portos gigabites L2 vez&eacute;relhető switch 2 db SFP csatlakoz&oacute;val <small>TL-SG3210</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>IP-MAC-Port-VID &ouml;sszekapcsol&aacute;s, ACL, Port biztons&aacute;g, DOS elleni v&eacute;delem, Storm fel&uuml;gyelet, DHCP- Snooping, 802.1x hiteles&iacute;t&eacute;s &eacute;s r&aacute;diusz ny&uacute;jt sokr&eacute;tű biztons&aacute;gi lehetős&eacute;get</li>\n        <li>L2/L3/L4 QoS &eacute;s az IGMP-snooping a hang- &eacute;s vide&oacute; alkalmaz&aacute;sok forgalm&aacute;t optimaliz&aacute;lja</li>\n        <li>WEB/CLI vez&eacute;rl&eacute;si m&oacute;d, SNMP, RMON nagysz&aacute;m&uacute; vez&eacute;rl&eacute;si jellemzőket k&iacute;n&aacute;l</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr id=\"tr_603\">\n            <th colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr id=\"tr_1079\">\n            <th width=\"35%\">Szabv&aacute;nyok &eacute;s protokollok</th>\n            <td width=\"65%\">IEEE 802.3i,IEEE 802.3u,IEEE 802.3ab,IEEE802.3z,IEEE 802.3ad,<br />IEEE 802.3x,IEEE 802.1d,IEEE 802.1s,IEEE 802.1w,IEEE 802.1q,<br />IEEE 802.1x,IEEE 802.1p</td>\n          </tr>\n          <tr id=\"tr_694\">\n            <th width=\"35%\">Csatlakoz&aacute;sok</th>\n            <td width=\"65%\">8 db 10/100/1000Mbps RJ-45 csatlakoz&oacute;<br />(Auto Negotiation/Auto MDI/MDIX)<br />2 db 1000 Mbps SFP csatlakoz&oacute;<br />1 db konzol port</td>\n          </tr>\n          <tr id=\"tr_1097\">\n            <th width=\"35%\">H&aacute;l&oacute;zati &ouml;sszek&ouml;ttet&eacute;s</th>\n            <td width=\"65%\">10BASE-T: UTP 3, 4, 5 kateg&oacute;ri&aacute;j&uacute; k&aacute;bel (Max. 100 m)<br />100BASE-TX/1000BASE-T: UTP 5, 5e vagy magasabb kateg&oacute;ri&aacute;j&uacute; k&aacute;bel (Max. 100 m)<br />1000BASE-X: MMF, SMF</td>\n          </tr>\n          <tr id=\"tr_2336\">\n            <th width=\"35%\">Ventil&aacute;torok sz&aacute;ma</th>\n            <td width=\"65%\">Ventil&aacute;tor n&eacute;lk&uuml;li</td>\n          </tr>\n          <tr id=\"tr_1111\">\n            <th width=\"35%\">H&aacute;l&oacute;zati t&aacute;pegys&eacute;g</th>\n            <td width=\"65%\">100&#65374;240VAC, 50/60Hz</td>\n          </tr>\n          <tr id=\"tr_1083\">\n            <th width=\"35%\">Energiafelv&eacute;tel</th>\n            <td width=\"65%\">Maximum: 10,7 W (220V/50Hz)</td>\n          </tr>\n          <tr id=\"tr_697\">\n            <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n            <td width=\"65%\">294 x 220 x 44 mm (11.6 x 8.7 x 1.73 in.)</td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  ', 2.347, 7, 36, 3, '', '', 1, 0, '8+2sfp port Gigabit Managed Switch, 8 10/100/1000 Mbps RJ45, 2 1000 Mbps SFP port', 'komp üzletág', 'TL-SG3210', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
