(93, 69478, 'ASGK2000', '90XB01HN-BKB010', 'BILL ASUS GK2000 Gamer - USA - Fekete', '', '84716060', 5, 'BILCRDUSB', 'USB csatlakozós', 2, 1, '2/22/2016', 1, '<span style=\"text-align: left; widows: 1; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 13px/19px Arial; white-space: normal; float: none; color: rgb(38,38,32); word-spacing: 0px; -webkit-text-stroke-width: 0px\">Az ASUS&nbsp;elhozta a Horus GK2000 elnevez&eacute;sű mechanikus billentyűzet&eacute;t, amely a ROG term&eacute;kcsal&aacute;d r&eacute;sze lesz, &iacute;gy teljes eg&eacute;sz&eacute;ben a j&aacute;t&eacute;kosok ig&eacute;nyeire lett szabva. A term&eacute;k a Cherry MX Red mechanikai kapcsol&oacute;kkal ker&uuml;l forgalomba, &iacute;gy billentyűnk&eacute;nt 50 milli&oacute; le&uuml;t&eacute;sre van hiteles&iacute;tve, &eacute;s term&eacute;szetesen a h&aacute;tt&eacute;rvil&aacute;g&iacute;t&aacute;s sem maradt le, amely v&ouml;r&ouml;s LED-eket haszn&aacute;l, de &ouml;t k&uuml;l&ouml;nb&ouml;ző m&oacute;dban lehet ezeket műk&ouml;dtetni. Opci&oacute;s lehetős&eacute;g a LED-ek kikapcsol&aacute;sa, vagy csup&aacute;n egy-egy billentyűre val&oacute; korl&aacute;toz&aacute;sa, teh&aacute;t az eg&eacute;sz rendszer teljesen szem&eacute;lyre szabhat&oacute;.\n      <p style=\"border-bottom: 0px; text-align: left; border-left: 0px; padding-bottom: 0px; widows: 1; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px auto 16px; padding-left: 0px; letter-spacing: normal; padding-right: 0px; font: 13px/19px Arial; white-space: normal; color: rgb(38,38,32); border-top: 0px; border-right: 0px; word-spacing: 0px; padding-top: 0px; -webkit-text-stroke-width: 0px\">Az ASUS ROG Horus GK2000 tartalmaz egy 32 bites mikrovez&eacute;rlőt is 4&nbsp;MB-os be&aacute;gyazott mem&oacute;ri&aacute;val. Ut&oacute;bbi t&aacute;rol minden fontos adatot a billentyűzet &ouml;sszes elmenthető be&aacute;ll&iacute;t&aacute;s&aacute;ra vonatkoz&oacute;an. Ebbe beletartozik a makr&oacute;z&aacute;s is, amelyből 80 be&aacute;ll&iacute;t&aacute;s menthető el, illetve t&aacute;rolhat&oacute; m&eacute;g 10 darab egyedi felhaszn&aacute;l&oacute;i profil is.<br class=\"Apple-interchange-newline\" /><span style=\"text-align: left; widows: 1; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; letter-spacing: normal; display: inline !important; font: 13px/19px Arial; white-space: normal; float: none; color: rgb(38,38,32); word-spacing: 0px; -webkit-text-stroke-width: 0px\">A norm&aacute;l billentyűket term&eacute;szetesen egyedi &eacute;s multim&eacute;di&aacute;s gombok is kieg&eacute;sz&iacute;tik, amelyek mellett m&eacute;g megtal&aacute;lhat&oacute; egy hangerőszab&aacute;lyz&oacute; &eacute;s egy LED f&eacute;nyerőt szab&aacute;lyz&oacute; g&ouml;rgő is. Tov&aacute;bbi extra a fejhallgat&oacute; kimenet, az opcion&aacute;lis csukl&oacute;t&aacute;masz, illetve a szint&eacute;n opcion&aacute;lis tart&oacute; a mobil eszk&ouml;z&ouml;k elhelyez&eacute;s&eacute;re, amely jobb-, illetve baloldalon is elhelyezhető. A csomag r&eacute;sze m&eacute;g egy t&aacute;ska is, amely a Horus GK2000 hordoz&aacute;s&aacute;ra haszn&aacute;lhat&oacute;.</span></p></span>\n  ', 3.28, 5, 12, 3, '', '', 1, 0, '', 'komp üzletág', 'KBM-WDKBM-GK2000-BK', 'BIL', 'Billentyűzet', '', 1, 0, NULL, NULL, NULL, NULL, 1),
