(100, 36470, 'K120OEMB110', '', 'BILL Logitech K120 OEM + B100 - HU - Fekete', '', '84716060', 11, 'BILDTPCRD', 'Vezetékes', 2, 2, '8/11/2016', 1, '<font face=\"Calibri\">\n      <div><strong>Kiv&aacute;l&oacute; g&eacute;pel&eacute;si &eacute;lm&eacute;ny</strong></div>\n      <div>A szabv&aacute;nyos kioszt&aacute;s&uacute; billentyűzet szinte teljesen hangtalan, lapos billentyűi kellemesek a k&eacute;znek. Teljes m&eacute;retű sz&aacute;mbillentyűzet &eacute;s funkci&oacute;gombok eg&eacute;sz&iacute;tik ki őket.</div>\n      <div>&nbsp;</div></font><font face=\"Calibri\">\n      <div><strong>Tart&oacute;ss&aacute;g &eacute;s st&iacute;lus</strong></div>\n      <div>A v&eacute;kony billentyűzet nemcsak eszt&eacute;tikus, hanem a csepp&aacute;ll&oacute; kialak&iacute;t&aacute;snak, a strapab&iacute;r&oacute;, billenthető l&aacute;baknak &eacute;s a tart&oacute;s billentyűknek k&ouml;sz&ouml;nhetően ellen&aacute;ll&oacute; is.</div>\n      <div>&nbsp;</div>\n      <div><strong>Csak k&ouml;nnyed&eacute;n</strong></div>\n      <div class=\"highlightContent\">Csup&aacute;n csatlakoztatnia kell asztali vagy hordozhat&oacute; sz&aacute;m&iacute;t&oacute;g&eacute;pe valamelyik USB-portj&aacute;hoz, &eacute;s a billentyűzet m&aacute;ris haszn&aacute;latra k&eacute;sz.</div>\n      <div class=\"highlightContent\">&nbsp;</div></font>\n    <div><strong><font face=\"Calibri\">&nbsp;</font></strong></div>\n    <div><strong><font face=\"Calibri\">B100 Optical USB Mouse</font></strong></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n    <div><font face=\"Calibri\">Tartson az egerek szak&eacute;rtőivel: v&aacute;lassza a be&eacute;p&iacute;tett minős&eacute;get &eacute;s a tart&oacute;ss&aacute;got. K&eacute;nyelmesebb &eacute;s pontosabb megold&aacute;s, amellyel magasabbra teheti a hat&eacute;konys&aacute;g m&eacute;rc&eacute;j&eacute;t.</font></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n    <div><strong><font face=\"Calibri\">Nagyobb haszn&aacute;lati &eacute;rt&eacute;k.</font></strong></div>\n    <div><font face=\"Calibri\">Pontos kurzorvez&eacute;rl&eacute;s: A 800 dpi-s &eacute;rz&eacute;kenys&eacute;gű eszk&ouml;z pontos kurzorvez&eacute;rl&eacute;st biztos&iacute;t, &iacute;gy hat&eacute;konyabb&aacute; teszi az internetes navig&aacute;ci&oacute;t &eacute;s a dokumentumok szerkeszt&eacute;s&eacute;t. <br />A Logitech&reg; gy&aacute;rtm&aacute;nya: Ezt az egeret ugyanolyan minős&eacute;gi munk&aacute;val &eacute;s kivitelben hoztuk l&eacute;tre, mint egymilli&aacute;rdn&aacute;l is t&ouml;bb t&aacute;rs&aacute;t &ndash; minden m&aacute;s gy&aacute;rt&oacute;t fel&uuml;lm&uacute;lva ezzel a mennyis&eacute;ggel. <br /><br /><strong>Fokozott k&eacute;nyelem.</strong></font></div>\n    <div><font face=\"Calibri\">K&eacute;nyelmes, mindk&eacute;t k&eacute;zbe illő forma: Mindk&eacute;t k&eacute;zbe j&oacute;l illik, &iacute;gy m&eacute;g a nap v&eacute;g&eacute;n is k&eacute;nyelmesebb&eacute; teszi a munk&aacute;t.</font></div>\n  ', 0.64, 4, 24, 3, '', '', 1, 0, '', 'komp üzletág', '', 'BIL', 'Billentyűzet', '', 1, 0, NULL, NULL, NULL, NULL, 1),
