(140, 28555, 'MK220HU', '', 'BILL Logitech MK220 - HU - Fekete', '', '84716060', 11, 'BILDTPCRL', 'Vezetéknélküli', 2, 1, '9/7/2011', 1, '\n    <div class=\"column2\">\n      <h2 style=\"visibility: visible\"><font size=\"3\" face=\"Calibri\">A kism&eacute;retű billentyűzetből &eacute;s eg&eacute;rből &aacute;ll&oacute; eszk&ouml;zp&aacute;roson minden szok&aacute;sos billentyű megtal&aacute;lhat&oacute;; ezt eg&eacute;sz&iacute;ti ki az extra hossz&uacute; elem&eacute;lettartam &eacute;s a megb&iacute;zhat&oacute;, nagy hat&oacute;t&aacute;vols&aacute;g&uacute; vezet&eacute;k n&eacute;lk&uuml;li technol&oacute;gia.<br /><br /></font></h2>\n      <p><font face=\"Calibri\">&nbsp;</font></p>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Much smaller design, same keys\" src=\"http://www.logitech.com/assets/38268/4/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">Sokkal kisebb kialak&iacute;t&aacute;s, azonos billentyűkkel</font></strong></h4>\n          <p><font face=\"Calibri\">Ez a kism&eacute;retű billentyűzet megk&ouml;zel&iacute;tőleg 36%-kal kisebb a szabv&aacute;nyos billentyűzetekn&eacute;l, m&eacute;gis minden szok&aacute;sos billentyű megtal&aacute;lhat&oacute; rajta, &iacute;gy haszn&aacute;lata ugyanolyan egyszerű, mint valaha.</font></p>\n        </div>\n      </div>\n      <div class=\"highlight left two\">\n        <div class=\"highlightImageArea\"><a class=\"tabLink\" href=\"http://www.logitech.com/hu-hu/68/5987\" name=\"#section=article_5987\"><font face=\"Calibri\"><img alt=\"Advanced 2.4 GHz wireless\" src=\"http://www.logitech.com/assets/38268/5/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></a></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">Korszerű 2,4 GHz-es vezet&eacute;k n&eacute;lk&uuml;li technol&oacute;gia</font></strong></h4>\n          <p><font face=\"Calibri\">A vezet&eacute;k n&eacute;lk&uuml;li technol&oacute;gia gyakorlatilag k&eacute;sedelem-, akadoz&aacute;s- &eacute;s interferenciamentes, ak&aacute;r 10 m&eacute;teres hat&oacute;t&aacute;vols&aacute;g&uacute; kapcsolatot biztos&iacute;t, &iacute;gy t&ouml;bb helyen dolgozhat vagy j&aacute;tszhat, p&eacute;ld&aacute;ul k&eacute;nyelmes kanap&eacute;j&aacute;n is.</font></p>\n        </div>\n      </div>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"128-bit AES encryption\" src=\"http://www.logitech.com/assets/38268/6/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">128 bites AES szabv&aacute;ny&uacute; titkos&iacute;t&aacute;s</font></strong></h4>\n          <p><font face=\"Calibri\">Az adatv&eacute;delem &eacute;rdek&eacute;ben a billentyűzet &eacute;s a vevőegys&eacute;g k&ouml;z&ouml;tt &aacute;tvitt adatokat az el&eacute;rhető egyik leghat&eacute;konyabb technol&oacute;gi&aacute;val titkos&iacute;tja.</font></p>\n        </div>\n      </div>\n      <div class=\"highlight left two\">\n        <div class=\"highlightImageArea\"><a class=\"tabLink\" href=\"http://www.logitech.com/hu-hu/68/5922\" name=\"#section=article_5922\"><font face=\"Calibri\"><img alt=\"Fewer battery hassles\" src=\"http://www.logitech.com/assets/38268/7/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></a></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">Kevesebb vesződs&eacute;g az elemcser&eacute;vel</font></strong></h4>\n          <p><font face=\"Calibri\">A billentyűzet 24, az eg&eacute;r 5 h&oacute;napos elem&eacute;lettartam&aacute;nak k&ouml;sz&ouml;nhetően az eszk&ouml;z&ouml;ket h&oacute;napokig haszn&aacute;lhatja a vesződs&eacute;ges elemcsere n&eacute;lk&uuml;l.</font></p>\n        </div>\n      </div>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Sleek, minimalist design\" src=\"http://www.logitech.com/assets/38268/8/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">Karcs&uacute;, minimalista megjelen&eacute;s</font></strong></h4>\n          <p><font face=\"Calibri\">A billentyűzet minimalista megjelen&eacute;se nem puszt&aacute;n dekor&aacute;ci&oacute;s c&eacute;lt szolg&aacute;l. A billentyűk k&ouml;z&ouml;tti t&eacute;rk&ouml;z hi&aacute;ny&aacute;nak k&ouml;sz&ouml;nhetően az eszk&ouml;z kism&eacute;retű &eacute;s karcs&uacute;.</font></p>\n        </div>\n      </div>\n      <div class=\"highlight left two\">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Plug-and-play simplicity\" src=\"http://www.logitech.com/assets/38268/9/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">A Plug-and-Play egyszerűs&eacute;ge</font></strong></h4>\n          <p><font face=\"Calibri\">Az &uuml;zembe helyez&eacute;s gyerekj&aacute;t&eacute;k &ndash; egyszerűen csatlakoztassa a vezet&eacute;k n&eacute;lk&uuml;li vevőegys&eacute;get a sz&aacute;m&iacute;t&oacute;g&eacute;p egyik USB-portj&aacute;hoz, &eacute;s m&aacute;ris tweetelhet, blogolhat vagy cseveghet an&eacute;lk&uuml;l, hogy szoftvert kellene telep&iacute;tenie.</font></p>\n        </div>\n      </div>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Whisper-quiet keys\" src=\"http://www.logitech.com/assets/38268/10/wireless-combo-mk220-emea-icon-images.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><strong><font face=\"Calibri\">Szinte hangtalan billentyűk</font></strong></h4>\n          <p><font face=\"Calibri\">A billentyűk szinte teljesen hangtalanok, &iacute;gy nyugodtan hallgathat zen&eacute;t an&eacute;lk&uuml;l, hogy a g&eacute;pel&eacute;s zaja megzavarn&aacute;.</font></p>\n        </div>\n      </div>\n    </div>\n  ', 0.60327, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '920-003167', 'BIL', 'Billentyűzet', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(141, 65211, 'MCFREEPCW32', '', 'MUL MODECOM FreePC - hordozható mini PC 2GB/32GB - Windows 10 Stick', '', '85219000', 17, 'MULVMCNHD', 'Beépített HDD nélkül', 2, 2, '11/10/2015', 2, '<font size=\"2\" face=\"Calibri\">&nbsp; </font>\n    <div id=\"akapit_head_2\" class=\"detail_head red\"><font face=\"Calibri\"><font size=\"2\"><span>-</span> Műszaki adatok</font></font></div>\n    <div id=\"akapit_txt_2\" class=\"detail_box\"><font face=\"Calibri\"><font size=\"2\">&bull; <strong>OS:</strong> Windows 10<br />&bull; <strong>CPU:</strong> Intel Atom Bay Trail-CR Z3735F Quad Core<br />&bull; <strong>Graphics:</strong> Intel HD graphics<br />&bull; <strong>Display:</strong> supports up to Full HD 1080p<br />&bull; <strong>RAM:</strong> 2GB DDR3L-RS<br />&bull; <strong>Storage:</strong> 32GB eMMC<br />&bull; <strong>MicroSDHC:</strong> up to 128GB<br />&bull; <strong>Wireless:</strong> WiFi<br />&bull; <strong>Bluetooth:</strong> 4.0 Low Energy<br />&bull; <strong>Power</strong> 5V /2A<br />&bull; <strong>Dimensions</strong> 99.6 x 37.6 x 9.6mm<br />&bull; Accessories Power adapter, USB cable (power/OTG), manual<br />&bull; <strong>Ports:</strong></font></font>\n      <p><font size=\"2\" face=\"Calibri\">1 x mini USB 2.0<br />1 x micro USB 2.0<br />1 x micro USB 2.0 (power</font>)</p>\n    </div>\n  ', 0.31, 5, 12, 3, '', '', 1, 0, 'Intel Atom  Z3735F Quad Core, 2GB RAM, 32GB eMMC, Mini USB, Micro USB, Wifi, Bluetooth, Windows 8.1', 'komp üzletág', 'PC-MC-FREEPC-WIN10', 'MUL', 'Multimédia eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
