(228, 57503, 'ASACCMIDAS', '90XB00F0-BBP000', 'BAG NB ASUS 11,6\" - 15,6\" Hátizsák - Midas - Fekete', '', '42022290', 5, 'BAGNBT173', '17\" mérettől', 2, 1, '2/11/2015', 1, '\n    <h1 class=\"product-slogan\"><font face=\"Calibri\">V&aacute;llra vett siker</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font face=\"Calibri\">El&eacute;g nagy 16 h&uuml;velykes noteszg&eacute;pekhez is</font></li>\n        <li><font face=\"Calibri\">A k&eacute;nyelmesen el&eacute;rhető rekeszeknek k&ouml;sz&ouml;nhetően m&aacute;sodpercek alatt kivehető a noteszg&eacute;p a rept&eacute;ri biztons&aacute;gi ellenőrz&eacute;si pontokn&aacute;l </font></li>\n        <li><font face=\"Calibri\">Az el&uuml;lső zsebek kifejezetten a 7 h&uuml;velykes t&aacute;blag&eacute;pek &eacute;s mobil k&eacute;sz&uuml;l&eacute;kek sz&aacute;m&aacute;ra k&eacute;sz&uuml;ltek, de van egy sor m&aacute;s rekesz is, p&eacute;ld&aacute;ul a pap&iacute;roknak &eacute;s mapp&aacute;knak</font></li>\n        <li><font face=\"Calibri\">Ergonomikus, a felhaszn&aacute;l&oacute; k&eacute;nyelm&eacute;t szem előtt tart&oacute; kivitel</font></li>\n        <li><font face=\"Calibri\">Erős, tart&oacute;s, a testp&aacute;nc&eacute;lokban haszn&aacute;lt, &bdquo;goly&oacute;fog&oacute;&rdquo; minős&eacute;gű nylon</font></li>\n        <li><font face=\"Calibri\">Eleg&aacute;ns, ergonomikus kialak&iacute;t&aacute;s</font> </li>\n      </ul>\n    </div>\n  ', 1.21, 5, 12, 3, '', '', 1, 0, 'ASUS 11,6\" - 15,6\" Notebook hátizsák - Midas - Fekete', 'pc üzletág', 'MIDAS 16\"', 'BAG', 'Táska', '', 1, 0, NULL, NULL, NULL, NULL, 1),
