(330, 37756, 'LOMT630', '', 'Mouse Logitech T630 Ultrathin Touch - Fekete', '', '84716070', 11, 'MOUCRLBLT', 'Bluetooth-os', 2, 1, '6/21/2016', 1, '\n    <div align=\"center\"><font face=\"Calibri\">&nbsp;</font><font face=\"Calibri\">Ultrabook sz&aacute;m&iacute;t&oacute;g&eacute;pekhez tervezve</font></div>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">A sz&aacute;lcsiszolt f&eacute;m kialak&iacute;t&aacute;s &eacute;s a kellemes tapint&aacute;s&uacute; &eacute;rintőfel&uuml;let t&ouml;k&eacute;letesen kieg&eacute;sz&iacute;ti napjaink Ultrabook&trade; sz&aacute;m&iacute;t&oacute;g&eacute;peinek eleg&aacute;ns megjelen&eacute;s&eacute;t.</font></p>\n    <div class=\"highlightImageArea\" align=\"center\"><font face=\"Calibri\"><img src=\"http://www.logitech.com/assets/49154/6/ultrathin-touch-mouse-t630.jpg\" width=\"120\" height=\"140\" /> </font></div>\n    <h4 class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">Egy egyszerűen hordozhat&oacute; p&aacute;ros</font></h4>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">A szuperv&eacute;kony, pehelyk&ouml;nnyű T630 szinte l&aacute;thatatlanul cs&uacute;szik a sz&aacute;m&iacute;t&oacute;g&eacute;p tokj&aacute;ba vagy a legszűkebb farmer zseb&eacute;be. Kedvenc eger&eacute;t b&aacute;rhov&aacute; mag&aacute;val viheti.</font></p>\n    <div class=\"highlightImageArea\" align=\"center\"><font face=\"Calibri\"><img src=\"http://www.logitech.com/assets/49154/7/ultrathin-touch-mouse-t630.jpg\" width=\"120\" height=\"140\" /> </font></div>\n    <h4 class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">&Eacute;rintse meg a vil&aacute;got</font></h4>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">Ismerje meg a Windows&reg; 8 ny&uacute;jtotta &uacute;j navig&aacute;ci&oacute;s lehetős&eacute;geket - k&ouml;nnyed&eacute;n &eacute;s magabiztosan.* A T630 term&eacute;szetes, intuit&iacute;v gesztusaival egyszerűs&iacute;ti az &eacute;rint&eacute;s &eacute;lm&eacute;ny&eacute;t, &eacute;s kellemes &eacute;rz&eacute;st biztos&iacute;t az &Ouml;n sz&aacute;m&aacute;ra.<br /><br /><span style=\"font-size: smaller\"><em><a href=\"http://www.logitech.com/hu-hu/support/ultrathin-touch-mouse-t630?section=downloads\">*Egyes funkci&oacute;k szoftver telep&iacute;t&eacute;s&eacute;t ig&eacute;nylik.</a></em></span></font></p>\n    <div class=\"highlightImageArea\" align=\"center\"><font face=\"Calibri\"><img src=\"http://www.logitech.com/assets/49154/8/ultrathin-touch-mouse-t630.jpg\" width=\"120\" height=\"140\" /> </font></div>\n    <h4 class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">Egy eg&eacute;r, t&ouml;bb eszk&ouml;z</font></h4>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">A T630 vezet&eacute;k n&eacute;lk&uuml;li <em>Bluetooth</em>&reg;-kapcsolaton kereszt&uuml;l kapcsol&oacute;dik eszk&ouml;zeihez. Az Easy-Switch&trade; technol&oacute;gia seg&iacute;ts&eacute;g&eacute;vel egyszerűen, egy kapcsol&oacute; haszn&aacute;lat&aacute;val v&aacute;lthat az Ultrabook, a t&aacute;blag&eacute;p &eacute;s az asztali sz&aacute;m&iacute;t&oacute;g&eacute;p k&ouml;z&ouml;tt.</font></p>\n    <div class=\"highlightImageArea\" align=\"center\"><font face=\"Calibri\"><img alt=\"Control with your fingertips\" src=\"http://www.logitech.com/assets/49154/10/ultrathin-touch-mouse-t630.jpg\" width=\"120\" height=\"140\" /> </font></div>\n    <h4 class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">* Ide&aacute;lis m&eacute;ret az ujjheggyel t&ouml;rt&eacute;nő haszn&aacute;lathoz</font></h4>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">3 h&uuml;velykes hossz&aacute;val &eacute;s 2 h&uuml;velykes sz&eacute;less&eacute;g&eacute;vel a T630 puszt&aacute;n az ujjhegy&eacute;vel is műk&ouml;dtethető. A prec&iacute;zi&oacute;s &eacute;rz&eacute;kelő a legkisebb mozdulatokra is reag&aacute;l, az &eacute;rintőfel&uuml;let pedig kilenc k&uuml;l&ouml;nb&ouml;ző &eacute;rint&eacute;si gesztust ismer fel.</font></p>\n    <div class=\"highlightImageArea\" align=\"center\"><font face=\"Calibri\"><img src=\"http://www.logitech.com/assets/49154/9/ultrathin-touch-mouse-t630.jpg\" width=\"120\" height=\"140\" /> </font></div>\n    <h4 class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">Gyors t&ouml;lt&eacute;s</font></h4>\n    <p class=\"highlightContent\" align=\"center\"><font face=\"Calibri\">Egy percnyi t&ouml;lt&eacute;ssel ak&aacute;r egy &oacute;r&aacute;val is tov&aacute;bb dolgozhat.* Ha a t&ouml;lt&ouml;tts&eacute;g alacsony, csak csatlakoztassa az egeret. Az eg&eacute;r USB-n kereszt&uuml;l t&ouml;lthető, &iacute;gy mindig haszn&aacute;latra k&eacute;sz.&nbsp;</font></p>\n  ', 0.302, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '910-003836', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(331, 35212, 'LOTRACMAM', '', 'Mouse Logitech TrackMan Marble - Szürke', '', '84716070', 11, 'MOUCRDOPT', 'Optikai', 2, 1, '6/21/2016', 1, '\n    <div class=\"column2\">\n      <h2 style=\"visibility: visible\"><font size=\"3\" face=\"Calibri\">Ez a mindk&eacute;t k&eacute;zbe illő, k&eacute;nyelmes vez&eacute;rlőgombokkal ell&aacute;tott hanyatteg&eacute;r ak&aacute;r az eg&eacute;sz napi haszn&aacute;lat sor&aacute;n is a kedv&eacute;re lesz.<br /><br /></font></h2>\n      <p><font face=\"Calibri\">&nbsp;</font></p>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Ambidextrous trackball design\" src=\"http://www.logitech.com/assets/16435/16435.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><font face=\"Calibri\">Mindk&eacute;t k&eacute;zbe illő kivitel</font></h4>\n          <p><font face=\"Calibri\">A hanyatteg&eacute;r hossz&uacute;, sz&eacute;les, l&aacute;gy &iacute;vű teny&eacute;rr&eacute;sze eg&eacute;sz nap k&eacute;nyelmes tart&aacute;st biztos&iacute;t a jobb- &eacute;s a balkezeseknek is.</font></p>\n        </div>\n      </div>\n      <div class=\"highlight left two\">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Stable base\" src=\"http://www.logitech.com/assets/16437/16437.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><font face=\"Calibri\">Stabil talapzat</font></h4>\n          <p><font face=\"Calibri\">Az &aacute;lland&oacute; helyen haszn&aacute;lhat&oacute; eszk&ouml;z eg&eacute;sz napos k&eacute;nyelmet biztos&iacute;t kez&eacute;nek, emellett helyet is takar&iacute;that meg a seg&iacute;ts&eacute;g&eacute;vel.</font></p>\n        </div>\n      </div>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Convenient button controls\" src=\"http://www.logitech.com/assets/16438/16438.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><font face=\"Calibri\">Praktikus vez&eacute;rlőgombok</font></h4>\n          <p><font face=\"Calibri\">Seg&iacute;ts&eacute;g&uuml;kkel b&ouml;ng&eacute;sz&eacute;s k&ouml;zben egyszerűen navig&aacute;lhat előre vagy vissza a weblapok k&ouml;z&ouml;tt.</font></p>\n        </div>\n      </div>\n      <div class=\"highlight left two\">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Fingertip-based control\" src=\"http://www.logitech.com/assets/16439/16439.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><font face=\"Calibri\">K&ouml;nnyen el&eacute;rhető kezelőszervek</font></h4>\n          <p><font face=\"Calibri\">Gyors &eacute;s pontos kurzormozgat&aacute;s ujj&aacute;nak egyetlen mozdulat&aacute;ra.</font></p>\n        </div>\n      </div>\n    </div>\n    <div class=\"highlightRow\">\n      <div class=\"highlight left \">\n        <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Marble® optical technology\" src=\"http://www.logitech.com/assets/16442/16442.png\" width=\"120\" height=\"140\" /> </font></div>\n        <div class=\"highlightContent\">\n          <h4><font face=\"Calibri\">Marble&reg; optikai technol&oacute;gia</font></h4>\n          <p><font face=\"Calibri\">Szabadalmaztatott technol&oacute;gi&aacute;nk szinte minden fel&uuml;leten egyenletes mozg&aacute;sk&ouml;vet&eacute;st tesz lehetőv&eacute;, &iacute;gy minden&uuml;tt hat&eacute;kony munkav&eacute;gz&eacute;st biztos&iacute;t.</font></p>\n        </div>\n      </div>\n    </div>\n  ', 0.45, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '910-000808', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(332, 85481, 'ASRTAC52UB1', '90IG03N0-BM3110', 'LAN/WIFI Asus Router AC1750Mbps RT-AC52U B1', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '3/8/2017', 1, '<div class=\"product-intro\">\n<ul>\n	<li>802.11ac dual-band wireless at up to 733 Mbps for high-performance wireless</li>\n	<li>Expanded wireless coverage with two fixed high-gain antennas</li>\n	<li>USB port for printer networking, storage sharing, or 3G/4G connections</li>\n	<li>ASUS AiCloud app to access, sync, share and stream your files on the go &ndash;quickly and easily</li>\n	<li>Easy 30 second setup and robust controls like network monitoring through ASUSWRT dashboard</li>\n</ul>\n</div>\n', 0, 7, 36, 3, '', '', 1, 0, '300+433Mbps, 802.11 a/b/g/n/ac, 1x 10/100/1000 Gigabit WAN, 4x 10/100/1000 Gigabit LAN, 1x USB2.0, 2,4GHz/5GHz, 2x külső antenna, 1x belső antenna, WEP/WPA/WPA2/WPA-PSK/WPA2-PSK', 'komp üzletág', 'RT-AC52U B1', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
