(373, 32240, 'RGICEITG15R1', '', 'EGY Cooler Master -  IC Essential E1 - Grease / High performance - Hütőpaszta - Szürke', '', '84145915', 24, 'FANGRE', 'Hűtőpaszta', 2, 1, '8/7/2012', 1, '\n    <div style=\"text-align: left; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 630px; letter-spacing: normal; padding-right: 20px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; color: rgb(0,0,0); word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><font style=\"font-size: 16px; vertical-align: top\" face=\"Arial, Helvetica, sans-serif\"><b>Introduction</b></font><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_top.jpg\" />\n      <div style=\"background-image: url(http://www.coolermaster.com/templates/images/prod_detail_mid.jpg); border-bottom: 0px; border-left: 0px; padding-bottom: 0px; margin: 0px; padding-left: 20px; width: 590px; padding-right: 20px; border-top: 0px; border-right: 0px; padding-top: 5px\">The IC Essential E1 is a high performance thermal compound to meet the requirements of mainstream CPU cooling. With its low thermal impedance and appropriate viscosity, IC Essential E1 can provide very efficient heat transfer and can be spread easily and evenly. It\'s also bundled with a&nbsp;grease cleanser&nbsp;that allows you to easily clean old thermal grease away.</div><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_bot.jpg\" />\n    </div>\n    <div style=\"padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; letter-spacing: normal; padding-right: 0px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; height: 10px; color: rgb(0,0,0); word-spacing: 0px; padding-top: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;</div>\n    <div style=\"text-align: left; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 630px; letter-spacing: normal; padding-right: 20px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; color: rgb(0,0,0); word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_dot.jpg\" />&nbsp;<font style=\"font-size: 16px; vertical-align: top\" face=\"Arial, Helvetica, sans-serif\"><b>Features</b></font><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_top.jpg\" />\n      <div style=\"background-image: url(http://www.coolermaster.com/templates/images/prod_detail_mid.jpg); border-bottom: 0px; border-left: 0px; padding-bottom: 0px; margin: 0px; padding-left: 20px; width: 590px; padding-right: 20px; border-top: 0px; border-right: 0px; padding-top: 5px\">\n        <li>High Thermal Conductivity<br /></li>\n        <li>Low Thermal Resistance<br /></li>\n        <li>Electrically Non-Conductive<br /></li>\n        <li>Non-Curing<br /></li>\n        <li>Non-Capacitive<br /></li>\n        <li>Non-Corrosive</li>\n        <li>Grease cleanser included for easy cleaning away old thermal grease</li>\n      </div><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_bot.jpg\" />\n    </div>\n    <div style=\"padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; letter-spacing: normal; padding-right: 0px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; height: 10px; color: rgb(0,0,0); word-spacing: 0px; padding-top: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;</div>\n    <div style=\"text-align: left; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 630px; letter-spacing: normal; padding-right: 20px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; color: rgb(0,0,0); word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_dot.jpg\" />&nbsp;<font style=\"font-size: 16px; vertical-align: top\" face=\"Arial, Helvetica, sans-serif\"><b>Specifications</b></font><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_top.jpg\" />\n      <div style=\"background-image: url(http://www.coolermaster.com/templates/images/prod_detail_mid.jpg); padding-bottom: 0px; margin: 0px; padding-left: 20px; width: 590px; padding-right: 20px; padding-top: 5px\">\n        <table border=\"0\" cellspacing=\"0\" cellpadding=\"2\" width=\"590\">\n          <tbody>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Color</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">Gray</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\" valign=\"top\" width=\"100\"><b>Specific Gravity</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\">2.5</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Thermal Conductivity</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">&gt;4.5 W/m-K</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\" valign=\"top\" width=\"100\"><b>Volume Resistivity</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\">1.0E+10 ohm-cm</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Thermal Impedance</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">&lt;0.185 degree Celsius-in<sup>2</sup>/W</t