(374, 32242, 'RGICV1TW20R1', '', 'EGY Cooler Master -  IC Value V1 - Grease / High performance - Hütőpaszta', '', '84145915', 24, 'FANGRE', 'Hűtőpaszta', 2, 1, '8/7/2012', 1, '\n    <div style=\"text-align: left; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 630px; letter-spacing: normal; padding-right: 20px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; color: rgb(0,0,0); word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\"><font style=\"font-size: 16px; vertical-align: top\" face=\"Arial, Helvetica, sans-serif\"><b>Introduction</b></font><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_top.jpg\" />\n      <div style=\"background-image: url(http://www.coolermaster.com/templates/images/prod_detail_mid.jpg); border-bottom: 0px; border-left: 0px; padding-bottom: 0px; margin: 0px; padding-left: 20px; width: 590px; padding-right: 20px; border-top: 0px; border-right: 0px; padding-top: 5px\">The IC Value V1 is a high performance thermal compound with high thermal conductivity and low thermal resistance. It can prevent your pc components from short circuit incidence due to its traits of non-curing and non-electrical conductive. The IC Value V1 can achieve very efficient heat dissipation and is ideal for CPU, GPU cooling or other applications.</div><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_bot.jpg\" />\n    </div>\n    <div style=\"padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; letter-spacing: normal; padding-right: 0px; font: 11px Tahoma, Ve