(375, 80930, 'MGXZOSWN15MR1', '', 'EGY Cooler Master - MasterGel', '', '84145915', 24, 'FANGRE', 'Hűtőpaszta', 2, 1, '7/12/2016', 1, '\n    <p class=\"title\"><strong><font size=\"4\">MasterGel </font></strong></p>\n    <div class=\"synopsis\">\n      <p align=\"justify\"><span style=\"font-family: ; color: rgb(92,89,92)\"><font color=\"#000000\"><strong>Outpace stock thermal grease with the balanced, all-new MasterGel. The gel compound is made for easy application and removal without having to scrape into the night. We&rsquo;ve even thrown in a scraper and cleaner to make light work of cleaning the CPU and cooler base without damaging parts.</strong></font></span></p>\n      <div><span style=\"font-family: ; color: rgb(92,89,92)\">&nbsp;</span><font size=\"4\"><strong>Specification:</strong></font></div>\n      <div>&nbsp;</div>\n      <tbody>&nbsp;\n\n\n<tbody>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Color</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">White</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\" valign=\"top\" width=\"100\"><b>Specific Gravity</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\">2.4</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Thermal Conductivity</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">&gt;5 W/m-K</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\" valign=\"top\" width=\"100\"><b>Volume</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\">1.5 g</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\" valign=\"top\" width=\"100\"><b>Extra</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(228,228,228); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs\">Scraper</td>\n            </tr>\n            <tr>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\" valign=\"top\" width=\"100\"><b>Grease</b></td>\n              <td style=\"padding-bottom: 8px; background-color: rgb(255,255,255); padding-left: 8px; width: 150px; padding-right: 8px; padding-top: 8px\" class=\"specs2\">Cleaner</td>\n            </tr>\n          </tbody>\n  ', 0.04, 9, 6, 3, '', '', 1, 0, '', 'komp üzletág', 'MGX-ZOSW-N15M-R1', 'FAN', 'Hűtő rendszerek', '', 1, 0, NULL, NULL, NULL, NULL, 1),
