(597, 83821, '272B7QPTKEB00', '', 'Mon Philips 27\" 272B7QPTKEB/00 - WQHD IPS LED - Webkamera - PIVOT', '', '85285291', 1, 'MON249', '27\" - 29\"', 2, 1, '11/30/2016', 1, '<h3 class=\"p-heading-03 p-feature-title p-even\">A webkamera előugrik, amikor szükséges; eltűnik, ha nincs szüksége rá</h3>\n\n<p class=\"p-even\"><picture class=\"p-picture\" data-alt=\"A webkamera előugrik, amikor szükséges; eltűnik, ha nincs szüksége rá\"><source media=\"(min-width: 961px)\" srcset=\"https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=346&amp;hei=186&amp;$jpglarge$, https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=692&amp;hei=372&amp;$jpglarge$ 2x\" /><source media=\"(min-width: 701px)\" srcset=\"https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=346&amp;hei=186&amp;$jpglarge$, https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=692&amp;hei=372&amp;$jpglarge$ 2x\" /><source media=\"(min-width: 451px)\" srcset=\"https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=346&amp;hei=186&amp;$jpglarge$, https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=692&amp;hei=372&amp;$jpglarge$ 2x\" /><source media=\"\" srcset=\"https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=346&amp;hei=186&amp;$jpglarge$, https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=692&amp;hei=372&amp;$jpglarge$ 2x\" /><img alt=\"A webkamera előugrik, amikor szükséges; eltűnik, ha nincs szüksége rá\" src=\"https://images.philips.com/is/image/PhilipsConsumer/F400078869-FIL-global-001?wid=346&amp;hei=186&amp;$jpglarge$\" /></picture></p>\n\n<p class=\"p-body-copy-02 p-even\">A webkamerák jó szolgálatot tesznek, ha kapcsolódni szeretnénk másokhoz, vagy ha fontos projekteken akarunk együtt dolgozni másokkal. Azonban vannak helyzetek, amikor nem szeretnénk, ha a webkamera ott figyelne az asztalunkon. Az ügyesen megtervezett új webkamra előugrik, ha épp aktuális egy webes találkozó, és a biztonság érdekében eltűnik, ha épp nincs használatban.</p>\n', 0, 7, 36, 3, '', '', 1, 0, 'MÉRET: 27\", FELBONTÁS: 2560x1440, VÁLASZIDŐ: 5ms, DSUB-DP-miniDP-HDMI, Hangszóró, Webkamera', 'komp üzletág', '272B7QPTKEB/00', 'MON', 'Monitor', '', 1, 0, NULL, NULL, NULL, NULL, 1),
