class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Power Consumption</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">240 Watts (Operation), &lt;0.5 Watts (Standby)</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Operating Temperature</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">0&deg;C ~ 40&deg;C / 32&deg;F ~ 104&deg;F</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Operating Humidity</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">80%RH (Max.)</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-