.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Composite Video (RCA) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">S-Video (Mini DIN) x 1<span style=\"mso-spacerun: yes\">&nbsp;</span></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">HDMI/MHL (Video, Audio, HDCP) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">PC Audio (Stereo mini jack) x 2</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl80\" height=\"20\"><font face=\"Calibri\">Output Interface</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Analog RGB (D-sub) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">PC Audio (Stereo mini jack) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">Control Interface</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">USB (Mini-B) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">RS232 (D-sub) x 1</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext 0.5pt solid; border-right: windowtext 0.5pt solid\" class=\"xl76\" height=\"20\" width=\"289\"><font face=\"Calibri\">Standard Accessories</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext 0.5pt solid; border-right: windowtext 0.5pt solid\" class=\"xl77\" width=\"606\"><font face=\"Calibri\">AC power cord</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">VGA cable</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Remote control</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Battery for remote control</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Lens cap (EMEA P/Ns only)</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Carrying case</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">User\'s guide (CD-ROM)</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Quick start guide</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl78\" height=\"20\" width=\"289\"><font face=\"Calibri\">&nbsp;</font></td>\n            <td style=\"border-bottom: #f0f0f0; border-left: windowtext; background-color: white; width: 455pt; border-top: #f0f0f0; border-right: windowtext 0.5pt solid\" class=\"xl79\" width=\"606\"><font face=\"Calibri\">Security card</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext 0.5pt solid; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Native Aspect Ratio</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext 0.5pt solid; border-right: windowtext 0.5pt solid\" class=\"xl81\" width=\"606\"><font face=\"Calibri\">16:10</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Lamp Life</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">Up to 10,000 hours of lamp life<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>the maximum offered saves lamp replacement costs and allows long-term, dependable projector use.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">DynamicBlack<font class=\"font8\"><sup>TM</sup></font></font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">DynamicBlack&trade; (Lamp, 13,000:1)<br />DynamicBlack&trade; technology dramatically improves image contrast by using dynamic lamp power adjustment according to the analysis of content frame by frame. Acer projectors featuring this technology dynamically adjust dark scenes to optimal black levels while maintaining the original brightness of bright scenes, resulting in the most vivid image quality and a very high contrast ratio of up to 13,000:1.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Noise Level</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Low Noise Level<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>An ultra-low noise level ensures that the audibility of presentations and entertainment won\'t be affected.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Acer eOpening Management</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Customizable Startup Screen<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>The Customizable Startup Screen feature allows users to easily create a customized startup screen for their Acer projector. Business users can set a corporate logo to create a professional brand image or add owner information to protect the projector from theft. Home users can have fun displaying their favorite photographs.<span style=\"mso-spacerun: yes\">&nbsp;</span></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Acer eView Management</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Display Mode<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>With Display Mode setting, adjusting projector settings to suit any environment and any type of content is fast and easy. Multiple factory or user-defined presets instantly configure color, brightness and contrast to deliver best-quality images.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Acer ePower Management</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Power Management<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>The Power Management settings provide a couple of power management options, including controls for ECO Power On/Off, High Altitude mode and Auto Shutdown.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Acer e3D Management</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">3D Management<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>With 3D Management, the projector enables user to access 3D functions, including 3D On/Off and 3D L/R Invert</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">One Button 3D</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">One Button 3D<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>With One Button 3D function, user can simply press the 3D button to<span style=\"mso-spacerun: yes\">&nbsp; </span>toggle among various 3D functions, including 3D On/Off and 3D L/R Invert</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Wall-Color Compensation/Black Board Mode</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Wall-Color Compensation<br />The wall-color compensation feature enables the projector to display colors accurately even when the image is projected on a colored wall. The user simply has to choose the wall color in the OSD menu, and the projector intelligently compensates the color of the displayed image.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">High Altitude Mode</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">High Altitude Mode<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp; </span>Since air density at high altitudes is low, a projector operating at elevated levels may automatically shut down to protect itself from overheating. High Altitude mode allows the projector to operate with faster fan speeds, thus preventing any damage even at higher altitudes.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Top Loading Lamp</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Acer Top-Loading Lamp Design<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>The lamp module is now top-loaded, as opposed to the conventional bottom-loading design. Hence, even when the projector is ceiling-mounted, the user can easily replace the lamp module without detaching the projector from the ceiling.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Installation Menu</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Installation Menu<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp; </span>With the Installation menu, signal input from a notebook is no longer required to enable the OSD menu, making projector installation on the ceiling faster, easier and more convenient.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">HDMI</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Digital Connectivity-HDMI&trade;<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>An HDMI&trade; port delivers uncompressed digital signals and multi-channel audio, providing easy connectivity to high-quality HD broadcasts or entertainment.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">MHL</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">MHL&trade; Connectivity<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>With the MHL connectivity (through MHL&trade;/HDMI&trade; port), the projector is capable of performing the uncompressed HDMI digital signals and multi-channel audio from an MHL supported smartphone. The charging capability from projector to the battery of smartform is also provided. Furthermore, with the Acer unique MHL wireless adapter attaching to the MHL&trade;/HDMI&trade; port, the projector can display the content wirelessly from a PC, Tablet, Smartpone or Set-Top Box with Miracast or DLNA WiFi Display capability.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">2X D-Sub</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Dual D-Sub Input<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>A projector equipped with two sets of D-sub connectors allows dual-PC source input for more flexible connectivity and instant switching.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Multi-PC Connectivity</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Multi-PC Connectivity (HDMI)<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>A projector equipped with at least two connectors for multiple-PC source input, including D-Sub and HDMI&trade;, offers more flexible connectivity and instant switching.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Instant Pack</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Instant Pack<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>If the user is in a hurry to leave, the power cord can be unplugged right after the projector is turned off, without any resulting damage. There\'s no need to wait for a cooling period; the user can pack up the projector and leave immediately.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Auto Shutdown</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Auto Shutdown<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp; </span>The projector automatically performs a safety shutdown if it does not receive input for a certain time. The shutdown interval can be changed via the OSD.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\" width=\"289\"><font face=\"Calibri\">Quick Start</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Quick Start<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>The projector starts projecting within 15 seconds after power button being pressed</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Quick Detection</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Quick Detection<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>Detects input signals as soon as a source is connected, eliminating time spent signal scanning.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">SmartDetection</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">SmartDetection<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;&nbsp; </span>With the intelligent signal priority control, the signal detection time can be reduced dramatically.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">PIN Security</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">PIN Security <br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp; </span>A feature that enables projector password control, preventing the projector from unauthorized use, and reducing the possibility of the projector being stolen.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Digital Zoom and Pan</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Digital Zoom and Pan<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>Digital Zoom and Pan lets the user easily magnify interesting details of displayed content and move the magnified image to a preferred location.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">HD Ready</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">Yes</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">ECO Mode</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">ECO Mode<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>Enable ECO (economic) mode when the ambient light does not necessitate full illumination. ECO mode can extend the lifespan of lamp, reduce noise and power consumption.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">ExtremeECO</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">ExtremeECO (Lamp, 30%)<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>The world leading ExtremeECO technology enables the breakthrough of lamp power control with the capability of dimming lamp down to 30% of full lamp power. The projector will automatically enter ExtremeECO mode for saving power if there is no any signal input. With ExtremeECO, the power consumption of the projector can be reduced up to 70% and the lamp life can be extended as well.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Loop Through</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl71\" width=\"606\"><font face=\"Calibri\">Loop Through</font><font class=\"font7\"><br /><font face=\"Calibri\"><span style=\"mso-spacerun: yes\">&nbsp; </span>A D-sub output port allows another device, usually a monitor or another projector, to be connected to the projector for dual displays.</font></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Built-in Speaker</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">Built-in Speaker</font><font class=\"font7\"><br /><font face=\"Calibri\"><span style=\"mso-spacerun: yes\">&nbsp; </span>A built-in speaker enhances presentations and video entertainment with nice sound.</font></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">RS-232</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl75\" width=\"606\"><font face=\"Calibri\">RS-232<br /><span style=\"mso-spacerun: yes\">&nbsp; </span>A serieral port for advanced control and monitoring via system manager</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Vertical Keystone Correction</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">40&deg; Vertical Keystone Correction<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>Elevated projection can result in a &quot;pointing up&quot; or &quot;pointing down&quot; effect. With the keystone correction feature, Acer projectors correct vertical distortions of up to 40&deg;, so the audience sees a rectangular image rather than one with a wider top/bottom, even if the projector is placed above or below the screen.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Auto Keystone Correction</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">Auto Keystone Correction<br /><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp; </span>Elevated projection can result in a &quot;pointing up&quot; or &quot;pointing down&quot; effect. Activating the Auto Keystone Correction feature automatically corrects vertical distortions, so the audience sees a rectangular image rather than one with a wider top/bottom, even if the projector is placed above or below the screen.</font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" height=\"20\" width=\"289\"><font face=\"Calibri\">Auto Ceiling-mounted Correction</font></td>\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext; background-color: white; width: 455pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl70\" width=\"606\"><font face=\"Calibri\">Auto Ceiling-Mount Correction<br />Auto ceiling-mount correction uses a gravity sensor to automatically detect that the projector is ceiling mounted, and instantly rotates projected images by 180&ordm; to ensure the correct orientation.<br /></font></td>\n          </tr>\n          <tr style=\"height: 15pt; mso-height-source: userset\" height=\"20\">\n            <td style=\"border-bottom: windowtext 0.5pt solid; border-left: windowtext 0.5pt solid; background-color: white; width: 217pt; height: 15pt; border-top: windowtext; border-right: windowtext 0.5pt solid\" class=\"xl69\" height=\"20\"', 3.3, 30, 24, 3, 'ACER', '', 3, 0, 'WXGA (1280 x 800), 16:10, DLP, 3700 ANSI Lumens, 20000:1, D-SUB, HDMI', 'komp üzletág', 'MR.JP411.001', 'PRO', 'Projektor', '', 1, 0, NULL, NULL, NULL, NULL, 1);
