(717, 5722, 'GENHS04S', '31710025100', 'HDS Genius HS-04S headset', '', '85183095', 53, 'HEACRD', 'Vezetékes', 2, 2, '1/1/2009', 2, '\n    <div><strong>Term&eacute;k specifik&aacute;ci&oacute;</strong></div>\n    <div>&nbsp;</div>\n    <div>A Genius leg&uacute;jabb fejhallgat&oacute;ja, a HS-04S rugalmass&aacute;ga az &ouml;sszes &aacute;ltal&aacute;nosan haszn&aacute;lt funkci&oacute;t lehetőv&eacute; teszi, <br />sokkal k&eacute;nyemesebben &eacute;s sokkal jobb minős&eacute;gben.&nbsp; <br />A zajszűrős mikrofonnal szerelt fejhallgat&oacute; fokozott minős&eacute;gű hangtisztas&aacute;got ny&uacute;jt. <br />Ha hossz&uacute; &oacute;r&aacute;kat t&ouml;lt sz&aacute;m&iacute;t&oacute;g&eacute;pe előtt &eacute;s cseveg&eacute;ssel t&ouml;lti az idej&eacute;t, j&aacute;t&eacute;kokat j&aacute;tszik, <br />vagy videokonferenci&aacute;n vesz r&eacute;szt, t&ouml;k&eacute;letes &eacute;lm&eacute;nyben lehet r&eacute;sze, <br />mivel a fejhallgat&oacute; puha gumirozott fel&uuml;lete fokozott k&eacute;nyelmet biztos&iacute;tanak. <br />A vezet&eacute;ken elhelyezett hangerőszab&aacute;lyoz&oacute;val rendelkezik, mikrofonja bal &eacute;s jobb oldalon is haszn&aacute;lhat&oacute;.&nbsp; </div>\n    <div>&nbsp;</div>\n    <div><strong>Tulajdons&aacute;gok:</strong>&nbsp; </div>\n    <div>&nbsp;</div>\n    <div>Nagyszerű internetes j&aacute;t&eacute;kokhoz, chatel&eacute;shez &eacute;s online konferenci&aacute;khoz&nbsp; <br />A mikrofon kiszűri a nem k&iacute;v&aacute;nt h&aacute;tt&eacute;rzajokat&nbsp; <br />K&eacute;nyelmes &eacute;s &aacute;ll&iacute;that&oacute; fejre r&ouml;gz&iacute;thető design; a rugalmas kialak&iacute;t&aacute;s&uacute; mikrofon b&aacute;rmelyik oldalon hordhat&oacute;&nbsp; <br />Vezet&eacute;ken elhelyezett hangerőszab&aacute;lyz&oacute;val rendelezik</div>\n  ', 0.2, 5, 12, 3, '', '', 1, 0, '', 'komp üzletág', 'HS-04S', 'HEA', 'Headset', '', 1, 0, NULL, NULL, NULL, NULL, 1),
