(749, 37167, 'LOG230', '', 'HDS Logitech G230 Headset - Fekete/piros', '', '85183095', 11, 'HEACRD', 'Vezetékes', 2, 1, '1/1/2015', 1, '\n    <div class=\"features section\">\n      <h2 class=\"grey\"><font face=\"Calibri\"><font size=\"2\">Jellemzők </font></font></h2>\n      <div class=\"row \">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/5/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall \">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">J&Aacute;T&Eacute;KMINŐS&Eacute;GŰ SZTERE&Oacute; HANGZ&Aacute;S </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">Egy tű lehull&aacute;sa. Egy bombarobban&aacute;s. Halljon mindent tiszt&aacute;n.</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">A j&aacute;t&eacute;k nem csak a grafik&aacute;r&oacute;l sz&oacute;l. A hang &eacute;s a k&eacute;p egy&uuml;tt j&aacute;r. A 40 mm-es neod&iacute;mium hangsug&aacute;rz&oacute;kkal rendelkező G230 cs&uacute;csminős&eacute;gű sztere&oacute; hangz&aacute;sa a j&aacute;t&eacute;k elej&eacute;től a v&eacute;g&eacute;ig beleszippantja az akci&oacute;ba viselőj&eacute;t.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n      <div class=\"row light\">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/6/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall light\">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">SPORTOL&Aacute;SHOZ KIFEJLESZTETT TEXTIL F&Uuml;LP&Aacute;RN&Aacute;K </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">Puhas&aacute;g a kem&eacute;ny j&aacute;t&eacute;khoz</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">A maratoni j&aacute;t&eacute;kmenetek alatt a j&aacute;t&eacute;kos kimelegedhet &eacute;s megizzadhat. A G230 f&uuml;lp&aacute;rn&aacute;it k&ouml;r&uuml;ltekintően megv&aacute;lasztott, sportol&aacute;shoz kifejlesztett text&iacute;li&aacute;val vontuk be, hogy hossz&uacute; &oacute;r&aacute;kon &aacute;t viselve is k&eacute;nyelmes, l&aacute;gy &eacute;rzetet ny&uacute;jtsanak. A text&iacute;lia k&ouml;nnyed&eacute;n leh&uacute;zhat&oacute;, &eacute;s moshat&oacute;, &iacute;gy mindig kifog&aacute;stalan &aacute;llapotban lehet.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n      <div class=\"row \">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/7/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall \">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">K&Ouml;NNYŰ KIALAK&Iacute;T&Aacute;S </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">Ne cipeljen annyit</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">A f&uuml;lhallgat&oacute;k karcs&uacute;ak &eacute;s k&ouml;nnyűek, de ez nem megy a hangminős&eacute;g rov&aacute;s&aacute;ra. A k&ouml;nnyebb, kiegyens&uacute;lyozott szerkezet viselője a j&aacute;t&eacute;kra koncentr&aacute;lhat. Ak&aacute;r el is felejtheti, hogy fejhallgat&oacute;t visel.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n      <div class=\"row light\">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/31/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall light\">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">LEHAJTHAT&Oacute;, ZAJSZŰRŐ MIKROFON </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">N&eacute;ha a csend a nyerő l&eacute;p&eacute;s</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">Ha hallatni szeretn&eacute; a hangj&aacute;t, megteheti &ndash; hangosan &eacute;s j&oacute;l &eacute;rhetően. A G230 zajszűrős mikrofonja &uacute;gy poz&iacute;cion&aacute;lhat&oacute;, hogy csak az &Ouml;n hangj&aacute;t vegye. Nincs besz&eacute;des kedv&eacute;ben? Egyszerűen hajtsa fel, hogy ne zavarja a j&aacute;t&eacute;kban.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n      <div class=\"row \">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/29/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall \">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">VEZET&Eacute;KEN ELHELYEZETT KEZELŐSZERVEK </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">Biztos ir&aacute;ny&iacute;t&aacute;s, mindig k&eacute;zn&eacute;l</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">A n&eacute;m&iacute;t&oacute;gomb &eacute;s a hangerőt&aacute;rcsa k&eacute;zre esik, &iacute;gy a hangerő gyorsan &eacute;s pontosan szab&aacute;lyozhat&oacute;. A kezelőszervek k&uuml;l&ouml;nlegesen hossz&uacute;, x m&eacute;teres vezet&eacute;ken kaptak helyet.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n      <div class=\"row light\">\n        <div class=\"img\"><font size=\"2\" face=\"Calibri\"><img src=\"http://gaming.logitech.com/assets/47830/30/g230-gaming-headset-images.png\" /> </font>\n          <div class=\"wedge tall light\">&nbsp;</div>\n        </div>\n        <div class=\"dots\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n        <div class=\"info\">\n          <h3 class=\"blue\"><font size=\"2\" face=\"Calibri\">LAPOS F&Uuml;LP&Aacute;RN&Aacute;K </font></h3>\n          <h4 class=\"blue\"><font size=\"2\" face=\"Calibri\">Rugalmass&aacute;g sz&eacute;les tartom&aacute;nyban</font></h4>\n          <p><font size=\"2\" face=\"Calibri\">Tudjuk, hogy m&eacute;g az ikrek sem egyform&aacute;k. A szem&eacute;lyre szabott illeszked&eacute;s &eacute;rdek&eacute;ben a f&uuml;lp&aacute;rn&aacute;k ak&aacute;r 90 fokkal is elforgathat&oacute;k. Mivel &uacute;gy ford&iacute;that&oacute;k, hogy laposan helyezkedjenek el, kev&eacute;sb&eacute; vannak kit&eacute;ve a t&ouml;r&eacute;snek a mindennapos haszn&aacute;lat sor&aacute;n.</font></p>\n        </div>\n        <div class=\"clear\"><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n      </div>\n    </div><a class=\"anchor\" name=\"specs\">&nbsp;</a>\n    <div class=\"specs\"><font face=\"Calibri\"><font size=\"2\"><strong>Műszaki jellemzők</strong></font></font>\n      <div class=\"col left\">\n        <h5 class=\"dark-grey\"><font face=\"Calibri\">Cikksz&aacute;m</font></h5>\n        <p><font size=\"2\" face=\"Calibri\">981-000540<br /></font></p>\n        <h5 class=\"dark-grey\"><font face=\"Calibri\">J&oacute;t&aacute;ll&aacute;si inform&aacute;ci&oacute;</font></h5>\n        <p><font size=\"2\" face=\"Calibri\">3 &eacute;v korl&aacute;tozott garancia a hardverre</font></p>\n        <h5 class=\"dark-grey\"><font face=\"Calibri\">Rendszerk&ouml;vetelm&eacute;nyek</font></h5>\n        <p><font size=\"2\" face=\"Calibri\">Windows&reg; 8, Windows&reg; 7 , Mac&reg; vagy Linux&reg; oper&aacute;ci&oacute;s rendszer<br />Fejhallgat&oacute;- &eacute;s mikrofonbemenet</font></p>\n        <h5 class=\"dark-grey\"><font face=\"Calibri\">A csomag tartalma</font></h5>\n        <p><font size=\"2\" face=\"Calibri\">Mikrofonos fejhallgat&oacute;<br />Felhaszn&aacute;l&oacute;i &uacute;tmutat&oacute;<br /></font></p>\n      </div>\n      <div class=\"col right\">\n        <h5 class=\"dark-grey\"><font face=\"Calibri\">Műszaki adatok</font></h5>\n        <p><font face=\"Calibri\"><font size=\"2\"><strong>Fejhallgat&oacute;</strong><br />Hangsug&aacute;rz&oacute;: 40 mm<br />Frekvencia&aacute;tvitel: 20 Hz &ndash; 20 KHz<br />Impedancia: 32 ohm<br />&Eacute;rz&eacute;kenys&eacute;g: 90 dB SPL / mW<br /><br /><strong>Mikrofon ir&aacute;nykarakterisztik&aacute;ja: kardioid (egyir&aacute;ny&uacute;)</strong><br />T&iacute;pus: nyom&aacute;sgradiens elektr&eacute;t kondenz&aacute;tor<br />Frekvencia&aacute;tvitel: 50 &ndash; 20 KHz<br />&Eacute;rz&eacute;kenys&eacute;g: -40 dBV / Pa re: 0 dB = 1 Pa, 1 KHz<br />Tesztk&ouml;r&uuml;lm&eacute;nyek: 3,0 V; 2,2 kohm</font></font></p>\n      </div>\n    </div>\n  ', 0.6, 7, 36, 3, '', '', 1, 0, 'A G230 kiváló minőségű sztereó hanggal segíti a játékban való elmélyülést az elejétől a végéig.', 'komp üzletág', '981-000540', 'HEA', 'Headset', '', 1, 0, NULL, NULL, NULL, NULL, 1),
