(752, 68183, 'LOG633', '', 'HDS Logitech G633 Artemis Spectrum Gamer Headset - Fekete', '', '85183095', 11, 'HEACRD', 'Vezetékes', 2, 1, '12/11/2015', 1, '', 0.87, 4, 24, 3, '', '', 1, 0, '', 'komp üzletág', '981-000605', 'HEA', 'Headset', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(753, 67217, 'LOHG930V20', '', 'HDS Logitech G930 Gamer Headset - Fekete', '', '85183095', 11, 'HEACRL', 'Vezetéknélküli', 2, 1, '11/16/2015', 1, '\n    <p><strong>Vezet&eacute;k n&eacute;lk&uuml;li, 7.1-es t&eacute;rhangz&aacute;s&uacute;, k&eacute;nyelmes kivitelű mikrofonos fejhallgat&oacute; programozhat&oacute; G-gombokkal j&aacute;t&eacute;kosok sz&aacute;m&aacute;ra. </strong></p>\n    <p>Logitech&reg; Wireless Gaming Headset G930 &ndash; A gyors vezet&eacute;k n&eacute;lk&uuml;li kapcsolatnak k&ouml;sz&ouml;nhetően l&eacute;p&eacute;st tarthat j&aacute;t&eacute;kost&aacute;rsaival an&eacute;lk&uuml;l, hogy mozg&aacute;sa korl&aacute;tozva lenne, mik&ouml;zben a 7.1-es t&eacute;rhat&aacute;s&uacute; hangz&aacute;s az akci&oacute; k&ouml;z&eacute;ppontj&aacute;ba var&aacute;zsolja.</p>\n    <div>Logitech&reg; Wireless Gaming Headset G930 &ndash; Tartson l&eacute;p&eacute;st j&aacute;t&eacute;kost&aacute;rsaival an&eacute;lk&uuml;l, hogy mozg&aacute;s&aacute;t korl&aacute;tozn&aacute;. A kifejezetten j&aacute;t&eacute;kra fejlesztett vezet&eacute;k n&eacute;lk&uuml;li kapcsolat akadoz&aacute;st&oacute;l &eacute;s interferenci&aacute;t&oacute;l mentes hang&aacute;tvitelt biztos&iacute;t ak&aacute;r 12 m&eacute;teres t&aacute;vols&aacute;gra is* &ndash; &iacute;gy m&aacute;r semmi nem &aacute;llhat győzelme &uacute;tj&aacute;ba. A Dolby&reg; technol&oacute;gi&aacute;ra &eacute;p&uuml;lő 7.1-es t&eacute;rhat&aacute;s&uacute; hangz&aacute;s r&eacute;szletes, ir&aacute;ny- &eacute;s t&aacute;vols&aacute;g&eacute;rz&eacute;kel&eacute;st lehetőv&eacute; tevő hangteret ny&uacute;jt, &iacute;gy m&eacute;g azelőtt meghallhatja ellenfeleit, hogy azok megl&aacute;tn&aacute;k &Ouml;nt. A h&aacute;rom programozhat&oacute; G-gombbal k&iacute;v&aacute;ns&aacute;ga szerint vez&eacute;relheti a zenelej&aacute;tsz&aacute;st, a hangtorz&iacute;t&aacute;st, a csevegőprogramokat &eacute;s m&eacute;g sz&aacute;mos egy&eacute;b funkci&oacute;t. A fejform&aacute;t megőrző fejp&aacute;ntnak k&ouml;sz&ouml;nhetően megterhel&eacute;s n&eacute;lk&uuml;l &eacute;lvezheti a j&aacute;t&eacute;kot, mik&ouml;zben a pl&uuml;ss f&uuml;lp&aacute;rn&aacute;k cs&ouml;kkentik a nyom&aacute;st az &eacute;rintkez&eacute;si pontokon, &eacute;s kiszűrik a zavar&oacute; zajokat. * A t&eacute;nyleges hat&oacute;t&aacute;vols&aacute;g a haszn&aacute;lat m&oacute;dj&aacute;t&oacute;l, a be&aacute;ll&iacute;t&aacute;sokt&oacute;l &eacute;s a k&ouml;rnyezeti felt&eacute;telektől f&uuml;ggően v&aacute;ltozik.</div>\n    <div>&nbsp;</div>\n    <div><strong>Tulajdons&aacute;gok :</strong></div>\n    <div>\n      <ul>\n        <li>A kifejezetten j&aacute;t&eacute;khoz fejlesztett vezet&eacute;k n&eacute;lk&uuml;li kapcsolat akadoz&aacute;st&oacute;l &eacute;s interferenci&aacute;t&oacute;l mentes hang&aacute;tvitelt biztos&iacute;t ak&aacute;r 12 m&eacute;teres t&aacute;vols&aacute;gban is* &ndash; &iacute;gy m&aacute;r semmi nem &aacute;llhat győzelme &uacute;tj&aacute;ba.</li>\n        <li>A 7.1-es t&eacute;rhat&aacute;s&uacute; hangz&aacute;s &eacute;s a fejlett Dolby&reg; technol&oacute;gia r&eacute;szletes, ir&aacute;ny- &eacute;s t&aacute;vols&aacute;g&eacute;rz&eacute;kel&eacute;st lehetőv&eacute; tevő hangteret ny&uacute;jt, &iacute;gy m&eacute;g azelőtt meghallhatja ellenfeleit, hogy azok megl&aacute;tn&aacute;k &Ouml;nt.</li>\n        <li>A h&aacute;rom programozhat&oacute; G-gombbal k&iacute;v&aacute;ns&aacute;ga szerint vez&eacute;relheti a zenelej&aacute;tsz&aacute;st, a hangtorz&iacute;t&aacute;st, a csevegőprogramokat &eacute;s m&eacute;g sz&aacute;mos egy&eacute;b funkci&oacute;t.</li>\n        <li>A fejform&aacute;t megőrző fejp&aacute;ntnak k&ouml;sz&ouml;nhetően megterhel&eacute;s n&eacute;lk&uuml;l &eacute;lvezheti a j&aacute;t&eacute;kot, mik&ouml;zben a pl&uuml;ss f&uuml;lp&aacute;rn&aacute;k cs&ouml;kkentik a nyom&aacute;st az &eacute;rintkez&eacute;si pontokon, &eacute;s kiszűrik a zavar&oacute; zajokat.</li>\n        <li>A zajszűrő mikrofon kiemeli a besz&eacute;dhangot, cs&ouml;kkenti a h&aacute;tt&eacute;rzajt &eacute;s f&eacute;lreford&iacute;t&aacute;skor automatikusan eln&eacute;mul.</li>\n      </ul>\n    </div>\n  ', 0.85, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '981-000550', 'HEA', 'Headset', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(754, 21822, 'LOH110', '', 'HDS Logitech H110 Headset - Szürke', '', '85183095', 11, 'HEACRD', 'Vezetékes', 2, 1, '4/28/2010', 1, '\n    <div>Logitech&reg; Stereo Headset H110 &ndash; Kezdődhet az online cseveg&eacute;s<br /><br />A Logitech&reg; Stereo Headset H110 fejhallgat&oacute;val azonnal megkezdheti az online cseveg&eacute;st. Teljes &eacute;rt&eacute;kű sztere&oacute; hangz&aacute;sa cseveg&eacute;sre, zenehallgat&aacute;sra, filmn&eacute;z&eacute;sre &eacute;s j&aacute;t&eacute;kra egyar&aacute;nt t&ouml;k&eacute;letesen alkalmass&aacute; teszi. A zajszűrő mikrofon cs&ouml;kkenti a zavar&oacute; h&aacute;tt&eacute;rzajokat, &iacute;gy hangja tiszt&aacute;n hallhat&oacute; lesz. A hajl&eacute;kony karon l&eacute;vő mikrofont bal &eacute;s jobb oldalra egyar&aacute;nt helyezheti, haszn&aacute;laton k&iacute;v&uuml;l pedig egyszerűen f&eacute;lreford&iacute;thatja. Az &aacute;ll&iacute;that&oacute; fejhallgat&oacute;p&aacute;nt szem&eacute;lyre szabott k&eacute;nyelmet ny&uacute;jt. &Eacute;s a 3,5 mm-es csatlakoz&oacute;knak k&ouml;sz&ouml;nhetően gyakorlatilag az &ouml;sszes sz&aacute;m&iacute;t&oacute;g&eacute;pes hangk&aacute;rty&aacute;val haszn&aacute;lhat&oacute;.<br /><br /><strong>Tulajdons&aacute;gok :</strong> </div>\n    <div>\n      <ul>\n        <li>A zajszűrő mikrofon cs&ouml;kkenti a zavar&oacute; h&aacute;tt&eacute;rzajokat, &iacute;gy hangja tiszt&aacute;n hallhat&oacute; lesz.</li>\n        <li>Mi&eacute;rt &aacute;llna meg az internetes h&iacute;v&aacute;sokn&aacute;l? Sztere&oacute; mikrofonos fejhallgat&oacute;ja zenehallgat&aacute;sra, filmn&eacute;z&eacute;sre &eacute;s j&aacute;t&eacute;kra is alkalmas.</li>\n        <li>A hajl&eacute;kony karon l&eacute;vő mikrofont bal &eacute;s jobb oldalra egyar&aacute;nt helyezheti, haszn&aacute;laton k&iacute;v&uuml;l pedig egyszerűen f&eacute;lreford&iacute;thatja.</li>\n        <li>Az &aacute;ll&iacute;that&oacute; fejhallgat&oacute;p&aacute;nt szem&eacute;lyre szabott k&eacute;nyelmet ny&uacute;jt.</li>\n        <li>A 3,5 mm-es csatlakoz&oacute;k gyakorlatilag az &ouml;sszes sz&aacute;m&iacute;t&oacute;g&eacute;pes hangk&aacute;rty&aacute;val kompatibilisek, &eacute;s egyszerű csatlakoz&aacute;st k&iacute;n&aacute;lnak.</li>\n      </ul>\n    </div>\n  ', 0.2, 4, 24, 3, '', '', 1, 0, '', 'komp üzletág', '981-000271', 'HEA', 'Headset', '', 1, 0, NULL, NULL, NULL, NULL, 1),
