(881, 70495, '40A40090EU', '40A40090EU', 'NBT Lenovo ThinkPad OneLink+  Dokkoló - 40A40090EU - Fekete - 90W', '', '84718000', 2, 'NBTDOK', 'Notebook Dokkolók', 2, 1, '2/17/2017', 2, '<p><strong>Features and benefits: </strong></p>\n\n<p>A single OneLink+ cable enables all docking functions while delivering continuous power, allowing you to boost your productivity in no time.</p>\n\n<p>Up to 4k video output allows you to enjoy a vivid video experience with your brand new ThinkPad Ultrabook</p>\n\n<p>Power button on dock mirrors system power button</p>\n\n<p>Gigabit Ethernet (10/100/1000) with Boot over LAN support*** on all ThinkPad OneLink+ systems</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Connectivity </strong></p>\n\n<p>- 4x USB 3.0 &ndash; 1 provide always-on mobile device charging</p>\n\n<p>- 2x USB 2.0</p>\n\n<p>- 1x OneLink+ upstream connector</p>\n\n<p>- 2x DP</p>\n\n<p>- 1x VGA</p>\n\n<p>- 1x Gigabit Ethernet</p>\n\n<p>- 1x Stereo/Mic Combo Port</p>\n\n<p>- 1 x Security lock hole</p>\n\n<p>- 1x DC in</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 1, 5, 12, 3, '', '', 1, 0, 'Kompatibilis: ThinkPad Yoga 260, X1 Carbon 4th Gen, ThinkPad X1 Yoga, ThinkPad X1 Tablet, Thinkpad Yoga 460, ThinkPad Yoga 14, ThinkPad P40 Yoga', 'pc üzletág', '40A40090EU', 'NBT', 'Notebook / Netbook Tartozék', '', 1, 0, NULL, NULL, NULL, NULL, 1),
