(957, 84021, 'ALCSPLASHBL', '', 'SMW Alcor Splash Aktivitásmérő Karpánt / Okos óra Fekete', '', '85176990', 41, 'SMW', 'Okosórák', 2, 1, '1/26/2017', 1, '<div>\n<p align=\"left\"><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><b>Alcor Splash &ndash; aktivitásmérő karpánt </b></span></span></p>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><b>Funkciók:&nbsp;</b></span></span></p>\n\n<ul>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">mozgásra aktiválódó kijelző </span></span><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">pulzusmérő&nbsp;</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">lépésszámláló </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">értesítések a bejövő hívásokról és üzenetekről (SMS, Facebook, Skype, stb.) </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">tétlenség figyelő</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">alvásminőség figyelő </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">elégetett kalóriák kiszámítása</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">pontos idő megjelenítése, ébresztések (vibrációval is)&nbsp;</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">elvesztési figyelmeztetés</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">készülék keresési funkció </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">fényképezőgép távvezérlő funkció </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">zenelejátszás távvezérlés </span></span></li>\n</ul>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><b>Műszaki jellemzők: </b></span></span></p>\n\n<ul>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Kijelző: 0.82&rdquo; monokróm OLED </span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Bluetooth: Bluetooth LE 4.2</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Vízállóság: IP65</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Magas minőségű szilikonból készült (cserélhető) karpánt</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Súly: 25g</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Akkumulátor: 3,7V / 60 mAh</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Készenléti idő: akár 7 nap</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Töltési idő: kb. 1 óra </span></span></li>\n</ul>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><b>Támogatott rendszerek: </b></span></span></p>\n\n<ul>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">iOS 8.0 +&nbsp;</span></span></li>\n	<li><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\">Android 4.3 + </span></span></li>\n</ul>\n</div>\n', 0.17, 5, 12, 3, '', '', 1, 0, '', 'oem üzletág', 'SPLASH BL', 'SMW', 'Okosór