(977, 60213, 'ALCSELFIE', '', 'MOBIL Alcor Selfie - Bluetooth teleszkópos selfiebot', '', '85177090', 41, 'CAMKIE', 'Kamera kiegészítő', 2, 1, '6/26/2015', 1, '\n    <div><font size=\"2\" face=\"Calibri\">Az Alcor Selfie egy k&ouml;nnyen kezelhető selfiebot,<br />29cm &eacute;s 115cm k&ouml;z&ouml;tt &aacute;ll&iacute;that&oacute; teleszk&oacute;pos tart&oacute;karral.<br />A szabv&aacute;ny műanyag r&ouml;gz&iacute;tőfej lehetőv&eacute; teszi az Alcor Action, <br />vagy m&aacute;s szabv&aacute;ny fejjel rendelkező akci&oacute;kamera r&ouml;gz&iacute;t&eacute;s&eacute;t. <br />Az univerz&aacute;lis telefontart&oacute; biztos&iacute;tja, hogy a mobiltelefont a k&iacute;v&aacute;nt poz&iacute;ci&oacute;ban &eacute;s sz&ouml;gben lehessen r&ouml;gz&iacute;teni. <br />A telefontart&oacute; k&ouml;r&uuml;lbel&uuml;l 4&rdquo;- 5,5&rdquo;-os telefon befogad&aacute;s&aacute;ra alkalmas. <br />Az Alcor Selfie seg&iacute;ts&eacute;g&eacute;vel meg&ouml;r&ouml;k&iacute;theted &eacute;leted legszebb pillanatait, legyen sz&oacute; extr&eacute;m sportr&oacute;l, <br />szabadidős tev&eacute;kenys&eacute;gről, koncertről, kir&aacute;ndul&aacute;sr&oacute;l &eacute;jjel vagy nappal egyar&aacute;nt.</font></div>\n    <div><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n    <div><font size=\"2\" face=\"Calibri\">Tulajdons&aacute;g: <br />Kompatibilit&aacute;s: iPhone, iPad, Samsung &eacute;s egy&eacute;b Bluetooth-k&eacute;pes eszk&ouml;z&ouml;k t&aacute;mogat&aacute;sa<br />Egyszerű kapcsol&oacute;d&aacute;s. Nincs sz&uuml;ks&eacute;g extra alkalmaz&aacute;sra, csak kapcsolja be &eacute;s haszn&aacute;lja.</font></div>\n    <div><font size=\"2\" face=\"Calibri\">&nbsp;</font></div>\n    <div><font size=\"2\" face=\"Calibri\">T&aacute;vkiold&oacute; műszaki jellemzői<br />Bluetooth verzi&oacute;&nbsp;Bluetooth 3.0<br />&Aacute;tviteli frekvencia&nbsp;2.4GHZ &ndash; 2.4835GHZ<br />&Aacute;ramfelv&eacute;tel&nbsp;5mA<br />Műk&ouml;d&eacute;si idő&nbsp;Ak&aacute;r 30 &oacute;ra<br