(1002, 32241, 'RGICE2TA15R1', '', 'EGY Cooler Master -  IC Essential E2 - Grease / High performance - Hütőpaszta - Arany', '', '84145915', 24, 'FANGRE', 'Hűtőpaszta', 2, 1, '8/7/2012', 1, '\n    <div style=\"text-align: left; padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; width: 630px; letter-spacing: normal; padding-right: 20px; font: 11px Tahoma, Verdana, Geneva, Arial, Helvetica, sans-serif; white-space: normal; orphans: 2; color: rgb(0,0,0); word-spacing: 0px; padding-top: 10px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px\">&nbsp;<font style=\"font-size: 16px; vertical-align: top\" face=\"Arial, Helvetica, sans-serif\"><b>Introduction</b></font><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_top.jpg\" />\n      <div style=\"background-image: url(http://www.coolermaster.com/templates/images/prod_detail_mid.jpg); border-bottom: 0px; border-left: 0px; padding-bottom: 0px; margin: 0px; padding-left: 20px; width: 590px; padding-right: 20px; border-top: 0px; border-right: 0px; padding-top: 5px\">The IC Essential E2 is a high performance thermal compound to meet the requirements of mainstream CPU cooling. With its low thermal impedance and appropriate viscosity, IC Essential E2 can provide very efficient heat transfer and can be spread easily and evenly. It\'s also bundled with a&nbsp;grease cleanser&nbsp;that allows you to easily clean old thermal grease away.</div><img style=\"padding-bottom: 0px; margin: 0px; padding-left: 0px; padding-right: 0px; padding-top: 0px\" src=\"http://www.coolermaster.com/templates/images/prod_detail_bot.jpg\" />\n    </div>\n    <div style=\"padding-bottom: 0px; widows: 2; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px; padding-left: 0px; letter-spacing: normal; padding