(1015, 70371, 'ARCHERC50', '', 'LAN Tp-Link Router Wireless Dual Band - Archer C50 AC1200', '', '85176200', 23, 'LANCRDROU', 'Router', 2, 1, '3/11/2016', 1, '\n    <div class=\"box title\">\n      <h1>AC1200 vezet&eacute;k n&eacute;lk&uuml;li Dual Band-es router <small>Archer C50</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>T&aacute;mogatja a k&ouml;vetkező gener&aacute;ci&oacute;s 802.11ac Wi-Fi szabv&aacute;nyt</li>\n        <li>Egyidejű 2,4 GHz 300 Mbps, &eacute;s 5GHz 867 Mbps sebess&eacute;gű vezet&eacute;k n&eacute;lk&uuml;li h&aacute;l&oacute;zatok sug&aacute;rz&aacute;sa</li>\n        <li>K&eacute;t k&uuml;lső dual bend-es antenna stabil vezet&eacute;k n&eacute;lk&uuml;li kapcsolatot &eacute;s megfelelő lefedetts&eacute;get ny&uacute;jt</li>\n        <li>USB csatlakoz&oacute; - k&ouml;nnyen lehetőv&eacute; teszi helyi nyomtat&oacute;k*, f&aacute;jlok** &eacute;s m&eacute;diatartalmak megoszt&aacute;s&aacute;t az otthoni h&aacute;l&oacute;zaton, illetve t&aacute;voli el&eacute;r&eacute;st FTP szerveren kereszt&uuml;l</li>\n        <li>A TP-LINK Tether alkalmaz&aacute;sa el&eacute;rhetőv&eacute; teszi a router k&ouml;nnyed kezel&eacute;si m&oacute;dj&aacute;t</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr id=\"tr_603\">\n            <th colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr id=\"tr_607\">\n            <th width=\"35%\">Csatlakoz&oacute;k</th>\n            <td width=\"65%\">4 db 10/100 Mbps LAN csatlakoz&oacute;<br />1 db 10/100 Mbps WAN csatlakoz&oacute;<br />1 db 2.0-s USB port</td>\n          </tr>\n          <tr id=\"tr_695\">\n            <th width=\"35%\">Gomb</th>\n            <td width=\"65%\">WPS/Reset gomb<br />Wi-Fi Ki/Bekapcsol&oacute; gomb<br />Ki/Bekapcsol&oacute; gomb</td>\n          </tr>\n          <tr id=\"tr_613\">\n            <th width=\"35%\">K&uuml;lső t&aacute;pell&aacu