(1025, 42291, 'ASACCROGNOMAD', '90XB0160-BBP000', 'BAG NB ASUS 10,1\" - 17,3\" Hátizsák - Republic of Gamer - Nomad - Fekete', '', '42022290', 5, 'BAGNBT173', '17\" mérettől', 2, 2, '1/23/2014', 2, '\n    <h1 style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 0px; widows: 1; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 10px 0px 26px; padding-left: 0px; letter-spacing: normal; padding-right: 0px; font: 26px/34px \'Segoe UI\', ?????, \'Microsoft JhengHei\', Arial, ????; white-space: normal; color: rgb(51,51,51); vertical-align: baseline; border-top: 0px; border-right: 0px; word-spacing: 0px; padding-top: 0px; font-stretch: inherit; text-rendering: optimizeLegibility; -webkit-text-stroke-width: 0px\" class=\"product-slogan\">Utaz&aacute;s j&aacute;tszani &ndash; k&eacute;nyelmetlens&eacute;g n&eacute;lk&uuml;l</h1>\n    <div style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 0px; widows: 1; text-transform: none; background-color: rgb(255,255,255); text-indent: 0px; margin: 0px 0px 10px; padding-left: 0px; width: 521px; letter-spacing: normal; padding-right: 0px; font: 12px/20px \'Segoe UI\', ?????, \'Microsoft JhengHei\', Arial, ????; white-space: normal; color: rgb(51,51,51); vertical-align: baseline; border-top: 0px; border-right: 0px; word-spacing: 0px; padding-top: 0px; font-stretch: inherit; -webkit-text-stroke-width: 0px\" class=\"product-intro\">\n      <ul style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 0px; list-style-type: none; margin: 0px 0px 10px 19px; padding-left: 0px; padding-right: 0px; font-family: inherit; vertical-align: baseline; border-top: 0px; list-style-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAAHe9q7oAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAADlJREFUeNpiYFj03xMggBiAxDOAAGIEEQwMDJIAAQRjJIMY/4GMFwABBpdigIDnTEAiBSQDxE9BbABCMROmV/rSAQAAAABJRU5ErkJggg==); border-right: 0px; padding-top: 0px; font-stretch: inherit\">\n        <li style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 5px; line-height: 14px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: inherit; font-size: 12px; vertical-align: baseline; border-top: 0px; border-right: 0px; padding-top: 5px; font-stretch: inherit\">A h&aacute;tizs&aacute;k egyes elemei a gladi&aacute;torok sisakjait t&uuml;kr&ouml;zik, jelezve az erőt &eacute;s dicsős&eacute;get.</li>\n        <li style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 5px; line-height: 14px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: inherit; font-size: 12px; vertical-align: baseline; border-top: 0px; border-right: 0px; padding-top: 5px; font-stretch: inherit\">A belső felf&uuml;ggeszt&eacute;si rendszer v&eacute;di az ak&aacute;r 17 h&uuml;velykes noteszg&eacute;pet, a kip&aacute;rn&aacute;zott rekeszekben pedig minden extra elf&eacute;r.</li>\n        <li style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 5px; line-height: 14px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: inherit; font-size: 12px; vertical-align: baseline; border-top: 0px; border-right: 0px; padding-top: 5px; font-stretch: inherit\">A j&oacute;l szellőző h&aacute;tp&aacute;rna garant&aacute;lja a hűv&ouml;s, k&eacute;nyelmes hord&aacute;st hosszabb &uacute;ton is.</li>\n        <li style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 5px; line-height: 14px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: inherit; font-size: 12px; vertical-align: baseline; border-top: 0px; border-right: 0px; padding-top: 5px; font-stretch: inherit\">A k&ouml;nnyű, tart&oacute;s, v&iacute;z&aacute;ll&oacute; 1680D &bdquo;ballisztikus&rdquo; nylon megv&eacute;di &eacute;s sz&aacute;razon tartja az &eacute;rt&eacute;kes holmit.</li>\n        <li style=\"border-bottom: 0px; border-left: 0px; padding-bottom: 5px; line-height: 14px; margin: 0px; padding-left: 0px; padding-right: 0px; font-family: inherit; font-size: 12px; vertical-align: baseline; border-top: 0px; border-right: 0px; padding-top: 5px; font-stretch: inherit\">Lev&aacute;laszthat&oacute; karabineres kulcstart&oacute;.</li>\n      </ul>\n    </div>\n  ', 1.75, 5, 12, 3, '', '', 1, 0, 'Nomad hátizsák 11,6\" - 17,3\", Republic of Gamer széria, Fekete', 'pc üzletág', 'BAG-17-NOMADBP-BK', 'BAG', 'Táska', '', 1, 0, NULL, NULL, NULL, NULL, 1),
