(1408, 84229, 'FP1500', 'PPF9000501', 'UPS FSP 1500VA FP1500', '', '85072020', 63, 'UPS15K', '1,1VA - 1,5VA között', 2, 1, '12/20/2016', 1, '\n    <table class=\"upstable\">\n      <tbody>\n        <tr>\n          <td>\n            <div><font face=\"Calibri\">Surge Protection 312J</font></div>\n            <div><font face=\"Calibri\">&nbsp;</font></div>\n            <div><font face=\"Calibri\">Model</font></div>\n          </td>\n          <td><font face=\"Calibri\">EP 1500</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Capacity</font></td>\n          <td><font face=\"Calibri\">1500 VA / 900W</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Input Voltage</font></td>\n          <td><font face=\"Calibri\">110 / 120 VAC or 220 / 230 / 240 VAC</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Input Voltage Range</font></td>\n          <td><font face=\"Calibri\">81-145 VAC / 162-290 VAC</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Input Frequence</font></td>\n          <td><font face=\"Calibri\">60/50 Hz (auto sensing)</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Output Voltage</font></td>\n          <td><font face=\"Calibri\">&plusmn;10%</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Output / Frequence Range</font></td>\n          <td><font face=\"Calibri\">60 Hz or 50 Hz &plusmn;1 Hz</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Output / Transfer Time (Typical)</font></td>\n          <td><font face=\"Calibri\">Typical 2-6 ms, 10ms max.</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Output / Waveform (Batt. Mode)</font></td>\n          <td><font face=\"Calibri\">Simulated Sine Wave</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Battery / Battery Type &amp; Number</font></td>\n          <td><font face=\"Calibri\">12 V / 9 AH x 2</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Battery / Backup Time (One PC load@120W) 10% Load</font></td>\n          <td><font face=\"Calibri\">25 min.</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Battery / Typical Recharge Time</font></td>\n          <td><font face=\"Calibri\">4-6 hours recover to 90% capacity</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Indicators / Ac Mode</font></td>\n          <td><font face=\"Calibri\">The right green LED lighting &amp; the 2nd to 5th green LEDs gradually lighting indicating load level</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Indicators / Battery Mode</font></td>\n          <td><font face=\"Calibri\">The right green LED flashing &amp; the 2nd to 5th green gradually lighting indicating battery capacity</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Indicators / Fault</font></td>\n          <td><font face=\"Calibri\">Red lighting</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Protection / Full Protection</font></td>\n          <td><font face=\"Calibri\">Overload, discharge and overcharge protection</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Alarm / Battery Mode</font></td>\n          <td><font face=\"Calibri\">Sounding every 10 seconds</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Alarm / Low Battery</font></td>\n          <td><font face=\"Calibri\">Sounding every second</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Alarm / Overload</font></td>\n          <td><font face=\"Calibri\">Sounding twice per second</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Alarm / Battery Replacement Alarm</font></td>\n          <td><font face=\"Calibri\">Sounding every 2 seconds</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Alarm / Fault</font></td>\n          <td><font face=\"Calibri\">Continuously sounding</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Outlet sockets</font></td>\n          <td><font face=\"Calibri\">Schuko x 3 + IEC x 3 / also provide India, French, Schuko, NEMA, and IEC for selections</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Physical Dimension, D x W x H (mm)</font></td>\n          <td><font face=\"Calibri\">397 x 146 x 205</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Physical Net Weight (kg)</font></td>\n          <td><font face=\"Calibri\">11.1</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Operating Environment / Humidity</font></td>\n          <td><font face=\"Calibri\">0-90% RH @ 0-40&deg;C (non-condensing)</font></td>\n        </tr>\n        <tr class=\"gold\">\n          <td><font face=\"Calibri\">Operating Environment / Noise Level</font></td>\n          <td><font face=\"Calibri\">Less than 40dB</font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\">Management / Optional USB / RS-232 Port</font></td>\n          <td><font face=\"Calibri\">Supports Windows&reg; 98/2000/2003/XP/Vista/2008, Windows&reg; 7, Linux, and MAC</font></td>\n        </tr>\n      </tbody>\n    </table>\n  ', 27.6, 5, 12, 3, '', '', 1, 0, '', 'komp üzletág', 'FP1500', 'UPS', 'Szünetmentes eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
