(1451, 24326, 'M570', '', 'Mouse Logitech M570 Trackball - Ezüst/kék', '', '84716070', 11, 'MOUCRLOPT', 'Optikai', 2, 2, '10/18/2010', 2, '\n    <div>\n      <p><strong>K&eacute;nyelmes vezet&eacute;k n&eacute;lk&uuml;li hanyatteg&eacute;r Logitech&reg; Unifying vevőegys&eacute;ggel &eacute;s 18 h&oacute;napos elem-&eacute;lettartammal. </strong></p>\n      <p>Logitech&reg; Wireless Trackball M570 - alternat&iacute;v k&eacute;nyelem. Egy helyben marad &eacute;s t&aacute;masztja a kez&eacute;t, &iacute;gy eg&eacute;sz nap k&eacute;nyelmesen dolgozhat vele.<br /><br />Logitech&reg; Wireless Trackball M570 - alternat&iacute;v k&eacute;nyelem. A stabil hanyatteg&eacute;r egy helyben marad &eacute;s formatervezett kialak&iacute;t&aacute;s&aacute;nak k&ouml;sz&ouml;nhetően t&aacute;masztja a kez&eacute;t, &iacute;gy eg&eacute;sz nap k&eacute;nyelmesen dolgozhat vele, ahelyett, hogy az eg&eacute;r ut&aacute;n matatna az asztalon. Az apr&oacute; Logitech&reg; Unifying vezet&eacute;k n&eacute;lk&uuml;li vevőegys&eacute;g el&eacute;g kicsi ahhoz, hogy hordozhat&oacute; sz&aacute;m&iacute;t&oacute;g&eacute;p&eacute;ben hagyja. A hanyatteg&eacute;r ak&aacute;r 18 h&oacute;napig is haszn&aacute;lhat&oacute; k&eacute;t elemcsere k&ouml;z&ouml;tt*. A hanyatteg&eacute;r seg&iacute;ts&eacute;g&eacute;vel pontosan vez&eacute;relheti a kurzort, b&aacute;rhol is haszn&aacute;lja &ndash; az M570 egerek neh&eacute;zs&eacute;g n&eacute;lk&uuml;l haszn&aacute;lhat&oacute;k kem&eacute;ny fel&uuml;letű asztalon, k&eacute;nyelmes kanap&eacute;n, de ak&aacute;r egyenetlen fel&uuml;letű &aacute;gyon is. Az integr&aacute;lt g&ouml;rgetőker&eacute;k &eacute;s a k&ouml;nnyen el&eacute;rhető Vissza/Előre gombok egyszerűv&eacute; teszik a vez&eacute;rl&eacute;st, ak&aacute;r a webet b&ouml;ng&eacute;szi hordozhat&oacute; sz&aacute;m&iacute;t&oacute;g&eacute;p&eacute;vel, ak&aacute;r a h&aacute;zimozi-PC-j&eacute;t ir&aacute;ny&iacute;tja. * Az elemek &eacute;lettartama a haszn&aacute;lati k&ouml;r&uuml;lm&eacute;nyektől f&uuml;ggően v&aacute;ltozhat.<br /><br /></p>\n      <h4>Tulajdons&aacute;gok :</h4>\n      <ul>\n        <li>Nem kell t&ouml;bb&eacute; az eg&eacute;r ut&aacute;n matatnia. Hanyattegere egy helyben marad, &eacute;s azt a h&uuml;velykujj&aacute;val ir&aacute;ny&iacute;tva navig&aacute;lhat a k&eacute;pernyőn, &iacute;gy nem kell megmozd&iacute;tania a karj&aacute;t a kurzor mozgat&aacute;s&aacute;hoz. Formatervezett kialak&iacute;t&aacute;s&aacute;nak k&ouml;sz&ouml;nhetően t&aacute;masztja a kez&eacute;t, &iacute;gy eg&eacute;sz nap k&eacute;nyelmesen vez&eacute;relheti a kurzort.</li>\n        <li>A hanyatteg&eacute;r a Logitech&reg; Unifying vevőegys&eacute;g seg&iacute;ts&eacute;g&eacute;vel tartja a kapcsolatot a sz&aacute;m&iacute;t&oacute;g&eacute;ppel. Az apr&oacute;, vezet&eacute;k n&eacute;lk&uuml;li vevőegys&eacute;get &aacute;lland&oacute;an, &iacute;gy utaz&aacute;s k&ouml;zben is a hordozhat&oacute; sz&aacute;m&iacute;t&oacute;g&eacute;phez csatlakoztatva hagyhatja. Emellett a vevőegys&eacute;ghez egyszerűen csatlakoztathat egy kompatibilis billentyűzetet, sz&aacute;mbillentyűzetet vagy egeret, &iacute;gy elker&uuml;lheti a t&ouml;bb USB-vevőegys&eacute;g haszn&aacute;lat&aacute;b&oacute;l ad&oacute;d&oacute; neh&eacute;zs&eacute;geket.</li>\n        <li>Ak&aacute;r 18 h&oacute;napig is haszn&aacute;lhatja az egeret elemcsere n&eacute;lk&uuml;l*, a t&ouml;lt&ouml;tts&eacute;g-jelző pedig gondoskodik arr&oacute;l, hogy sohase &eacute;rhesse meglepet&eacute;s.</li>\n        <li>A hanyatteg&eacute;r seg&iacute;ts&eacute;g&eacute;vel pontosan vez&eacute;relheti a kurzort, b&aacute;rhol is haszn&aacute;lja. Az M570 egerek neh&eacute;zs&eacute;g n&eacute;lk&uuml;l haszn&aacute;lhat&oacute;k kem&eacute;ny fel&uuml;letű asztalon, k&eacute;nyelmes kanap&eacute;n, de ak&aacute;r egyenetlen fel&uuml;letű &aacute;gyon is.</li>\n        <li>Az integr&aacute;lt g&ouml;rgetőker&eacute;k &eacute;s a k&ouml;nnyen el&eacute;rhető Vissza/Előre gombok egyszerűv&eacute; teszik a vez&eacute;rl&eacute;st, ak&aacute;r a webet b&ouml;ng&eacute;szi hordozhat&oacute; sz&aacute;m&iacute;t&oacute;g&eacute;p&eacute;vel, ak&aacute;r a h&aacute;zimozi-PC-j&eacute;t ir&aacute;ny&iacute;tja.</li>\n      </ul>\n    </div>\n  ', 0.3875, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '910-002090', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
