(1599, 57805, 'ARCHERC5', '', 'LAN Tp-Link Router Wireless Dual Band Gigabit - Archer C5 AC1200', '', '85176200', 23, 'LANCRDROU', 'Router', 1, 2, '3/9/2015', 2, '\n    <div class=\"box title\">\n      <h1>AC1200 vezet&eacute;k n&eacute;lk&uuml;li Dual Band-es Gigabites Router <small>Archer C5</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>T&aacute;mogatja a k&ouml;vetkező gener&aacute;ci&oacute;s 802.11ac Wi-Fi szabv&aacute;nyt</li>\n        <li>Egyidejű 2,4GHz 300Mbps, &eacute;s 5GHz 867Mbps sebess&eacute;gű vezet&eacute;k n&eacute;lk&uuml;li h&aacute;l&oacute;zatok sug&aacute;rz&aacute;sa</li>\n        <li>K&eacute;t USB csatlakoz&oacute; k&ouml;nnyen lehetőv&eacute; teszi helyi nyomtat&oacute;k*, f&aacute;jlok** &eacute;s m&eacute;diatartalmak megoszt&aacute;s&aacute;t az otthoni h&aacute;l&oacute;zaton, illetve t&aacute;voli el&eacute;r&eacute;st FTP szerveren kereszt&uuml;l</li>\n        <li>A vend&eacute;gh&aacute;l&oacute;zat lehetőv&eacute; teszi az &Ouml;n sz&aacute;m&aacute;ra, hogy otthoni vagy kis irodai Wi-Fi h&aacute;l&oacute;zat&aacute;t biztons&aacute;gosan megossza vend&eacute;geivel</li>\n        <li>A TP-LINK Tether alkalmaz&aacute;sa el&eacute;rhetőv&eacute; teszi a router k&ouml;nnyed kezel&eacute;si m&oacute;dj&aacute;t</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr id=\"tr_603\">\n            <th colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr id=\"tr_694\">\n            <th width=\"35%\">Csatlakoz&aacute;sok</th>\n            <td width=\"65%\">4 db 10/100/1000Mbps LAN Port<br />1 db 10/100/1000Mbps WAN Port<br />2 db 2.0-s USB port</td>\n          </tr>\n          <tr id=\"tr_695\">\n            <th width=\"35%\">Gomb</th>\n            <td width=\"65%\">WPS/Reset Gomb<br />Wi-Fi Ki- Bekapcsol&oacute;<br />Ki- Bekapcsol&oacute; Gomb</td>\n          </tr>\n          <tr id=\"tr_614\">\n            <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n            <td width=\"65%\">243 x 160,6 x 32,5mm (9.6 x 6.4 x 1.3 in.)</td>\n          </tr>\n          <tr id=\"tr_613\">\n            <th width=\"35%\">K&uuml;lső t&aacute;pell&aacute;t&aacute;s</th>\n            <td width=\"65%\">12VDC / 2.5A</td>\n          </tr>\n          <tr id=\"tr_1056\">\n            <th width=\"35%\">Antenna t&iacute;pusa</th>\n            <td width=\"65%\">2 db dual band-es cser&eacute;lhető antenna (RP-SMA)</td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  ', 1.22, 7, 36, 3, '', '', 1, 0, '300+867Mbps, 802.11 a/b/g/n/ac, 1x Gigabit WAN, 4x Gigabit LAN, 2x USB2.0, 2,4GHz/5GHz, 2x külső antenna, WEP/WPA/WPA2/WPA-PSK/WPA2-PSK', 'komp üzletág', 'ARCHER C5', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
