(1734, 55126, 'ALCACTIONG', '', 'CAM Alcor Action HD sportkamera - Arany', '', '85258091', 41, 'CAMSPO', 'Sportkamera', 2, 1, '11/21/2014', 1, '<font size=\"2\"><font face=\"Calibri\">\n        <div>Full HD sport kamera<br />Android &eacute;s iOS applik&aacute;ci&oacute;k<br />1,5&quot; sz&iacute;nes TFT kijelző<br />170&deg;-os, nagyl&aacute;t&oacute;sz&ouml;gű HD lencse<br />Novatek CPU<br />12 Mp-es Aptina CMOS szenzor<br />Vide&oacute; &eacute;s fot&oacute; m&oacute;dok<br />V&aacute;laszthat&oacute; vide&oacute; felbont&aacute;sok: 1080p(30fps), 720p(30fps), 720p(60fps)*,VGA(60fps)*, QVGA(60fps)<br />Vide&oacute; kodek: H.264<br />Vide&oacute; form&aacute;tum: MOV<br />4x digit&aacute;lis zoom<br />V&aacute;laszthat&oacute; fot&oacute; felbont&aacute;sok:12Mpixel, 8Mpixel, 5Mpixel<br />Fot&oacute;z&aacute;si m&oacute;dok: egy k&eacute;p, időz&iacute;tő (2/5/10 mp), sorozatk&eacute;p<br />Timelapse m&oacute;d: k&eacute;pk&eacute;sz&iacute;t&eacute;s 5, 10 vagy 20 m&aacute;sodpercenk&eacute;nt<br />Webkamera &eacute;s fed&eacute;lzeti kamera m&oacute;d<br />Be&eacute;p&iacute;tett mozg&aacute;s&eacute;rz&eacute;kelő<br />Be&eacute;p&iacute;tett k&eacute;pstabiliz&aacute;tor <br />HDR &uuml;zemm&oacute;d t&aacute;mogat&aacute;s<br />Bőv&iacute;t&eacute;s: Be&eacute;p&iacute;tett MicroSD k&aacute;rtyaolvas&oacute;, ak&aacute;r 32GB t&aacute;mogatott k&aacute;rtyam&eacute;ret<br />Be&eacute;p&iacute;tett mikrofon<br />Nyelvek: magyar (alap) &eacute;s t&ouml;bbnyelvű kezelőmen&uuml;<br />Akkumul&aacute;tor: cser&eacute;lhető 900 mAh <br />Műk&ouml;d&eacute;si idő: kb. 70 perc (1080p r&ouml;gz&iacute;t&eacute;s eset&eacute;n)<br />Kimenetek:&nbsp; micro USB (t&ouml;lt&eacute;s &eacute;s adatcsere), micro HDMI (type D) vide&oacute;kimenet <br />M&eacute;retek: 59(Sz) &times; 41(M) &times; 29(V)[mm]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br />S&uacute;ly: 44g (akkumul&aacute;tor n&ea