(2001, 55775, '40A20170EU', '40A20170EU', 'NBT Lenovo ThinkPad Ultra Dock 170W  40A20170EU', '', '84718000', 2, 'NBTDOK', 'Notebook Dokkolók', 2, 2, '11/18/2014', 2, '\n    <div>Features include:</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; 3x USB 2.0, one supports always-on USB charging<br />&nbsp;&nbsp;&nbsp; 3x USB 3.0</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; 10/1000 Gigabit Ethernet, supports enterprise manageability</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; 2x DisplayPort 1.2*<br />&nbsp;&nbsp;&nbsp; 1x DVI-D*<br />&nbsp;&nbsp;&nbsp; 1x HDMI 1.4*<br />&nbsp;&nbsp;&nbsp; 1x VGA*<br />&nbsp;&nbsp;&nbsp; Driver-free, perfect video quality</div>\n    <div>&nbsp;</div>\n    <div><br />&nbsp;&nbsp;&nbsp; 1x Stereo/Mic Combo Audio Port</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Charges your ThinkPad with an included ThinkPad 135W AC Adapter</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Physical rear alignment for a perfect dock every time</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Smaller desktop footprint vs. Series 3 docking stations</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Comes with ThinkPad AC adapter (170W)<br />&nbsp;&nbsp;&nbsp; </div>\n    <div>&nbsp;</div>\n    <div><br />&nbsp;&nbsp;&nbsp; <br />&nbsp;&nbsp;&nbsp; Physical Specifications</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Approximate Height: 55.6 mm</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Approximate Width: 345 mm</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Approximate Depth: 162.5 mm</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Approximate Weight: 0.92 Kg</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div><br />&nbsp;&nbsp;&nbsp; Operating environment:</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Temperature: 5 degrees C (41 degrees F) to + 43 degrees C (109 degrees F)</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Relative humidity: 8% to 95% (non-condensing)</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Packaging</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; The ThinkPad Ultra Dock</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Two Security Keys</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; ThinkPad 135W AC adapter</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Power cord</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; Publications</div>\n    <div>&nbsp;</div>\n    <div><br />&nbsp;&nbsp; <br />&nbsp;&nbsp;&nbsp; Warranty</div>\n    <div>&nbsp;</div>\n    <div>&nbsp;&nbsp;&nbsp; 1 year - Customer Replacement Unit (CRU) Service</div>\n  ', 0.1, 33, 12, 3, 'Lenovo', '', 3, 0, 'Lenovo ThinkPad Ultra Dock 170W', 'pc üzletág', '40A20170EU', 'NBT', 'Notebook / Netbook Tartozék', '', 1, 0, NULL, NULL, NULL, NULL, 1),
