(2070, 41808, 'TL-SG3424P', '12086', 'LAN Tp-Link Switch + PoE Gigabit Managed JetStream 24+4 port - TL-SG3424P POE', '', '85176200', 23, 'LANCRDSWM', 'Managelhető Switch', 1, 2, '5/8/2014', 2, '\n    <div class=\"box title\">\n      <h1>JetStream 24 portos gigabites L2 vez&eacute;relhető PoE+ switch 4 db komb&oacute; SFP csatlakoz&oacute;val <small>TL-SG3424P</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>T&aacute;mogatott mind a 24 db 802.3at/af-kompatibilis PoE+ csatlakoz&oacute;, amely &ouml;sszes&iacute;tett &aacute;ramell&aacute;t&aacute;sa 320W</li>\n        <li>IP-MAC-Port-VID &ouml;sszekapcsol&aacute;s, ACL, Port biztons&aacute;g, DOS elleni v&eacute;delem, Storm fel&uuml;gyelet, DHCP- Snooping, 802.1x hiteles&iacute;t&eacute;s &eacute;s r&aacute;diusz ny&uacute;jt sokr&eacute;tű biztons&aacute;gi lehetős&eacute;get</li>\n        <li>L2/L3/L4 QoS &eacute;s IGMP snooping optimaliz&aacute;lja a hang &eacute;s a vide&oacute; alkalmaz&aacute;sokat</li>\n        <li>WEB/CLI vez&eacute;rl&eacute;si m&oacute;d, SNMP, RMON sz&eacute;les vez&eacute;rl&eacute;si funkci&oacute;kat ny&uacute;jt</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr>\n            <th id=\"th_603\" colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <th width=\"35%\">Szabv&aacute;nyok &eacute;s protokollok</th>\n            <td width=\"65%\">IEEE 802.3i,IEEE 802.3u,IEEE 802.3ab,IEEE802.3z,IEEE 802.3ad,<br />IEEE 802.3x,IEEE 802.1d,IEEE 802.1s,IEEE 802.1w,IEEE 802.1q,<br />IEEE 802.1x,IEEE 802.1p,IEEE 802.3at,IEEE 802.3af</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Csatlakoz&aacute;sok</th>\n            <td width=\"65%\">24 db 10/100/1000 Mbps RJ-45 csatlakoz&oacute;<br />(Auto Negotiation/Auto MDI/MDIX)<br />4 db komb&oacute; 100/1000Mbps SFP bőv&iacute;tő<br />1 db konzol port</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati &ouml;sszek&ouml;ttet&eacute;s</th>\n            <td width=\"65%\">10BASE-T: UTP 3, 4, 5 kateg&oacute;ri&aacute;j&uacute; k&aacute;bel (Max. 100 m)<br />100BASE-TX/1000BASE-T: UTP 5, 5e vagy magasabb kateg&oacute;ri&aacute;j&uacute; k&aacute;bel<br />(Max. 100 m)<br />100BASE-FX: MMF, SMF<br />1000BASE-X: MMF, SMF</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Ventil&aacute;torok sz&aacute;ma</th>\n            <td width=\"65%\">3</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati t&aacute;pegys&eacute;g</th>\n            <td width=\"65%\">100~240VAC, 50/60Hz</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n            <td width=\"65%\">440 x 330 x 44 mm (17.32 x 13 x 1.73 in.)</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Energiafelv&eacute;tel</th>\n            <td width=\"65%\">Maximum (PoE-val): 358,2W (220V/50Hz)<br />Maximum (PoE n&eacute;lk&uuml;l): 38,2W (220V/50Hz)</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">PoE+ portok (RJ45)</th>\n            <td width=\"65%\">Szabv&aacute;nyos: 802.3at/af kompatibilis<br />PoE+ csatlakoz&oacute;k: 24 db<br />T&aacute;pell&aacute;t&aacute;s: 320W</td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  ', 6.774, 4, 24, 3, '', '', 1, 0, '24+4 port Gigabit Managed Switch + PoE, 24 10/100/1000Mbps RJ45, 4 kombó 100/1000Mbps SFP', 'komp üzletág', 'TL-SG3424P', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2071, 41790, 'TL-SL1351', '806', 'LAN Tp-Link Switch 48+3 port - TL-SL1351', '', '85176200', 23, 'LANCRDSWI', 'Switch', 1, 2, '5/8/2014', 2, '\n    <div class=\"box title\">\n      <h1>48&nbsp;portos 10/100 Mbps + 3 porton gigabites switch <small>TL-SL1351</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>48 db 10/100 Mbps RJ-45 csatlakoz&oacute;, 2 db 10/100/1000 Mbps RJ-45 csatlakoz&oacute;, 1 db gigabites SFP bőv&iacute;tőhely</li>\n        <li>Az innovat&iacute;v energiafelhaszn&aacute;l&aacute;ssal ak&aacute;r 35%-os megtakar&iacute;t&aacute;s is el&eacute;rhető</li>\n        <li>T&aacute;mogatott a MAC-c&iacute;m auto-learninggel &eacute;s auto MDI/MDIX</li>\n        <li>Szabv&aacute;nyos 19 inches rackbe szerelhető ac&eacute;l bor&iacute;t&aacute;s</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr>\n            <th id=\"th_603\" colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <th width=\"35%\">Szabv&aacute;nyok &eacute;s protokollok</th>\n            <td width=\"65%\">IEEE 802.3i, IEEE 802.3u, IEEE 802.3ab, IEEE802.3z, IEEE 802.3x</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Csatlakoz&aacute;sok</th>\n            <td width=\"65%\">48&nbsp;db 10/100 Mbps RJ-45 csatlakoz&oacute; (Auto-Negotiation, Auto-MDI/MDIX)<br />2 db 10/100/1000 Mbps RJ-45 csatlakoz&oacute; (Auto-Negotiation, Auto-MDI/MDIX)<br />1 db gigabites SFP bőv&iacute;tőhely</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati &ouml;sszek&ouml;ttet&eacute;s</th>\n            <td width=\"65%\">10BASE-T: 3, 4, 5 kateg&oacute;ri&aacute;s UTP-k&aacute;bel (maximum 100 m)<br />100BASE-TX/1000BASE-T: 5, 5e vagy nagy kateg&oacute;ri&aacute;s UTP-k&aacute;bel (maximum 100 m)<br />1000BASE-X: MMF, SMF</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Ventil&aacute;torok sz&aacute;ma</th>\n            <td width=\"65%\">Ventil&aacute;tor n&eacute;lk&uuml;li</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati t&aacute;pegys&eacute;g</th>\n            <td width=\"65%\">100-240VAC, 50/60Hz</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Energiafelv&eacute;tel</th>\n            <td width=\"65%\">Maximum: 21,1W (220V/50Hz)</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n            <td width=\"65%\">440 x 180 x 44 mm (17.3 x 7.1 x 1.7 in.)</td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  ', 4.13, 4, 24, 3, '', '', 1, 0, '48+3 port, 48 10/100Mbps RJ45, 2 10/100/1000Mbps RJ45, 1 Gigabit SFP', 'komp üzletág', 'TL-SL1351', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
