(2106, 67991, 'LENOVO-40A00065EU', '40A00065EU', 'NBT Lenovo ThinkPad Basic Dock Dokkoló - 40A00065EU - Fekete - 65W', '', '84718000', 2, 'NBTDOK', 'Notebook Dokkolók', 2, 1, '2/17/2017', 1, '<p>Features include:</p>\n\n<ul>\n	<li>3x USB 2.0, one supports always-on USB charging</li>\n	<li>1x USB 3.0</li>\n	<li>10/1000 Gigabit Ethernet, supports enterprise manageability</li>\n	<li>1x VGA</li>\n	<li>Driver-free, perfect video quality</li>\n	<li>Charges your ThinkPad with an included ThinkPad 65W AC Adapter</li>\n	<li>Security lock hole</li>\n	<li>Convenient eject button for one-step system removal</li>\n	<li>Physical rear alignment for a perfect dock every time</li>\n	<li>Smaller desktop footprint vs. Series 3 docking stations</li>\n	<li>Includes ThinkPad AC adapter (65W)</li>\n</ul>\n', 1, 5, 12, 3, '', '', 1, 0, 'Kompatibilis: X240, T540p, T440p, T440, T440s /integrált videokártyával szerelt készülékekhez/', 'pc üzletág', '40A00065EU', 'NBT', 'Notebook / Netbook Tartozék', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2107, 60601, '4X10A06688', '4X10A06688', 'NBT Lenovo ThinkPad Basic USB 3.0 Dokkoló - 4X10A06688 - Fekete', '', '84718000', 2, 'USBDOCNBK', 'Notebookhoz', 2, 1, '7/3/2015', 1, '<p style=\"text-align: justify\">Features include:</p>\n\n<ul>\n	<li>Instantly connect to all of your peripherals, the internet, and an external display</li>\n	<li>One single USB cable eliminates cable clutter to your notebook</li>\n	<li>Up to 10x the performance of USB 2.0-based docks for data and internet</li>\n	<li>Charge a mobile device, even when your notebook is away</li>\n	<li>Front ports:\n	<ul>\n		<li>2x USB 3.0 (One with Always-On Mobile Device Charging) - Ideal for use with memory keys, hard drives and other quick access devices</li>\n		<li>Stereo / Mic Combo Audio Port</li>\n	</ul>\n	</li>\n	<li>Rear ports\n	<ul>\n		<li>2x USB 2.0- Ideal for most USB devices, including printers, keyboards, and mice.</li>\n		<li>1x DVI</li>\n		<li>Includes DVI to VGA adapter</li>\n		<li>Gigabit Ethernet (10/100/1000)</li>\n		<li>Power In</li>\n	</ul>\n	</li>\n	<li>Cable lock slot for physical security on the side of the ThinkPad Basic USB 3.0 Dock</li>\n	<li>Power button to turn unit on and off</li>\n</ul>\n\n<ul>\n	<li>Compatibile: ThinkPad Helix, Yoga, Edge E145, S540, Edge E540, Edge E440, Edge E545, Edge E445, Edge E535, Edge S230u, Edge E530c, Edge E530, Edge E435, Edge E430c, Edge E430, Edge E335, Edge E330, Edge E335, Edge E135, Edge E130, T540p, T440p, T440, T440s, T431s, T430s, T430, T430u, T420s, W540, W530, W520, X1 Carbon, X140e, X240, X240s, X230s, X131e, X230, X230 Tablet, X1, X220, Lenovo V480, V580, V480c, V580c, M490s, L540, L440, L530, L430, L330</li>\n</ul>\n', 0.99, 5, 12, 3, '', '', 1, 0, 'Kompatibilis: ThinkPad Helix, Yoga, Edge E145, S540, Edge E540, Edge E440, Edge E545, Edge E445, Edge E535, Edge S230u, Edge E530c, Edge E530, Edge E435, Edge E430c, Edge E430, Edge E335, Edge E330, Edge E335, Edge E135, Edge E130, T540p, T440p, T440...', 'pc üzletág', '4X10A06688', 'USB', 'USB eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
