(2109, 41070, '4X10A06083', '4X10A06083', 'NBT Lenovo ThinkPad OneLink Dokkoló - 4X10A06083 - Fekete', '', '84718000', 2, 'NBTDOK', 'Notebook Dokkolók', 2, 1, '4/14/2014', 1, '<p><strong>Features and benefits:</strong></p>\n\n<ul>\n	<li>OneLink delivers data, driver-free video, and power through a single convenient connector</li>\n	<li>Unlike USB docks the Onelink Dock delivers video with no compression, no drivers and no impact on image quality and notebook performance</li>\n	<li>Power button on dock mirrors system power button</li>\n	<li>Available ports:\n	<div>&nbsp;</div>\n\n	<ul>\n		<li>Front Panel\n		<ul>\n			<li>2x USB 3.0 (One with Always-On Mobile Device Charging) - Ideal for use with memory keys, hard drives and other quick access devices</li>\n			<li>Stereo / Mic Combo Audio Port</li>\n		</ul>\n		</li>\n	</ul>\n\n	<div>&nbsp;</div>\n\n	<ul>\n		<li>Rear Panel\n		<ul>\n			<li>2x USB 2.0 - Ideal for most USB devices, including printers, keyboards, and mice</li>\n			<li>HDMI</li>\n			<li>Gigabit Ethernet (10/1000)</li>\n			<li>DC Power</li>\n		</ul>\n		</li>\n		<li>Cable lock slot for physical security on the side of the ThinkPad OneLink dock</li>\n	</ul>\n	</li>\n</ul>\n\n<div>&nbsp; <strong>Physical specifications</strong>&nbsp;&nbsp;&nbsp;&nbsp;\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"border-none\" width=\"100%\">\n	<tbody>\n		<tr>\n			<th class=\"v14-header-1\">&nbsp;</th>\n		</tr>\n	</tbody>\n</table>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"border-none\" width=\"100%\">\n	<tbody>\n		<tr align=\"left\" valign=\"top\">\n			<td colspan=\"2\">\n			<ul>\n				<li>Approximate height: 120mm</li>\n				<li>Approximate width: 200mm</li>\n				<li>Approximate depth: 170mm</li>\n				<li>Approximate weight: 1200g</li>\n			</ul>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p><strong>&nbsp;</strong></p>\n</div>\n', 0.99, 5, 12, 3, '', '', 1, 0, 'Kompatibilis: E431, E540, E440, E531, S540, S440, S431, S531, ThinkPad Yoga 12/15/14, X1 Carbon', 'pc üzletág', '4X10A06083', 'NBT', 'Notebook / Netbook Tartozék', '', 1, 0, NULL, NULL, NULL, NULL, 1),
