(2140, 85080, 'KDX130E', '416035', 'AUD JVC KD-X130E USB-s, piros autóhifi fejegység', '', '84719000', 89, 'AUDCARHEA', 'Autóhifi fejegység', 1, 1, '2/6/2017', 1, '<p>Részletes technikai adatok:</p>\n\n<p>Kijelző:</p>\n\n<p>&nbsp;&nbsp;&nbsp; 12+3 digitális kijelző<br />\n&nbsp;&nbsp;&nbsp; Mobiltelefon akkumulátor töltöttségi szint kijelzés<br />\n&nbsp;&nbsp;&nbsp; Piros gombmegvilágítás és fehér kijelző<br />\n&nbsp;&nbsp;&nbsp; Automatikus fényerőállítás<br />\n&nbsp;&nbsp;&nbsp; Fényerős vezérlés: Külön a kijelző és külön a gombsor fényereje is állítható</p>\n\n<p>Médialejátszás:</p>\n\n<p>&nbsp;&nbsp;&nbsp; MP3/WMA/WAV/FLAC lejátszás ID3 TAG támogatással, az USB-n keresztül</p>\n\n<p>USB lejátszó:</p>\n\n<p>&nbsp;&nbsp;&nbsp; Lejátszható formátumok: MP3/WMA/FLAC<br />\n&nbsp;&nbsp;&nbsp; Véletlen sorrendű lejátszás/ismétlés<br />\n&nbsp;&nbsp;&nbsp; Skip Funkció<br />\n&nbsp;&nbsp;&nbsp; ID3 Tag címke kijelzés</p>\n\n<p>AUX/USB csatlakozó:</p>\n\n<p>&nbsp;&nbsp;&nbsp; MP3/WMA/WAV/FLAC lejátszás ID3 TAG támogatással, az USB-n keresztül<br />\n&nbsp;&nbsp;&nbsp; Előlapi AUX bemenet (3,5 Jack)<br />\n&nbsp;&nbsp;&nbsp; Az USB-n keresztül tölti Okostelefonunkat maximum 1,5A töltéssel</p>\n\n<p>Rádióvevő</p>\n\n<p>&nbsp;&nbsp;&nbsp; HS-IVi típusú vevőegység (Magas érzékenység és szelektivitás a 8 változtatható sávszélességű KF szűrővel)<br />\n&nbsp;&nbsp;&nbsp; RDS EON szolgáltatás (Radio Data System)<br />\n&nbsp;&nbsp;&nbsp; Ez a rendszer a digitális adatokat FM rádiójelekkel együttesen továbbítja. A készülék az alábbi önműködő RDS szolgáltatásokat használja:<br />\n&nbsp;&nbsp;&nbsp; PS: Programszolgáltatás neve (8 karakterig megjeleníti az állomás nevét)<br />\n&nbsp;&nbsp;&nbsp; AF: Alternatív frekvenciaválasztás (ha egy csatornához több jel is elérhető, automatikusan kiválasztja a legerősebbet)<br />\n&nbsp;&nbsp;&nbsp; TA/TP: Közlekedési információk (közlekedési hírekre kapcsol automatikusan)<br />\n&nbsp;&nbsp;&nbsp; PTY: Műsortípusok (A pillanatnyi műsor típusát jelzi. Az állomások között műsortípus szerint is kereshet)<br />\n&nbsp;&nbsp;&nbsp; 18 FM, 6 MW/LW programhely</p>\n\n<p>Erősítő:</p>\n\n<p>&nbsp;&nbsp;&nbsp; 4 x 50W MOS-FET belső erősítő<br />\n&nbsp;&nbsp;&nbsp; Audio DAC: A tökéletes hangzás elérése érdekében<br />\n&nbsp;&nbsp;&nbsp; 5 sávos Parametrikus EQ a hangzásképek változatos beállításához<br />\n&nbsp;&nbsp;&nbsp; Easy EQ beállítás a gyors és precíz hangzásképek beállítására<br />\n&nbsp;&nbsp;&nbsp; 12 előre beállított hangzáskép<br />\n&nbsp;&nbsp;&nbsp; Source Link EQ: Forrás specifikus hangzás beállítás ( a rádiónál és az USB/AUX forrásnál is használhatunk más-más hangzásképet)<br />\n&nbsp;&nbsp;&nbsp; 1 pár 2,5V-os RCA kimenet külső erősítő csatlakoztatására<br />\n&nbsp;&nbsp;&nbsp; LPF szűrő: Low Pass Filter, amely lehetővé teszi a mély hangok vágási frekvenciáját</p>\n\n<p>Extrák:</p>\n\n<p>&nbsp;&nbsp;&nbsp; JVC Smart Music Control: Androidos telefonod segítségével távvezérelheted a készüléket<br />\n&nbsp;&nbsp;&nbsp; JVC Playlist Creator: ezzel az extra szolgáltatással saját lejátszási listát készíthetsz<br />\n&nbsp;&nbsp;&nbsp; Kormánytávvezérlésre előkészítve (külön megvásárolható adapter szükséges)</p>\n\n<p>Méretek:</p>\n\n<p>&nbsp;&nbsp;&nbsp; Készülék beépítési méretei: 182 x 53 x 158 mm (szélesség x magasság x mélység)<br />\n&nbsp;&nbsp;&nbsp; Készülék súlya: 1.26 kg</p>\n\n<a href=\"http://www.jvc.hu/product.php?id=KD-X130E&catid=100120\" target=\"_blank \" > Termék gyártói oldala</a>\n', 0.3, 4, 24, 3, '', '', 1, 0, '', 'komp üzletág', 'KD-X130E', 'AUD', 'Audio', '', 1, 0, NULL, NULL, NULL, NULL, 1),
