(2178, 80726, 'ASR-2130SLP', '', 'CON ADAPTEC ASR-2130SLP SGL RAIDkártya PCI-X133 U32', '', '8471', 107, 'SRVKIE', 'Szerver kiegészítő', 2, 2, '6/30/2016', 1, '\n    <div>Supported Operating Systems<br />Microsoft Windows<br />Novell NetWare<br />Red Hat Linux<br />SuSE Linux<br />SCO Openserver<br />SCO UnixWare<br />Solaris<br />FreeBSD<br />VMware<br />For a detailed list see ASK Answer ID 11563<br />Benefits<br />Low-profile PCI-X MD2 design ideal high-density server solution, 64-bit/133 MHz<br />Key Differentiators<br /><br />Optimized Disk Utilization<br />RAID Level Migration<br />Online capacity expansion<br />Background initialization (for immediate RAID availability)<br />S.M.A.R.T. and SAF-TE support<br />Hot-swap disk drive support for easy replacement<br />Hot-spare disk support with automatic rebuild<br />Supports bootable arrays<br />SNMP support<br />Customer Needs<br />Ideal for entry-level and high density servers and workstations servers requiring up to 15 disk drives<br />System Environment<br />Entry-level SCSI servers and workstations, pedestal and rackmount<br />Cache Memory<br />128 MByte embedded DDR memory<br />RAID Levels<br />Standard: 0, 1, 10, 5, 50, JBOD<br />Key RAID Features<br /><br />Optimized Disk Utilization, Online RAID Level Migration, Online Capacity Expansion, S.M.A.R.T and SAF-TE support, SNMP support<br />as well as the features from the Adaptec Advanced Data Protection Suite including:<br />Striped Mirror (RAID 1E)<br />Hot Space (RAID 5EE)<br />Dual Drive Failure Protection (RAID 6, 60)<br />Copyback Hot Spare<br />Optional RAID Features<br /><br />Snapshot Backup<br />Number of devices<br />15 SCSI devices per channel<br />Bus System Interface Type<br />64-bit/133MHz PCI-X, or 3.3 volt only PCI<br />External Connectors<br />One 68-pin VHDCI<br />Internal Connectors<br />One 68-pin high-density<br />Data Transfer Rate<br />Up to 320 MByte/sec<br />System Requirements<br />Available 3.3 volt PCI-X slot<br />Package Contents<br /><br />Adaptec SCSI RAID 2130S card<br />Low-profile bracket (in addition to the full-size bracket attached to the controller)<br />One 5-position, Ultra320 SCSI 68-pin high-density LVD Adaptec internal cable with active terminator (2138800-R)<br />Quick Install Guide<br />RAID Installation CD (bootable) including drivers and documentation<br />Adaptec Storage Manager&#153; Installation CD including management software and documentation <br />Warranty<br />3 years<br />Board Dimensions<br />Low-profile card<br />2.5in H x 6.6in L<br />6.4cm H x 16.8cm L<br />Power Requirements<br />15W typical; 2.2A @ 3.3V and 0.5A @ 5V<br />Operating Temperature<br />0&deg; to 50&deg; C<br />Regulatory Certification<br />FCC, UL, C-tick, CE, VCC<br />Mean Time Before Failure (MTBF)<br />881,719 hours at 40 degrees C<br />1,181,032 hours at 40 degrees C </div>\n  ', 0, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', 'ASR-2130SLP', 'SRV', 'Szerver', '', 1, 0, NULL, NULL, NULL, NULL, 1),
