(2222, 38439, 'WDBCTL0040HWTEESN', '', 'HDD EXT 3,5\" WD My Cloud Personal - 4TB USB3.0 - Fehér - WDBCTL0040HWT-EESN', '', '84717050', 54, 'HDDEXT', 'Külső', 2, 1, '5/12/2016', 1, '\n    <table id=\"Table_01\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"974\">\n      <tbody>\n        <tr>\n          <td valign=\"top\" width=\"496\" colspan=\"2\">\n            <div class=\"ovPadding\"><font face=\"Calibri\"><span class=\"pagetitle\">our media and files on your own personal cloud</span> </font>\n              <p><font face=\"Calibri\">My Cloud allows you to keep all your content in one safe place at home. No monthly fees. No limits.</font></p>\n              <p class=\"pagetitle\"><font face=\"Calibri\">Centralize your family\'s<br />media collection</font></p><font face=\"Calibri\">Store and organize all your family\'s photos, videos, music and important documents in one secure place on your home network. </font>\n            </div>\n          </td>\n          <td valign=\"top\" width=\"478\" colspan=\"2\"><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_04.jpg\" width=\"478\" /><br /></font></td>\n        </tr>\n        <tr>\n          <td valign=\"top\" colspan=\"2\" align=\"right\"><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/en/mycloud_05.jpg\" width=\"478\" height=\"72\" /><br /><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_06.jpg\" width=\"478\" height=\"216\" /></font></td>\n          <td valign=\"top\" colspan=\"2\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Access from anywhere</font></p>\n              <p><font face=\"Calibri\">Enjoy your digital life from anywhere on your PC, Mac, tablet or smartphone. With WD\'s free apps, your personal cloud is always with you.</font></p>\n              <p class=\"pagetitle\"><font face=\"Calibri\">Expand your tablet and smartphone storage</font></p><font face=\"Calibri\">Upload photos and videos directly to your personal cloud from anywhere and free up space on your mobile devices. </font>\n              <p>&nbsp;</p>\n            </div>\n          </td>\n        </tr>\n        <tr>\n          <td colspan=\"2\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Flexible backup options</font></p>\n              <p><font face=\"Calibri\">Back up, your way. PC users, WD SmartWare Pro offers options for how, when and where you back up your files. Mac users, utilize all the features of Apple Time Machine backup software to protect your data. </font></p>\n              <p><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/en/mycloud_12.jpg\" width=\"270\" height=\"113\" /></font></p>\n            </div>\n          </td>\n          <td width=\"192\">\n            <div><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_10.jpg\" width=\"192\" height=\"185\" /> </font></div>\n          </td>\n          <td valign=\"top\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Automatic file backup for all your computers</font></p><font face=\"Calibri\">Easily back up the files from all the PC and Mac computers in your home. Get peace of mind knowing that all your files are securely and automatically backed up on your network.</font>\n            </div>\n          </td>\n        </tr>\n        <tr>\n          <td valign=\"top\" width=\"496\" colspan=\"2\">\n            <div class=\"ovPadding\"><font face=\"Calibri\"><span class=\"pagetitle\">Connect to Dropbox and more</span> </font>\n              <p><font face=\"Calibri\">Easily transfer files between your personal cloud, Dropbox and other public cloud accounts using WD\'s free My Cloud mobile app.</font></p>\n            </div>\n          </td>\n          <td valign=\"top\" rowspan=\"2\" width=\"478\" colspan=\"2\">\n            <div class=\"ovPadding\"><font face=\"Calibri\"><span class=\"pagetitle\">Increase your personal cloud capacity</span> </font>\n              <p><font face=\"Calibri\">Simply attach a compatible USB 3.0 hard drive directly to the USB expansion port on the My Cloud drive and instantly expand your storage capacity.</font></p>\n            </div>\n          </td>\n        </tr>\n        <tr>\n          <td rowspan=\"2\" colspan=\"2\"><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_16.jpg\" width=\"496\" height=\"234\" /></font></td>\n        </tr>\n        <tr>\n          <td rowspan=\"3\" colspan=\"2\"><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_17.jpg\" width=\"478\" height=\"432\" /></font></td>\n        </tr>\n        <tr>\n          <td width=\"496\" colspan=\"2\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Transfer and access faster</font></p><font face=\"Calibri\">Gigabit Ethernet and a Dual-Core processor deliver faster file transfers and seamless remote access.</font>\n            </div>\n          </td>\n        </tr>\n        <tr>\n          <td width=\"270\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Password protection for privacy</font></p><font face=\"Calibri\">Your data is always safe and completely under your control. Protect your personal cloud from unauthorized access with password protection available for every user.</font>\n            </div>\n          </td>\n          <td><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_20.jpg\" width=\"226\" height=\"230\" /></font></td>\n        </tr>\n        <tr>\n          <td valign=\"top\" width=\"496\" colspan=\"2\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Add an extra layer of protection<br />for your files</font></p><font face=\"Calibri\">You can automatically make a second copy, or safepoint, of your My Cloud on your home network. With double-safe protection for all your media, you get ultimate peace of mind. </font>\n            </div>\n          </td>\n          <td valign=\"top\" rowspan=\"2\" width=\"478\" colspan=\"2\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Set up in minutes</font></p><font face=\"Calibri\">Get up and running in minutes with WD\'s rich web-based user interface for seamless web-guided setup. WD\'s software will auto-detect your drive to make it easy. Need extra help? Visit wd.com/setup/wdmycloud or call WD\'s easy setup hotline to have our expert customer support team walk you through the installation of My Cloud and WD\'s free apps for your computers and mobile devices.</font>\n            </div>\n          </td>\n        </tr>\n        <tr>\n          <td rowspan=\"2\" colspan=\"2\"><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_24.jpg\" width=\"496\" height=\"306\" /></font></td>\n        </tr>\n        <tr>\n          <td><font face=\"Calibri\"><img src=\"http://www.wdc.com/global/images/products/mycloud/global/mycloud_25.jpg\" width=\"192\" height=\"220\" /></font></td>\n          <td width=\"286\">\n            <div class=\"ovPadding\">\n              <p class=\"pagetitle\"><font face=\"Calibri\">Direct photo uploads from your camera with USB 3.0</font></p><font face=\"Calibri\">Simply connect your camera using the USB 3.0 port to quickly add all of your photos to your personal cloud.</font>\n            </div>\n          </td>\n        </tr>\n      </tbody>\n    </table>\n  ', 0.5, 4, 24, 3, '', '', 1, 0, 'SZÍN: Fehér, MÉRET: 3,5\", 4TB, CSATLAKOZÓ: USB3.0/Ethernet', 'komp üzletág', 'WDBCTL0040HWT-EESN', 'HDD', 'Merevlemez', '', 1, 0, NULL, NULL, NULL, NULL, 1),
