(2408, 30250, 'MR3020', '', 'LAN/WIFI Tp-Link 3G Router Wireless - TL-MR3020', '', '85176200', 23, 'LANCRL3-G', '3G eszköz', 2, 1, '2/2/2012', 1, '\n    <div>\n      <div class=\"box title\">\n        <h1>3G/4G Vezet&eacute;k n&eacute;lk&uuml;li N-es router <small>TL-MR3020</small></h1>\n      </div>\n      <div class=\"box highlights\">\n        <ul>\n          <li>Megosztja a 3G/4G* kapcsolatot, kompatibilis a 120+ LTE/HSPA+/HSUPA/HSDPA/UMTS/EVDO 3G/4G USB modemekkel, &eacute;les k&ouml;rnyezetben tesztelve</li>\n          <li>Utaz&aacute;shoz tervezve, el&eacute;g k&ouml;nnyű &eacute;s apr&oacute; ahhoz, hogy elvigye utaz&aacute;sai alkalm&aacute;val, lehetőv&eacute; teszi, hogy megossza 3G/4G* kapcsolat&aacute;t, ahol ez el&eacute;rhető</li>\n          <li>Vezet&eacute;k n&eacute;lk&uuml;li sebess&eacute;g 150Mbps</li>\n          <li>H&aacute;rom &uuml;zemeltet&eacute;si m&oacute;dra van lehetős&eacute;g: 3G/4G* router, WISP kliens router &eacute;s AP</li>\n          <li>3G/4G &eacute;s WAN be&aacute;ll&iacute;that&oacute; beugr&oacute; kapcsolatnak, a TL-MR3020 helyetes&iacute;tő internetkapcsolatot is ny&uacute;jthat</li>\n        </ul>\n      </div>\n      <div>&nbsp;</div>\n      <div>&nbsp;</div>\n      <div>\n        <table>\n          <thead>\n            <tr id=\"tr_603\">\n              <th colspan=\"2\">Hardver jellemzők</th>\n            </tr>\n          </thead>\n          <tbody>\n            <tr id=\"tr_694\">\n              <th width=\"35%\">Csatlakoz&aacute;sok</th>\n              <td width=\"65%\">1 db 10/100Mbps WAN/LAN csatlakoz&oacute;, 1 db USB 2.0 csatlakoz&aacute;s USB Modemhez, 1 db mini USB csatlakoz&oacute; az &aacute;ramell&aacute;t&aacute;shoz</td>\n            </tr>\n            <tr id=\"tr_695\">\n              <th width=\"35%\">Gomb</th>\n              <td width=\"65%\">QSS gomb, Reset gomb, funkci&oacute; kapcsol&oacute;</td>\n            </tr>\n            <tr id=\"tr_613\">\n              <th width=\"35%\">K&uuml;lső t&aacute;pell&aacute;t&aacute;s</th>\n              <td width=\"65%\">5VDC/1,0 A</td>\n            </tr>\n            <tr id=\"tr_697\">\n              <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n              <td width=\"65%\">74 x 67 x 22 mm (2.9 x 2.6 x 0.9 in.)</td>\n            </tr>\n            <tr id=\"tr_1056\">\n              <th width=\"35%\">Antenna t&iacute;pusa</th>\n              <td width=\"65%\">Belső antenna</td>\n            </tr>\n          </tbody>\n        </table>\n      </div>\n    </div>\n  ', 0.28, 7, 36, 3, '', '', 1, 0, '150Mbps', 'komp üzletág', 'TL-MR3020', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
