(2485, 53741, 'ASACCGM50', '90XB01L0-BMP000', 'Mousepad ASUS GM50 egérpad - Fekete / Piros', '', '39269097', 5, 'MOUEGY', 'Egérpad', 2, 1, '9/15/2014', 1, '\n    <h1 class=\"product-slogan\"><font face=\"Calibri\">A k&eacute;nyelem &eacute;s tart&oacute;ss&aacute;g szempontj&aacute;b&oacute;l alaposan tesztelt</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font face=\"Calibri\">Speci&aacute;lisan szőtt, felsőkateg&oacute;ri&aacute;s anyag laborban vizsg&aacute;lt, alacsony s&uacute;rl&oacute;d&aacute;s&uacute; bor&iacute;t&aacute;ssal</font></li>\n        <li><font face=\"Calibri\">A finom tapint&aacute;s&uacute;, text&uacute;r&aacute;zott fel&uuml;let jav&iacute;tja az optikai &eacute;s l&eacute;zeres egerek pontoss&aacute;g&aacute;t</font></li>\n        <li><font face=\"Calibri\">Ide&aacute;lis m&eacute;retek, 3,5 mm-es vastags&aacute;g a k&eacute;nyelmes j&aacute;t&eacute;khoz optimaliz&aacute;lva</font></li>\n        <li><font face=\"Calibri\">Csavard fel az eg&eacute;ral&aacute;t&eacute;tet a mell&eacute;kelt ROG csukl&oacute;p&aacute;nttal</font></li>\n        <li><font face=\"Calibri\">A k&aacute;belhurok seg&iacute;t, hogy az eg&eacute;r vezet&eacute;ke ne gabalyodjon &ouml;ssze</font></li>\n        <li><font face=\"Calibri\">A t&ouml;bbr&eacute;tegű, bakt&eacute;rium&ouml;lő bevonat a bakt&eacute;riumok ak&aacute;r 99,9 sz&aacute;zal&eacute;k&aacute;t meg&ouml;li.</font></li>\n        <li><font face=\"Calibri\">Kifejezetten FPS &eacute;s RTS j&aacute;t&eacute;kokhoz tervezett</font> </li>\n      </ul>\n    </div>\n  ', 0.27, 8, 60, 3, '', '', 1, 0, '380 x 280 x 3.5 mm. Gumi és nemszőtt kelme.', 'komp üzletág', 'KBM-MPAD-GM50MPAD-BK', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
