(2502, 34503, 'PRESENTERR700', '', 'PRS Logitech Presenter Professional R700 - Wireless', '', '85437090', 11, 'MOUPRS', 'Presenter', 2, 1, '12/21/2012', 1, '\n    <div>\n      <div class=\"column2\">\n        <h2 style=\"visibility: visible\"><font size=\"3\" face=\"Calibri\">Vezet&eacute;k n&eacute;lk&uuml;li bemutat&oacute;eszk&ouml;z &ndash; nagy f&eacute;nyerejű v&ouml;r&ouml;s l&eacute;zerrel &eacute;s k&ouml;nnyen kezelhető vez&eacute;rlőkkel &ndash; amely igaz&aacute;n hat&aacute;sos bemutat&oacute;kat tesz lehetőv&eacute;.<br /><br /></font></h2>\n        <p><font face=\"Calibri\">&nbsp;</font></p>\n      </div>\n      <div class=\"highlightRow\">\n        <div class=\"highlight left \">\n          <div class=\"highlightImageArea\"><font face=\"Calibri\"><img src=\"http://www.logitech.com/assets/46707/r700-presenter-overview-and-features.png\" width=\"120\" height=\"140\" /> </font></div>\n          <div class=\"highlightContent\">\n            <h4><font face=\"Calibri\">Kiv&aacute;l&oacute;, v&ouml;r&ouml;s f&eacute;nyű l&eacute;zermutat&oacute;</font></h4>\n            <p><font face=\"Calibri\">K&ouml;z&ouml;ns&eacute;ge pontosan l&aacute;tja, hov&aacute; is mutat.</font></p>\n          </div>\n        </div>\n        <div class=\"highlight left two\">\n          <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"LCD display\" src=\"http://www.logitech.com/assets/19744/19744.png\" width=\"120\" height=\"140\" /> </font></div>\n          <div class=\"highlightContent\">\n            <h4><font face=\"Calibri\">LCD-kijelző</font></h4>\n            <p><font face=\"Calibri\">Az időt, az akkumul&aacute;tor &aacute;llapot&aacute;t &eacute;s a vezet&eacute;k n&eacute;lk&uuml;li v&eacute;telt egyetlen pillant&aacute;ssal &eacute;s cs&ouml;ndes rezgőjelz&eacute;sekkel k&ouml;vetheti nyomon. &Iacute;gy &Ouml;n az &oacute;ra helyett a bemutat&oacute;ra koncentr&aacute;lhat.</font></p>\n          </div>\n        </div>\n      </div>\n      <div class=\"highlightRow\">\n        <div class=\"highlight left \">\n          <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Up to 100-foot (30-meter) range\" src=\"http://www.logitech.com/assets/19747/19747.png\" width=\"120\" height=\"140\" /> </font></div>\n          <div class=\"highlightContent\">\n            <h4><font face=\"Calibri\">Ak&aacute;r 30 m&eacute;teres hat&oacute;t&aacute;vols&aacute;g</font></h4>\n            <p><font face=\"Calibri\">Szabadon mozoghat a helyis&eacute;gben, &eacute;s a nagyobb hat&aacute;s kedv&eacute;&eacute;rt a k&ouml;z&ouml;ns&eacute;g k&ouml;z&eacute; vegy&uuml;lhet. A v&eacute;teliszint-jelzőnek k&ouml;sz&ouml;nhetően biztos lehet abban, hogy nem kalandozik t&uacute;l messzire.</font></p>\n          </div>\n        </div>\n        <div class=\"highlight left two\">\n          <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Intuitive slideshow controls\" src=\"http://www.logitech.com/assets/19749/19749.png\" width=\"120\" height=\"140\" /> </font></div>\n          <div class=\"highlightContent\">\n            <h4><font face=\"Calibri\">K&ouml;nnyen kezelhető diavet&iacute;t&eacute;s-vez&eacute;rlők</font></h4>\n            <p><font face=\"Calibri\">A gombok &eacute;rint&eacute;ssel k&ouml;nnyen megtal&aacute;lhat&oacute;k. A sima vonalvezet&eacute;sű kialak&iacute;t&aacute;s remek&uuml;l illeszkedik a k&eacute;zbe. Az első di&aacute;t&oacute;l az utols&oacute;ig a kez&eacute;ben lesz az ir&aacute;ny&iacute;t&aacute;s.</font></p>\n          </div>\n        </div>\n      </div>\n      <div class=\"highlightRow\">\n        <div class=\"highlight left \">\n          <div class=\"highlightImageArea\"><font face=\"Calibri\"><img alt=\"Plug-and-play wireless receiver\" src=\"http://www.logitech.com/assets/19750/19750.png\" width=\"120\" height=\"140\" /> </font></div>\n          <div class=\"highlightContent\">\n            <h4><font face=\"Calibri\">Plug-and-play rendszerű, vezet&eacute;k n&eacute;lk&uuml;li vevőegys&eacute;g</font></h4>\n            <p><font face=\"Calibri\">Egyetlen szoftvert sem sz&uuml;ks&eacute;ges hozz&aacute; telep&iacute;teni. Mind&ouml;ssze csatlakoztatnia kell a vevőegys&eacute;get egy USB-porthoz. A bemutat&oacute; v&eacute;gezt&eacute;vel pedig a vevőegys&eacute;get a bemutat&oacute;eszk&ouml;zben t&aacute;rolhatja.</font></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  ', 0.22, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '910-003507', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2503, 19056, 'PRESENTERR400', '', 'PRS Logitech Presenter R400 - Wireless', '', '85437090', 11, 'MOUPRS', 'Presenter', 2, 1, '9/24/2009', 1, '\n    <p><strong>2,4 GHz-es vezet&eacute;k n&eacute;lk&uuml;li bemutat&oacute;eszk&ouml;z k&ouml;nnyen kezelhető vez&eacute;rlőkkel</strong></p>\n    <p>A Logitech&reg; Wireless Presenter R400 a mondanival&oacute;ja kiemel&eacute;s&eacute;re k&eacute;sz&uuml;lt. Az &eacute;rint&eacute;ssel k&ouml;nnyen megkereshető vez&eacute;rlőket haszn&aacute;lva biztons&aacute;ggal navig&aacute;lhat a bemutat&oacute;ban.</p>\n    <div>A Logitech&reg; Wireless Presenter R400 a mondanival&oacute;ja kiemel&eacute;s&eacute;re k&eacute;sz&uuml;lt. A k&ouml;nnyen kezelhető diavet&iacute;t&eacute;s-vez&eacute;rlők seg&iacute;ts&eacute;g&eacute;vel biztons&aacute;ggal navig&aacute;lhat a bemutat&oacute;ban. A gombok k&ouml;nnyen megtal&aacute;lhat&oacute;k &eacute;rint&eacute;ssel. Form&aacute;ja remek&uuml;l illeszkedik a k&eacute;zbe. B&aacute;rmilyen h&aacute;tt&eacute;ren j&oacute;l l&aacute;that&oacute;, v&ouml;r&ouml;s sz&iacute;nű l&eacute;zermutat&oacute; &eacute;s 15 m&eacute;teres hat&oacute;t&aacute;vols&aacute;g biztos&iacute;tja, hogy szabadon mozoghasson a teremben, &eacute;s a k&ouml;z&ouml;ns&eacute;g k&ouml;z&eacute; vegy&uuml;lhessen. A Plug and Play rendszerű, vezet&eacute;k n&eacute;lk&uuml;li t&aacute;rolhat&oacute; vevőegys&eacute;ggel egyszerűen munk&aacute;hoz l&aacute;that, mivel egyetlen szoftvert sem kell telep&iacute;tenie. A bemutat&oacute; v&eacute;gezt&eacute;vel a vevőegys&eacute;g a bemutat&oacute;eszk&ouml;z belsej&eacute;ben t&aacute;rolhat&oacute;, &iacute;gy k&ouml;nnyű feladat az &ouml;sszecsomagol&aacute;s.</div>\n    <div>&nbsp;</div>\n    <div>\n      <h4>Term&eacute;ktulajdons&aacute;gok :</h4>\n      <ul>\n        <li>A k&ouml;nnyen kezelhető diavet&iacute;t&eacute;s-vez&eacute;rlők seg&iacute;ts&eacute;g&eacute;vel biztons&aacute;ggal navig&aacute;lhat a bemutat&oacute;ban. A gombok k&ouml;nnyen megtal&aacute;lhat&oacute;k &eacute;rint&eacute;ssel. Form&aacute;ja remek&uuml;l illeszkedik a k&eacute;zbe.</li>\n        <li>A v&ouml;r&ouml;s sz&iacute;nű l&eacute;zermutat&oacute; j&oacute;l l&aacute;that&oacute; a legt&ouml;bb h&aacute;tt&eacute;rrel.</li>\n        <li>A 15 m&eacute;teres hat&oacute;t&aacute;vols&aacute;gnak k&ouml;sz&ouml;nhetően szabadon mozoghat a helyis&eacute;gben, &eacute;s a nagyobb hat&aacute;s el&eacute;r&eacute;se &eacute;rdek&eacute;ben a k&ouml;z&ouml;ns&eacute;g k&ouml;z&eacute; vegy&uuml;lhet.</li>\n        <li>A Plug and Play rendszerű, vezet&eacute;k n&eacute;lk&uuml;li t&aacute;rolhat&oacute; vevőegys&eacute;g ind&iacute;t&aacute;sa egyszerű: csup&aacute;n egy USB-porthoz kell csatlakoztatnia azt, &eacute;s m&aacute;r haszn&aacute;lhatja is. Egyetlen szoftvert sem sz&uuml;ks&eacute;ges telep&iacute;teni. A bemutat&oacute; v&eacute;gezt&eacute;vel a vevőegys&eacute;g a bemutat&oacute;eszk&ouml;z belsej&eacute;ben t&aacute;rolhat&oacute;, &iacute;gy k&ouml;nnyű feladat az &ouml;sszecsomagol&aacute;s.</li>\n      </ul>\n    </div>\n  ', 0.18, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', '910-001357', 'MOU', 'Egér', '', 1, 0, NULL, NULL, NULL, NULL, 1),
