(2656, 64103, 'UH720', '', 'USB Tp-Link USB HUB - UH720', '', '84718000', 23, 'USBHUB', 'USB Hub', 2, 1, '10/14/2015', 1, '\n    <div>\n      <div class=\"box title\">\n        <h1>7 portos 3.0-s USB hub 2 t&ouml;lt&eacute;si csatlakoz&aacute;ssal <small>UH720</small></h1>\n      </div>\n      <div class=\"box highlights\">\n        <ul>\n          <li>A 3.0-s USB csatlakoz&aacute;sok ak&aacute;r 5Gbps sebess&eacute;get is el&eacute;rve tov&aacute;bb&iacute;tj&aacute;k az adatokat, 10-szer gyorsabban mint 2.0-s USB</li>\n          <li>A 7 db adat&aacute;tviteli port azt jelenti, hogy nem kell az eszk&ouml;z&ouml;k k&ouml;z&ouml;tt cser&eacute;lgetni az USB hubot</li>\n          <li>K&eacute;t k&uuml;l&ouml;n&aacute;ll&oacute; 5V/2,4A csatlakoz&oacute; t&ouml;lt&eacute;shez, ami felismeri &eacute;s optim&aacute;lis m&oacute;don t&ouml;lti az iOS vagy Android k&eacute;sz&uuml;l&eacute;ket</li>\n        </ul>\n        <p><em>* Megjegyz&eacute;s: Nem ig&eacute;nyel meghajt&oacute;t Windows 8.1 / 8 / 7 / Vista / XP, illetve Mac OS X &eacute;s Linux rendszerekhez. Visszamenőlegesen kompatibilis a 1.1 &eacute;s 2.0 USB-vel. Az aktu&aacute;lis &aacute;tviteli sebess&eacute;g a csatlakoztatott eszk&ouml;z be&aacute;ll&iacute;t&aacute;sait&oacute;l f&uuml;gg.</em></p>\n        <div>&nbsp;</div>\n        <div>&nbsp;</div>\n        <div>\n          <table>\n            <thead>\n              <tr>\n                <th id=\"th_3820\" colspan=\"2\">Specifik&aacute;ci&oacute;k</th>\n              </tr>\n            </thead>\n            <tbody>\n              <tr>\n                <th width=\"35%\">M&eacute;retek</th>\n                <td width=\"65%\">165 x 65,5 x 17,5 mm (6.5 x 2.6 x 0.7 in.)</td>\n              </tr>\n              <tr>\n                <th width=\"35%\">Kimeneti csatlakoz&oacute;</th>\n                <td width=\"65%\">7 x 3.0-s USB &quot;A&quot; szabv&aacute;ny, 2 x 2,4A t&ouml;lt&eacute;si csatlakoz&oacute;</td>\n              </tr>\n              <tr>\n                <th width=\"35%\">Bemeneti csatlakoz&oacute;</th>\n                <td width=\"65%\">1 db 3.0 USB Micro B</td>\n              </tr>\n              <tr>\n                <th width=\"35%\">Chipset</th>\n                <td width=\"65%\">VIA VL812 Chipset</td>\n              </tr>\n              <tr>\n                <th width=\"35%\">T&aacute;mogatott rendszerek</th>\n                <td width=\"65%\">Windows, Mac OS X &eacute;s Linux rendszerek</td>\n              </tr>\n              <tr>\n                <th width=\"35%\">Csomag tartalma</th>\n                <td width=\"65%\">7 x 3.0-s USB portos Hub 2 x t&ouml;lt&eacute;si csatlakoz&oacute; ajzattal UH720<br />12V &amp; 4A t&aacute;pegys&eacute;g<br />1 m 3.0 USB k&aacute;bel<br />Gyors telep&iacute;t&eacute;si &uacute;tmutat&oacute;</td>\n              </tr>\n            </tbody>\n          </table>&nbsp;\n          <p>&nbsp;</p>\n        </div>\n      </div>\n    </div>\n  \n\n\n\n<a href=\"http://www.tp-link.com/hu/products/details/UH720.html#overview\" target=\"_blank \" > Gyártói oldal</a>', 0.67, 7, 36, 3, '', '', 1, 0, '7port + 2x 2,4A töltési port, USB3.0', 'komp üzletág', 'UH720', 'USB', 'USB eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
