(2746, 35296, 'ASRTN12D', '90-IG10002MB0-3PA0-', 'LAN/WIFI Asus Router 300Mbps RT-N12 D1', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '2/8/2013', 1, '\n    <div class=\"row\"><span class=\"spec-item\"><strong><font size=\"4\">Specification</font></strong></span></div>\n    <div class=\"row\">\n      <ul class=\"product-spec\">\n        <li><span class=\"spec-item\">Network Standard&nbsp; </span>IEEE 802.11b, IEEE 802.11g, IEEE 802.11n, IEEE 802.3, IEEE 802.3u, IPv4, IPv6</li>\n        <li><span class=\"spec-item\">Product Segment&nbsp; </span>N300 complete networking; 300Mbps</li>\n        <li><span class=\"spec-item\">Data Rate</span> \n          <div class=\"spec-data\">802.11b : 1, 2, 5.5, 11Mbps<br />802.11g : 6,9,12,18,24,36,48,54Mbps<br />802.11n : up to 300Mbps</div>\n        </li>\n        <li><span class=\"spec-item\">Antenna&nbsp; </span>Detachable 5 dBi antenna x 2<br />*Antenna type will differ according to local regulations and requirement in each country</li>\n        <li><span class=\"spec-item\">Operating Frequency&nbsp; </span>2.4GHz</li>\n        <li><span class=\"spec-item\">Encryption&nbsp; </span>64-bit WEP, 128-bit WEP, WPA2-PSK, WPA-PSK, WPA-Enterprise, WPA2-Enterprise, WPS support</li>\n        <li><span class=\"spec-item\">Management&nbsp; </span>UPnP, IGMP v1/v2/v3, DNS Proxy, NTP Client, DDNS, Port Triger, Virtual Server, DMZ</li>\n        <li><span class=\"spec-item\">VPN Support</span> \n          <div class=\"spec-data\">IPSec Pass-Throuth<br />PPTP Pass-Through<br />L2TP Pass-Through<br />PPTP server</div>\n        </li>\n        <li><span class=\"spec-item\">Ports&nbsp; </span>1 x RJ45 for 10/100 BaseT for WAN, 4 x RJ45 for 10/100 BaseT for LAN<br /></li>\n        <li><span class=\"spec-item\">Button&nbsp; </span>WPS Button, Power Button</li>\n        <li><span class=\"spec-item\">LED Indicator</span> \n          <div class=\"spec-data\">PWR x 1<br />AIR x 1<br />WAN x 1<br />LAN x 4</div>\n        </li>\n        <li><span class=\"spec-item\">Power Supply</span> \n          <div class=\"spec-data\">AC Input : 110V~240V(50~60Hz)<br />DC Output : 12 V with max. 0.5 A current</div>\n        </li>\n        <li><span class=\"spec-item\">Dimensions&nbsp; </span>179 x 128 x 28 cm (WxDxH)</li>\n        <li><span class=\"spec-item\">Weight&nbsp; </span>275 g</li>\n        <li><span class=\"spec-item\">Package Content</span> \n          <div class=\"spec-data\">RT-N12*1<br />RJ45 Cable*1<br />5dbi Antenna*2<br />Warranty Card*1<br />Power Supply*1</div>\n        </li>\n      </ul>\n    </div>\n  ', 0.29, 7, 36, 3, '', '', 1, 0, '300Mbps, 802.11 b/g/n, 1x 10/100 WAN, 4x 10/100 LAN, 2,4GHz, 2x külső antenna, WEP/WPA/WPA2/WPS', 'komp üzletág', 'RT-N12_D1', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
