(2771, 82126, 'ASWSDA1', '90DW0020-B20000', 'LAN/WIFI Asus Router Travelair AC - WSD-A1', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '9/20/2016', 1, '\n    <h1 class=\"product-slogan\"><font size=\"2\" face=\"Calibri\">Ultragyors&nbsp;Wireless Flash&nbsp;Meghajt&oacute; mobil eszk&ouml;z&ouml;kh&ouml;z</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font size=\"2\" face=\"Calibri\">Az első&nbsp;802.11ac wireless flash meghajt&oacoacute;</font></li>\n        <li><font size=\"2\" face=\"Calibri\">Egy &eacute;rint&eacute;ses NFC az egyszerű kapcsolat &eacute;rdek&eacute;ben</font></li>\n        <li><font size=\"2\" face=\"Calibri\">Integr&aacute;lt SD k&aacute;rtya olvas&oacute; a megn&ouml;vekedett kapacit&aacute;s &eacute;rdek&eacute;ben</font></li>\n        <li><font size=\"2\" face=\"Calibri\">Intelligens ment&eacute;s</font></li>\n        <li><font size=\"2\" face=\"Calibri\">Egyszerre ak&aacute;r 5 eszk&ouml;z egyidejű csatlakoztat&aacute;sa</font></li>\n        <li><font size=\"2\" face=\"Calibri\">Ak&aacute;r 10 &oacute;ra &uuml;zemidő</font></li>\n      </ul>\n    </div>\n  ', 0, 4, 24, 3, '', '', 1, 0, 'Ultragyors Wireless Flash Meghajtó mobil eszközökhöz', 'komp üzletág', 'WSD-A1/32GB/W/13/WW', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
