(2773, 82500, 'ASUSBAC51', '90IG0150-BM3G00', 'LAN/WIFI Asus USB adapter 600Mbps USB-AC51', '', '85366990', 5, 'LANCRLUSB', 'USB adapter', 2, 1, '10/18/2016', 1, '\n    <h1 class=\"product-slogan\"><font face=\"Calibri\">Dual-Band Wireless-AC600 Wi-Fi adapter</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font face=\"Calibri\">The pocket-size 802.11ac USB Wi-Fi adapter </font></li>\n        <li><font face=\"Calibri\">Selectable dual-band 5GHz/2.4GHz for up to 433 Mbps </font></li>\n        <li><font face=\"Calibri\">Instant upgrade to next generation 5G Wi-Fi for your desktop and notebook </font></li>\n      </ul>\n    </div>\n  ', 0.74, 7, 36, 3, '', '', 1, 0, '600Mbps, 802.11 b/g/n/ac, USB2.0, belső antenna, WEP/WPA/WPA2', 'komp üzletág', 'USB-AC51', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2774, 82783, 'ASDSLN14U', '90IG00Z1-BM3000', 'LAN/WIFI Asus Modem Router 300Mbps DSL-N14U', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '11/7/2016', 1, '\n    <h1 class=\"product-slogan\"><font size=\"2\" face=\"Calibri\">Wireless ADSL modem router with wide coverage, multiple SSID and USB applications</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font size=\"2\" face=\"Calibri\">Dual-purpose 300 Mbps wireless ADSL Modem Router</font></li>\n        <li><font size=\"2\" face=\"Calibri\">USB port for network print server, file sharing, Download Master and media server</font></li>\n        <li><font size=\"2\" face=\"Calibri\">ASUSWRT Dashboard for easy 30-second setup and advanced network control via an intuitive graphical interface</font></li>\n        <li><font size=\"2\" face=\"Calibri\">PPTP server for secure VPN data transmission</font></li>\n        <li><font size=\"2\" face=\"Calibri\">ASUS AiCloud allows you to access, sync, share and stream data from your home network to any internet-connected PC, Android or iOS device</font> </li>\n      </ul>\n    </div>\n  ', 3.26, 7, 36, 3, '', '', 1, 0, '300Mbps, 802.11 b/g/n, 1x 10/100 WAN, 4x,10/100 LAN, 2,4GHz, 2x külső antenna', 'komp üzletág', 'DSL-N14U', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2775, 82837, 'AS4GAC55U', '90IG01H0-BM3000', 'LAN/WIFI Asus Router AC1200Mbps LTE 4G-AC55U', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '11/18/2016', 1, '\n    <h1 class=\"product-slogan\"><font size=\"3\" face=\"Calibri\">Wireless-AC1200 LTE Modem Router</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font face=\"Calibri\">Built-in dual-WAN connection for flexible home and office connectivity </font></li>\n        <li><font face=\"Calibri\">150 Mbps downloads, 5X faster than HSPA+ (3G)<sup>1</sup></font></li>\n        <li><font face=\"Calibri\">867 Mbps 802.11ac Wi-Fi, up to 6X faster than 802.11n<sup>2</sup></font></li>\n        <li><font face=\"Calibri\">Lightning-fast with 4X coverage</font></li>\n        <li><font face=\"Calibri\">Accurate 10-segment 4G LTE signal strength indicator for easy router positioning</font></li>\n        <li><font face=\"Calibri\">Twin detachable 4G LTE antennas can be upgraded easily</font></li>\n        <li><font face=\"Calibri\">VPN server and VPN client support for secure and private communications</font></li>\n        <li><font face=\"Calibri\">Operating frequencies: 4G FDD-LTE: 800 /1800 /2600, 4G TDD-LTE: 2500 /2600, 3G UMTS: 850 /900 /2100, 2G EDGE/GPRS/GSM: 850 /900 /1800 /1900</font> </li>\n      </ul>\n    </div>\n  ', 1.55, 7, 36, 3, '', '', 1, 0, '867Mbps, 4G LTE SIM, 802.11 a/b/g/n/ac, 1x Gigabit WAN, 4x Gigabit LAN, 1x USB2.0, 2,4GHz/5GHz, 4x külső antenna, WEP/WPA/WPA2/WPS', 'komp üzletág', '4G-AC55U', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2776, 82838, 'ASRTAC58U', '90IG02N0-BM3000', 'LAN/WIFI Asus Router AC1300Mbps RT-AC58U', '', '85176200', 5, 'LANCRLROU', 'Router', 2, 1, '11/21/2016', 1, '\n    <h1 class=\"product-slogan\"><font size=\"2\" face=\"Calibri\">AC1300 Dual-Band Gigabit Wi-Fi Router</font></h1>\n    <div class=\"product-intro\">\n      <ul>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>Super-Fast Wi-Fi</strong> - Dual-band 802.11ac Wi-Fi with concurrent speeds up to 867Mbps (5GHz) and 400Mbps (2.4GHz)</font></font></li>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>Improved Wi-Fi Range</strong> - Four external 5dBi antennas for improved Wi-Fi range and multi-device performance</font></font></li>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>MU-MIMO</strong> - Revolutionary technology for the best multi-device performance</font></font></li>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>Quad-Core Processor</strong> - Responsive network performance and smooth data handling</font></font></li>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>128MB Memory for Multi-Tasking</strong> - Fast memory architecture enables stable multiple simultaneous download streams on multiple devices</font></font></li>\n        <li><font size=\"2\"><font face=\"Calibri\"><strong>USB 3.0</strong> - up to 10X faster data transfer speeds</font></font></li>\n      </ul>\n    </div>\n  ', 0.81, 7, 36, 3, '', '', 1, 0, '400+867Mbps, 802.11 a/b/g/n/ac, 1x Gigabit WAN, 4x Gigabit LAN, 1x USB3.0, 1x USB3.0, 2,4GHz/5GHz, 3x külső antenna, WEP/WPA/WPA2/WPS', 'komp üzletág', 'RT-AC58U', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
