(2785, 80757, 'MK0W2ZMA', '', 'ADA Apple Lightning to USB3 Camera Adapter - MK0W2ZM/A', '', '85366990', 8, 'ADA', 'Adapter / átalakító', 2, 1, '9/22/2016', 1, '\n    <div>\n      <div class=\"as-productinfosection-sidepanel column large-3 small-12\">\n        <h3>&nbsp;</h3>\n      </div>\n      <div class=\"as-productinfosection-mainpanel column large-9 small-12\" itemprop=\"description\">\n        <div class=\"para-list as-pdp-lastparalist\">\n          <p>A Lightning &ndash; USB 3 kameraadapterrel egyszerűen m&aacute;solhatod &aacute;t fot&oacute;idat &eacute;s vide&oacute;idat nagy felbont&aacute;s&uacute; digit&aacute;lis kamer&aacute;r&oacute;l az iPad Pr&oacute;ra. A&nbsp;Lightning &ndash; USB&nbsp;3 kameraadapter csatlakoztat&aacute;sakor az iPad Pro automatikusan megnyitja a Fot&oacute;k alkalmaz&aacute;st. Ekkor eld&ouml;ntheted, hogy melyik f&eacute;nyk&eacute;pet &eacute;s vide&oacute;t szeretn&eacute;d import&aacute;lni, a program pedig albumokba rendezi őket. </p>\n        </div>\n        <div class=\"para-list as-pdp-lastparalist\">\n          <p>Ha a Lightning&nbsp;&ndash;&nbsp;USB&nbsp;3 kameraadaptert egy USB h&aacute;l&oacute;zati adapterrel is kieg&eacute;sz&iacute;ted, m&eacute;g tov&aacute;bb n&ouml;velheted az iPad&nbsp;Pro sokoldal&uacute;s&aacute;g&aacute;t. &Iacute;gy USB-csatlakoz&oacute;s perif&eacute;ri&aacute;kat &ndash; p&eacute;ld&aacute;ul eloszt&oacute;kat, Ethernet-adaptert, audio- vagy MIDI-interf&eacute;szt, illetve CompactFlash-, SD- &eacute;s microSD-k&aacute;rtyaolvas&oacute;t &ndash; is csatlakoztathatsz hozz&aacute;. </p>\n        </div>\n        <div class=\"para-list as-pdp-lastparalist\">\n          <p>A&nbsp;Lightning&nbsp;&ndash;&nbsp;USB&nbsp;3 kameraadapter a szabv&aacute;nyos k&eacute;pform&aacute;tumok (JPEG &eacute;s RAW) mellett az SD- &eacute;s HD-videoform&aacute;tumokat, &iacute;gy a H.264 &eacute;s az MPEG-4 form&aacute;tumot is t&aacute;mogatja. A 12,9 h&uuml;velykes iPad Pro az USB 3 adat&aacute;tviteli sebess&eacute;g&eacute;t ny&uacute;jtja, a 9,7 h&uuml;velykes modell viszont USB 2-es kapcsolatot haszn&aacute;l. </p>\n        </div>\n      </div>\n    </div>\n  ', 0, 5, 12, 3, '', '', 1, 0, '', 'pc üzletág', 'MK0W2ZM/A', 'ADA', 'Adapter / átalakító', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(2786, 61413, 'MC704ZMA', '', 'ADA Apple USB Ethernet Adapter (Macbook Air 2010) - MC704ZM/A', '', '85366990', 8, 'ADAVGA', 'VGA átalakító', 2, 1, '1/30/2017', 1, '\n    <div>\n      <div id=\"product-info\" class=\"community-section\">\n        <h2><font size=\"2\" face=\"Calibri\">Term&eacute;kinform&aacute;ci&oacute;</font></h2>\n        <ul class=\"product-info-sections\">\n          <li id=\"overview-features\" class=\"section two-column\">\n            <div class=\"column\">\n              <div class=\"group-image-none clearfix\">\n                <div class=\"bkg-none\">\n                  <p><font size=\"2\" face=\"Calibri\">A Lightning&ndash;digit&aacute;lis AV-adapter a Lightning csatlakoz&oacute;s Retina kijelzős iPad, iPad mini, iPhone 5 &eacute;s &ouml;t&ouml;dik gener&aacute;ci&oacute;s iPod touch k&eacute;sz&uuml;l&eacute;kekkel haszn&aacute;lhat&oacute;. A Lightning&ndash;digit&aacute;lis AV-adapterrel ak&aacute;r 1080p HD felbont&aacute;sban t&uuml;kr&ouml;zheted HDMI-csatlakoz&oacute;s eszk&ouml;z&ouml;kre (telev&iacute;zi&oacute;ra, kijelzőre, projektorra vagy egy&eacute;b kompatibilis kijelzőre) a k&eacute;sz&uuml;l&eacute;ked kijelzőj&eacute;n megjelenő tartalmat &ndash; p&eacute;ld&aacute;ul az alkalmaz&aacute;sokat, prezent&aacute;ci&oacute;kat, webhelyeket, diabemutat&oacute;kat. </font></p>\n                </div>\n              </div>\n            </div>\n            <div class=\"column\">\n              <div class=\"group-image-none clearfix\">\n                <div class=\"bkg-none\">\n                  <p><font size=\"2\" face=\"Calibri\">Az adapter a videotartalom (p&eacute;ld&aacute;ul a filmek, sorozatok, videofelv&eacute;telek) nagy k&eacute;pernyőn val&oacute; lej&aacute;tsz&aacute;s&aacute;t is t&aacute;mogatja ak&aacute;r 1080p HD felbont&aacute;s mellett. Ehhez elegendő a Lightning&ndash;digit&aacute;lis AV-adaptert egyfelől k&eacute;sz&uuml;l&eacute;ked Lightning csatlakoz&oacute;j&aacute;hoz, m&aacute;sik v&eacute;g&eacute;t pedig (k&uuml;l&ouml;n beszerezhető) HDMI-k&aacute;bellel a telev&iacute;zi&oacute;hoz vagy projektorhoz csatlakoztatni. </font></p>\n                </div>\n              </div>\n            </div>\n          </li>\n          <li id=\"overview-whatsinthebox\" class=\"section one-column panels\">\n            <div class=\"side-panel\">\n              <h3 class=\"h2 no-subtitle\"><font size=\"2\" face=\"Calibri\">A doboz tartalma </font></h3>\n            </div>\n            <div class=\"main-panel\">\n              <div class=\"column\">\n                <div class=\"group-image-none clearfix\">\n                  <div class=\"bkg-none\">\n                    <ul class=\"pbl bulleted\">\n                      <li><font size=\"2\" face=\"Calibri\">Lightning&ndash;digit&aacute;lis AV-adapter </font></li>\n                    </ul>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </li>\n          <li id=\"overview-requirements\" class=\"section one-column panels\">\n            <div class=\"side-panel\">\n              <h3 class=\"h2 no-subtitle\"><font size=\"2\" face=\"Calibri\">Rendszerk&ouml;vetelm&eacute;nyek </font></h3>\n            </div>\n            <div class=\"main-panel\">\n              <div class=\"column\">\n                <div class=\"group-image-none clearfix\">\n                  <div class=\"bkg-none\">\n                    <ul class=\"pbl bulleted\">\n                      <li><font size=\"2\" face=\"Calibri\">T&eacute;v&eacute;hez vagy projektorhoz val&oacute; csatlakoztat&aacute;s&aacute;hoz (k&uuml;l&ouml;n beszerezhető) HDMI-k&aacute;bel sz&uuml;ks&eacute;ges. T&aacute;mogatja a video- &eacute;s a hangkimenetet egyar&aacute;nt. </font></li>\n                    </ul>\n                  </div>\n                </div>\n              </div>\n            </div>\n          </li>\n        </ul>\n      </div>\n    </div>\n  ', 0, 5, 12, 3, '', '', 1, 0, '', 'pc üzletág', 'MC704ZM/A', 'ADA', 'Adapter / átalakító', '', 1, 0, NULL, NULL, NULL, NULL, 1),
