(2862, 85072, 'TLWR1043NDV4', '', 'LAN/WIFI Tp-Link Router Wireless Gigabit - TL-WR1043NDV4', '', '85176200', 23, 'LANCRLROU', 'Router', 2, 1, '2/21/2017', 1, '<div class=\"box title\">\n<h1>450Mbps Vezeték nélküli N-es Gigabites router <small>TL-WR1043ND</small></h1>\n</div>\n\n<div class=\"box highlights\">\n<ul>\n	<li>450Mbps Vezeték nélküli sebesség és Gigabites Ethernet portok ideális megoldást jelentenek HD video streminghez</li>\n	<li>Multifunkciós 2.0-ás USB csatlakozó - helyi nyomtatók, fájlok és médiatartalmak megosztása az otthoni hálózaton, távoli elérés FTP szerveren keresztül</li>\n	<li>Egyszerű vezeték nélküli hálózat titkosítása WPS gombbal</li>\n</ul>\n</div>\n\n<div>&nbsp;</div>\n\n<div>\n<table>\n	<thead>\n		<tr>\n			<th colspan=\"2\" id=\"th_603\">Hardver jellemzők</th>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<th width=\"35%\">Csatlakozások</th>\n			<td width=\"65%\">4 db 10/100/1000Mbps LAN Port<br />\n			1 db 10/100/1000Mbps WAN Port<br />\n			1 db 2.0-s USB port</td>\n		</tr>\n		<tr>\n			<th width=\"35%\">Gomb</th>\n			<td width=\"65%\">WPS/Reset Gomb<br />\n			Wi-Fi Ki- Bekapcsoló<br />\n			Ki- Bekapcsoló Gomb</td>\n		</tr>\n		<tr>\n			<th width=\"35%\">Antenna</th>\n			<td width=\"65%\">3 db 5 dBi-s cserélhető omni irányú antenna (RP-SMA)</td>\n		</tr>\n		<tr>\n			<th width=\"35%\">Külső tápellátás</th>\n			<td width=\"65%\">12VDC / 1.5A</td>\n		</tr>\n		<tr>\n			<th width=\"35%\">Vezeték nélküli szabványok</th>\n			<td width=\"65%\">IEEE 802.11n, IEEE 802.11g, IEEE 802.11b</td>\n		</tr>\n		<tr>\n			<th width=\"35%\">Méretek (Sz x Mé x Ma)</th>\n			<td width=\"65%\">225 x 141 x 30mm (8.9 x 5.6 x 1.2in.)</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n', 0, 7, 36, 3, '', '', 1, 0, '450Mbps, 802.11 b/g/n, 4x 10/100/1000Mbps LAN, 1x 10/100/1000Mbps WAN, 1x USB2.0, 2,4GHz, 3x külső cserélhető antenna, WEP/WPA/WPA2/WPA-PSK/WPA2-PSK', 'komp üzletág', 'TL-WR1043NDV4', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
