(2899, 49827, 'LENOVO-40A10065EU', '40A10065EU', 'NBT Lenovo ThinkPad Pro Dock-65 W  40A10065EU', '', '84718000', 2, 'NBTDOK', 'Notebook Dokkolók', 2, 1, '12/21/2016', 1, '<p>Tulajdonságok:</p>\n\n<ul>\n	<li>3&times; USB 2.0 csatlakozó, amiből egy &bdquo;always-on&rdquo; USB port</li>\n	<li>3&times; USB 3.0 csatlakozó</li>\n	<li>10/1000 Gigabit Ethernet hálózati csatlakozó</li>\n	<li>1&times; DisplayPort 1.2 csatlakozó</li>\n	<li>1&times; DVI-D csatlakozó</li>\n	<li>1&times; VGA csatlakozó</li>\n	<li>1&times; Sztereo Fülhalgató / Mikrofon kombo jack audio csatlakozó</li>\n	<li>Driver mentes használat, tökéletes képminőség</li>\n	<li>Kensington zár nyílás</li>\n	<li>Dedikált dokkoló csatlakozó a tökéletes dokkolás érdekében</li>\n	<li>Fizikai nyomógomb a biztonságos lecsatlakoztatáshoz</li>\n	<li>Kisebb és ergonomikusabb kialakítás a korábbi szériákhoz képest</li>\n	<li>Tápelletás biztosítása dedikált ThinkPad 65W AC Adapter segítségével, ami a csomag részét képzi</li>\n</ul>\n', 0.5, 5, 12, 3, '', '', 1, 0, 'Kompatibilis: ThinkPad X240, T540p, T440, T440p, T440s... /Integrált videokártyával szerelt készülékekhez/', 'pc üzletág', '40A10065EU', 'NBT', 'Notebook / Netbook Tartozék', '', 1, 0, NULL, NULL, NULL, NULL, 1),
