(3059, 86203, 'MCFREEPCW32BONT', '', 'MUL MODECOM FreePC - hordozható mini PC 2GB/32GB - Windows 10 Stick- Bontott, karcos', '', '85219000', 17, 'MULVMCNHD', 'Beépített HDD nélkül', 2, 2, '3/31/2017', 1, '<font size=\"2\" face=\"Calibri\">&nbsp; </font>\n    <div id=\"akapit_head_2\" class=\"detail_head red\"><font face=\"Calibri\"><font size=\"2\"><span>-</span> Műszaki adatok</font></font></div>\n    <div id=\"akapit_txt_2\" class=\"detail_box\"><font face=\"Calibri\"><font size=\"2\">&bull; <strong>OS:</strong> Windows 10<br />&bull; <strong>CPU:</strong> Intel Atom Bay Trail-CR Z3735F Quad Core<br />&bull; <strong>Graphics:</strong> Intel HD graphics<br />&bull; <strong>Display:</strong> supports up to Full HD 1080p<br />&bull; <strong>RAM:</strong> 2GB DDR3L-RS<br />&bull; <strong>Storage:</strong> 32GB eMMC<br />&bull; <strong>MicroSDHC:</strong> up to 128GB<br />&bull; <strong>Wireless:</strong> WiFi<br />&bull; <strong>Bluetooth:</strong> 4.0 Low Energy<br />&bull; <strong>Power</strong> 5V /2A<br />&bull; <strong>Dimensions</strong> 99.6 x 37.6 x 9.6mm<br />&bull; Accessories Power adapter, USB cable (power/OTG), manual<br />&bull; <strong>Ports:</strong></font></font>\n      <p><font size=\"2\" face=\"Calibri\">1 x mini USB 2.0<br />1 x micro USB 2.0<br />1 x micro USB 2.0 (power</font>)</p>\n    </div>\n  ', 0, 5, 12, 3, '', '', 1, 0, 'Intel Atom  Z3735F Quad Core, 2GB RAM, 32GB eMMC, Mini USB, Micro USB, Wifi, Bluetooth, Windows 8.1', 'komp üzletág', 'PC-MC-FREEPC-WIN10', 'MUL', 'Multimédia eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
(3060, 85983, '41D-009-102', '', 'BAG NB Samsonite 14\" táska Cityscape/Tech hátizsák - Fekete 41D-009-102', '', '42022290', 16, 'BAGNBT141', '14.1\" méretig', 2, 1, '3/31/2017', 1, '<div class=\"product-details\" id=\"product-details\">\n<div class=\"inner-wrapper\">\n<div class=\"product-details_column\" itemprop=\"description\">\n<h3><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Termék információ</span></span></h3>\n\n<div class=\"product-details_content\">\n<table>\n	<tbody>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Model</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Laptop Backpack</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Szín</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Black</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Anyag</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">60% Nylon + 30% Polyester + 10% Polyurethane</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Terjedelem</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">43.5 x 32.0 x 20.5 cm</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Max. laptop méret</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">3.5 x 34.0 x 25.0 cm (? 35.8 cm)</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Max tablet méret</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">0.8 x 24.0 x 17.6 cm (? 25.7 cm)</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Űrtartalom</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">15.5 L</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Súly</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">1 kg</span></span></td>\n		</tr>\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Garancia</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">2 év globális garancia</span></span></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n</div>\n\n<div class=\"product-details_column\" itemprop=\"description\">&nbsp;</div>\n\n<div class=\"product-details_column\" itemprop=\"description\">\n<p><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">&nbsp;Extra tulajdonság:</span></span></p>\n\n<table>\n	<tbody class=\"attribute-group\">\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Bővíthető</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Méretnövelést tesz lehetővé.</span></span></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<div class=\"product-details_column\" itemprop=\"description\">\n<table>\n	<tbody class=\"attribute-group\">\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Kabinbőrönd</span></span></th>\n			<td><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">A kabin méretű bőrönd megfelel az IATA előírásainak és felvihető a repülőgép fedélzetére. Utazás előtt javasoljuk az Ön által választott légitársaság kézipoggyász előírásainak megtekintésé</span></span></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<div class=\"product-details_column\" itemprop=\"description\">\n<table>\n	<tbody class=\"attribute-group\">\n		<tr>\n			<th><span style=\"font-size: 11px\"><span style=\"font-family: tahoma,geneva,sans-serif\">Smart Sleeve</span></span></th>\n			<td><span style=\"font-family: tahoma,geneva,sans-serif\"><span style=\"font-size: 11px\">Praktikus pánt a táska, bőröndhöz való rögzítésére, a könnyed üzleti utak érdekében</span>.</span></td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<div class=\"product-details_column\" itemprop=\"description\">&nbsp;</div>\n\n<div class=\"product-details_column\" id=\"product-info\" itemprop=\"description\"><a href=\"http://www.samsonite.hu/cityscape-tech-laptop-backpack-35.5cm-14inch/66226.html?dwvar_66226_color=1041&cgid=#q=Cityscape%2FTech%2B&start=1\" target=\"_blank\">Termék gyártói oldala</a></div>\n</div>\n</div>\n', 0, 4, 24, 3, '', '', 1, 0, 'MÉRET:46 x 34 x 23 cm', 'komp üzletág', '41D-009-102', 'BAG', 'Táska', '', 1, 0, NULL, NULL, NULL, NULL, 1),
