(3095, 79589, 'T1600G-52PS', '', 'LAN Tp-Link Switch + PoE Smart JetStream 48+4sfp port - T1600G-52PS(TL-SG2452P)', '', '84718000', 23, 'LANCRDSWI', 'Switch', 2, 2, '12/19/2016', 1, '\n    <div class=\"box title\">\n      <h1>JetStream 48 portos gigabites smart PoE+ switch 4 db SFP lehetős&eacute;ggel <small>T1600G-52PS (TL-SG2452P)</small></h1>\n    </div>\n    <div class=\"box highlights\">\n      <ul>\n        <li>T&aacute;mogatott mind a 48 db 802.3at/af-kompatibilis PoE+ csatlakoz&oacute;, amely &ouml;sszes&iacute;tett &aacute;ramell&aacute;t&aacute;sa 384W</li>\n        <li>L2+ funkci&oacute; - Statikus routing, seg&iacute;ti a belső forgalmi &uacute;tvonalat a h&aacute;l&oacute;zati erőforr&aacute;sok hat&eacute;konyabb felhaszn&aacute;l&aacute;sa &eacute;rdek&eacute;ben</li>\n        <li>Gigabites csatlakoz&aacute;s minden porton, teljes adat&aacute;tviteli sebess&eacute;get ny&uacute;jtva</li>\n        <li>IP-MAC-Port &ouml;sszekapcsol&aacute;s, ACL, Port biztons&aacute;g, DoS elleni v&eacute;delem, Storm fel&uuml;gyeletl, DHCP Snooping, 802.1X &eacute;s Radius hiteles&iacute;t&eacute;s k&iacute;n&aacute;l erős biztons&aacute;gi strat&eacute;gi&aacute;kat</li>\n        <li>L2/L3/L4 QoS &eacute;s az IGMP-snooping a hang- &eacute;s vide&oacute; alkalmaz&aacute;sok forgalm&aacute;t optimaliz&aacute;lja</li>\n        <li>IPv6 t&aacute;mogat&aacute;s kettős IPv4 / IPv6 stack, MLD-snooping, IPv6 felder&iacute;t&eacute;s</li>\n        <li>WEB/CLI vez&eacute;rl&eacute;si m&oacute;d, SNMP, RMON &eacute;s kettős megjelen&iacute;t&eacute;s nagysz&aacute;m&uacute; vez&eacute;rl&eacute;si jellemzőket k&iacute;n&aacute;l</li>\n      </ul>\n    </div>\n    <div>&nbsp;</div>\n    <div>\n      <table>\n        <thead>\n          <tr>\n            <th id=\"th_603\" colspan=\"2\">Hardver jellemzők</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <th width=\"35%\">Szabv&aacute;nyok &eacute;s protokollok</th>\n            <td width=\"65%\">IEEE 802.3i, IEEE 802.3u, IEEE 802.3ab, IEEE802.3z, IEEE 802.3ad, IEEE 802.3x, IEEE 802.1d, IEEE 802.1s, IEEE 802.1w, IEEE 802.1q, IEEE 802.1p, IEEE 802.1x</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Csatlakoz&oacute;k</th>\n            <td width=\"65%\">48 db 10/100/1000 Mbps RJ-45 csatlakoz&oacute; (Auto Negotiation/Auto MDI/MDIX)<br />4 db gigabites SFP csatlakoz&oacute;</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati &ouml;sszek&ouml;ttet&eacute;s</th>\n            <td width=\"65%\">10BASE-T: UTP 3, 4, 5 kateg&oacute;ri&aacute;j&uacute; k&aacute;bel (Max. 100 m)<br />100BASE-TX/1000Base-T: UTP 5, 5e vagy magasabb kateg&oacute;ri&aacute;j&uacute; k&aacute;bel (Max. 100 m)<br />1000BASE-X: MMF, SMF</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Ventil&aacute;torok sz&aacute;ma</th>\n            <td width=\"65%\">3</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">H&aacute;l&oacute;zati t&aacute;pegys&eacute;g</th>\n            <td width=\"65%\">100~240VAC, 50/60Hz</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">Energiafelv&eacute;tel</th>\n            <td width=\"65%\">Maximum (PoE-val): 470,4W (220V/50Hz)<br />Maximum (PoE n&eacute;lk&uuml;l): 46,5W (220V/50Hz)</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">PoE+ portok (RJ45)</th>\n            <td width=\"65%\">Szabv&aacute;ny: 802.3at/af kompatibilis<br />PoE+ csatlakoz&oacute;k: 48 db<br />T&aacute;pell&aacute;t&aacute;s: 384W</td>\n          </tr>\n          <tr>\n            <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n            <td width=\"65%\">440 x 330 x 44 mm (17.3 x 13 x 1.73 in.)</td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  ', 0, 8, 60, 3, '', '', 1, 0, '48+4port Switch, 48 10/100/1000 Mbps RJ45, 4 Gigabit SFP', 'komp üzletág', 'T1600G-52PS(TL-SG2452P)', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NU