(3646, 51003, 'TLM5250', '', 'LAN/WIFI Tp-Link 3G Router Wireless - M5250', '', '84718000', 23, 'LANCRL3-G', '3G eszköz', 1, 2, '6/12/2014', 2, '\n    <div class=\"row\">\n      <div class=\"col brief\">\n        <div class=\"box title\">\n          <h1>3G-s Mobil Wi-Fi <small>M5250</small></h1>\n        </div>\n        <div class=\"box highlights\">\n          <ul>\n            <li>3G modemmel ell&aacute;tva - nincs sz&uuml;ks&eacute;g k&uuml;lső modemre</li>\n            <li>HSPA+ h&aacute;l&oacute;zat t&aacute;mogat&aacute;sa 21,6Mbps let&ouml;lt&eacute;si &eacute;s 5,7Mbps felt&ouml;lt&eacute;si sebess&eacute;gig</li>\n            <li>Erőteljes 2000mAh&nbsp; akkumul&aacute;tor ide&aacute;lis t&ouml;bb &oacute;r&aacute;s k&uuml;lt&eacute;ri haszn&aacute;lathoz</li>\n            <li>T&aacute;mogatott max. 10 k&eacute;sz&uuml;l&eacute;k egyidejű csatlakoztat&aacute;sa</li>\n          </ul>\n        </div>\n        <div id=\"divOthersBasic\" class=\"box others\">\n          <div class=\"add-to-cart-box\">\n            <div class=\"button-and-price\"><b class=\"price\">&nbsp;</b></div>\n            <div class=\"button-and-price\"><strong>&nbsp;</strong></div>\n            <div class=\"button-and-price\">\n              <table>\n                <thead>\n                  <tr>\n                    <th id=\"th_603\" colspan=\"2\">Hardver jellemzők</th>\n                  </tr>\n                </thead>\n                <tbody>\n                  <tr>\n                    <th width=\"35%\">Csatlakoz&aacute;sok</th>\n                    <td width=\"65%\">1 db micro USB port t&ouml;lt&eacute;shez<br />SIM-k&aacute;rtya foglalat<br />Micro SD-k&aacute;rtya foglalat</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">Gomb</th>\n                    <td width=\"65%\">Ki/Bekapcsol&oacute; gomb<br />Reset gomb</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">H&aacute;l&oacute;zati t&aacute;pegys&eacute;g</th>\n                    <td width=\"65%\">Saj&aacute;t 2000mAh &uacute;jrat&ouml;lthető akkumul&aacute;tor</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">Antenna</th>\n                    <td width=\"65%\">Belső antenna</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">H&aacute;l&oacute;zat t&iacute;pusa</th>\n                    <td width=\"65%\">HSPA+/HSPA/UMTS/EDGE/GRPS/GSM</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">Adatsebess&eacute;g</th>\n                    <td width=\"65%\">Le: 21,6Mbps, Fel: 5,76Mbps</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">M&eacute;retek (Sz x M&eacute; x Ma)</th>\n                    <td width=\"65%\">94 x 56,7 x 19,8mm (3.7&times;2.2&times;0.8in.)</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">Micro SD-k&aacute;rtya olvas&oacute;</th>\n                    <td width=\"65%\">Max. 32GB</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">S&aacute;v</th>\n                    <td width=\"65%\">WCDMA&#65306;2100/900MHz<br />GSM: 850/900/1800/1900MHz</td>\n                  </tr>\n                  <tr>\n                    <th width=\"35%\">LED Display</th>\n                    <td width=\"65%\">Wi-Fi &aacute;llapot, Internetkapcsolat &aacute;llapota, t&ouml;lt&ouml;tts&eacute;g jelző</td>\n                  </tr>\n                </tbody>\n              </table>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  ', 0.2, 7, 36, 3, '', '', 1, 0, '', 'komp üzletág', 'M5250', 'LAN', 'Hálózati eszköz', '', 1, 0, NULL, NULL, NULL, NULL, 1),
