(4060, 80168, 'ALCHDT2900VBT12M', '', 'DV Set-Top-Box Alcor HDT-2900 DVB-T vevő + 12 havi MindigTV Extra Alap Előfizetés', '', '85287119', 41, 'TUNEXTSTB', 'Külső set-top-box', 2, 1, '4/11/2017', 1, '\n    <div><strong><font face=\"Calibri\">Alcor HD-2800 digit&aacute;lis vevő</font></strong></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n    <div><font face=\"Calibri\">&nbsp;&nbsp;&nbsp; MPEG-4 HD DVB-T vevő, szabadon foghat&oacute; &eacute;s k&oacute;dolt ad&aacute;sokhoz<br />&nbsp;&nbsp;&nbsp; Be&eacute;p&iacute;tett Conax 7 k&aacute;rtyaolvas&oacute;<br />&nbsp;&nbsp;&nbsp; MinDigTV Extra kompatibilis<br />&nbsp;&nbsp;&nbsp; Teljes kompatibilit&aacute;s az MPEG-4 H.264/AVC High Definition Digital TV szabv&aacute;nnyal<br />&nbsp;&nbsp;&nbsp; Teljes kompatibilit&aacute;s az MPEG-2 High Definition &amp; Standard Definition szabv&aacute;nyokkal<br />&nbsp;&nbsp;&nbsp; Teljes kompatibilit&aacute;s az MPEG-1 Layer I &amp; II, Dolby Digital Audio szabv&aacute;nyokkal<br />&nbsp;&nbsp;&nbsp; MPEG-4 AAC hang t&aacute;mogat&aacute;s<br />&nbsp;&nbsp;&nbsp; Magyar nyelvű men&uuml; (tov&aacute;bbi nyelvek v&aacute;laszthat&oacute;ak)<br />&nbsp;&nbsp;&nbsp; Elektronikus program&uacute;js&aacute;g (EPG)<br />&nbsp;&nbsp;&nbsp; Automatikus &eacute;s k&eacute;zi csatornakeres&eacute;s<br />&nbsp;&nbsp;&nbsp; Sz&uuml;lői fel&uuml;gyelet<br />&nbsp;&nbsp;&nbsp; T&aacute;mogatott felbont&aacute;sok: 480i, 480p, 576i, 576p, 720p, 1080i<br />&nbsp;&nbsp;&nbsp; Teletext t&aacute;mogat&aacute;s<br />&nbsp;&nbsp;&nbsp; HDMI (High Definition Multimedia Interface) csatlakoz&oacute; (HDMI 1.3)<br />&nbsp;&nbsp;&nbsp; Koaxi&aacute;lis digit&aacute;lis hangkimenet<br />&nbsp;&nbsp;&nbsp; Szoftver friss&iacute;t&eacute;si lehetős&eacute;g USB-n kereszt&uuml;l<br />&nbsp;&nbsp;&nbsp; Időz&iacute;tett &eacute;s k&eacute;zi ind&iacute;t&aacute;s&uacute; felvevő (PVR) funkci&oacute;k k&uuml;lső USB-s eszk&ouml;zre<br />&nbsp;&nbsp;&nbsp; Timeshift (Időeltol&aacute;s) funkci&oacute;<br />&nbsp;&nbsp;&nbsp; Multim&eacute;di&aacute;s lej&aacute;tsz&oacute; funkci&oacute;k (AVI, MKV, MPEG, TS, MP3, OGG, FLAC, JPEG)*<br />&nbsp;&nbsp;&nbsp; Alfanumerikus kijelző</font></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n    <div><font face=\"Calibri\">A k&eacute;sz&uuml;l&eacute;k alkalmas a magyarorsz&aacute;gi f&ouml;ldfelsz&iacute;ni, szabad hozz&aacute;f&eacute;r&eacute;sű digit&aacute;lis telev&iacute;zi&oacute;s műsorsz&oacute;r&aacute;s v&eacute;tel&eacute;re.</font></div>\n  ', 0, 4, 24, 3, '', '', 1, 0, 'A készülék alkalmas a magyarországi földfelszíni, szabad hozzáférésű digitális televíziós műsorszórás vételére', 'oem üzletág', 'HDT-2900 MINDIGTV 12HÓ', 'TUN', 'Tuner', '', 1, 0, NULL, NULL, NULL, NULL, 1),
