AC<br />&nbsp;<br />Fizikai tulajdons&aacute;gok <br />Magass&aacute;g 78,0 mm <br />Sz&eacute;less&eacute;g 264,0 mm <br />M&eacute;lys&eacute;g 220,0 mm <br />S&uacute;ly (k&ouml;zel&iacute;tő) 2,20 kg <br /></font></div>\n    <div><font face=\"Calibri\"><br />Csomag tartalma H6520BD DLP vet&iacute;tő<br />T&aacute;pk&aacute;bel<br />VGA-k&aacute;bel<br />T&aacute;vir&aacute;ny&iacute;t&oacute;<br />T&aacute;vir&aacute;ny&iacute;t&oacute;-elem<br /><br /></font></div>\n    <div><font face=\"Times New Roman\">&nbsp;</font></div>\n    <div><font face=\"Calibri\">&nbsp;</font></div>\n  ', 0, 30, 24, 3, 'ACER', '', 3, 0, '', 'komp üzletág', 'MR.JN111.001', 'PRO', 'Projektor', '', 1, 0, NULL, NULL, NULL, NULL, 1),
