(4198, 21330, 'WN353GD', '', 'Lan/WiFi TP   54Mbs TL-WN353GD PCI Card', '', '8471', 23, 'LANCRLPCI', 'PCI / PCI-E kártya', 1, 2, '10/19/2009', 2, '\n    <div>\n      <table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"403\">\n        <tbody>\n          <tr>\n            <td width=\"403\" colspan=\"2\">\n              <div><b>Software Specification</b></div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Standards</div>\n            </td>\n            <td width=\"240\">\n              <div>IEEE 802.11g, IEEE 802.11b</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Wireless Signal Rates With Automatic Fallback</div>\n            </td>\n            <td width=\"240\">\n              <div>\n                <div align=\"left\">\n                  <div align=\"left\">11g: Up to 54Mbps (Dynamic)</div>\n                  <div align=\"left\">11b: Up to 11Mbps (Dynamic)</div>\n                </div>\n              </div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Frequency Range</div>\n            </td>\n            <td width=\"240\">\n              <div>2.4 GHz </div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Output &nbsp;Power</div>\n            </td>\n            <td width=\"240\">\n              <div>18dBm</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Modulation Type</div>\n            </td>\n            <td width=\"240\">\n              <div>1M DBPSK, 2M DQPSK, 5.5M/11M CCK, 6M/9M/12M/18M/24M/36M/48M/54M OFDM</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Receiver Sensitivity</div>\n            </td>\n            <td width=\"240\">\n              <div>54M&#65306;-68dBm@10% PER</div>\n              <div>11M&#65306;-85dBm@8% PER</div>\n              <div>6M&#65306;-88dBm@10% PER</div>\n              <div>1M&#65306;-90dBm@8% PER</div>\n              <div>256K&#65306;-105dBm@8% PER</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Work Mode</div>\n            </td>\n            <td width=\"240\">\n              <div>Ad-Hoc</div>\n              <div>Infrastructure</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Wireless Security</div>\n            </td>\n            <td width=\"240\">\n              <div>64/128/152 bit WEP</div>\n              <div>WPA/WPA2, WPA-PSK/WPA2-PSK (TKIP/AES)</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Support Operating System</div>\n            </td>\n            <td width=\"240\">\n              <div>Windows 2000/XP/Vista</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"403\" colspan=\"2\">\n              <div>*:EIRP-total effective radiated power is 100dBm(100mW), antenna gain will not influence wireless transmit power</div>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n      <p>&nbsp;</p>\n      <table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"403\">\n        <tbody>\n          <tr>\n            <td width=\"403\" colspan=\"2\">\n              <div><b>Hardware Specification</b></div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Interface</div>\n            </td>\n            <td width=\"240\">\n              <div>\n                <div align=\"left\">32-bit PCI connector</div>\n              </div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Antenna </div>\n            </td>\n            <td width=\"240\">\n              <div>\n                <div align=\"left\">2dBi Detachable Omni-directional Antenna</div>\n                <div align=\"left\">(Reverse SMA Connector)</div>\n              </div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Certifications</div>\n            </td>\n            <td width=\"240\">\n              <div>CE, FCC</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Operating Temperature</div>\n            </td>\n            <td width=\"240\">\n              <div>0&deg;C~40&deg;C (32&#8457;~104&#8457;)</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Storage Temperature</div>\n            </td>\n            <td width=\"240\">\n              <div>-40&deg;C~70&deg;C (-40&#8457;~158&#8457;)</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Relative Humidity</div>\n            </td>\n            <td width=\"240\">\n              <div>10% ~ 90% non-condensing</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Storage Humidity</div>\n            </td>\n            <td width=\"240\">\n              <div>5%~95% non-condensing</div>\n            </td>\n          </tr>\n          <tr>\n            <td width=\"163\">\n              <div align=\"center\">Dimensions</div>\n            </td>\n            <td width=\"240\">\n              <div>5.2 &times; 4.8 &times; 0.9 in. (133 &times; 121 &times; 22 mm)</div>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n      <div>&nbsp;</div>\n    </div>\n  ', 1, 4, 24, 3, '', '', 1, 0, '', 'k