(4204, 84537, 'ALCORS8000', '', 'CHG Alcor Solar S8000 vésztöltő / külső akkumulátor - fekete', '', '85076000', 41, 'CHGUSB', 'USB-s töltő', 2, 1, '4/13/2017', 1, '<div>\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><strong>Általános</strong><br />\n- Napelemes vésztöltő, 32 LED-es lámpával<br />\n- Tablet, telefon, MP3 lejátszó, navigáció, stb. töltéséhez<br />\n- Kompatibilis iOS (gyári kábellel) és Android eszközökkel<br />\n- Hordozható, kompakt, könnyű kivitel<br />\n- Dual kimenet akár két eszköz párhuzamos töltéséhez (teljesen feltöltött akkumulátor esetén)<br />\n- Beépített biztonsági védelem<br />\n- Beépített LED-es lámpa többféle működési móddal (100% fényerő, 25% fényerő, figyelmeztető villogó fény, SOS villogó fény)<br />\n- Akár 50 órányi világítás (25% fényerő mellett, teljesen feltöltött akkumulátor esetén)<br />\n- LED-es töltés visszajelző<br />\n- Tartozék USB kábellel</span></span></p>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><strong>Műszaki tulajdonságok</strong><br />\n- Akku kapacitás: 8000 mAh<br />\n- Bemenet: 5V/2A (micro USB)<br />\n- USB töltőcsatlakozó (2db): 5V/2.1A<br />\n- Méretek: 165.8 &times; 74 &times; 15 mm<br />\n- Súly: 235 g<br />\n- Beépített akkumulátor töltési ideje: 4.5 &ndash; 5 óra (a beépített akkumulátor USB-n keresztül történő feltöltése esetén), 24 &ndash; 30 óra (a napelem segítségével)<br />\n- Működési hőmérséklet: 0 ~ 45&deg;C<br />\n- Akkumulátor típus: Li-polimer<br />\n- LED lámpa teljesítmény: 0.06W &times; 32 db<br />\n- Napelem: 350 mA</span></span></p>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><strong>Csatlakozók:</strong><br />\n- Micro USB (a beépített akkumulátor töltéséhez)<br />\n- USB &times; 2 (a csatlakoztatott eszközök töltéséhez)</span></span></p>\n\n<p><span style=\"font-size: 12px\"><span style=\"font-family: arial,helvetica,sans-serif\"><strong>Tartozékok</strong><br />\n- Szilikon tok<br />\n- Karabiner<br />\n- USB kábel<br />\n- Kezelési útmutató</span></span></p>\n</div>\n', 0, 5, 12, 3, '', '', 1, 0, '', 'oem üzletág', 'ALCOR S 8000 BLACK', 'CHG', 'Töltő', '', 1, 0, NULL, NULL, NULL, NULL, 1);
