(4352, 54997, 'ALCACTIONWIFI', '', 'CAM Alcor Action WIFI HD sportkamera - Fekete', '', '85258091', 41, 'CAMSPO', 'Sportkamera', 2, 1, '11/21/2014', 1, '<font size=\"2\"><font face=\"Calibri\"><font size=\"2\"><span style=\"font-size: 12pt\">\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Full HD sport kamera</font> </div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Be&eacute;p&iacute;tett WiFi</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Vezet&eacute;k n&eacute;lk&uuml;li kamera t&aacute;vvez&eacute;rl&eacute;s, val&oacute;s idejű k&eacute;p&aacute;tvitel okostelefonnal</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Android &eacute;s iOS applik&aacute;ci&oacute;k</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">1,5&quot; sz&iacute;nes TFT kijelző</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">170&deg;-os, nagyl&aacute;t&oacute;sz&ouml;gű HD lencse</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Novatek CPU</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">12 Mp-es Aptina CMOS szenzor</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Vide&oacute; &eacute;s fot&oacute; m&oacute;dok</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">V&aacute;laszthat&oacute; vide&oacute; felbont&aacute;sok: 1080p(30fps), 720p(30fps), 720p(60fps)*,VGA(60fps)*, QVGA(60fps)</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Vide&oacute; kodek: H.264</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Vide&oacute; form&aacute;tum: MOV</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">4x digit&aacute;lis zoom</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">V&aacute;laszthat&oacute; fot&oacute; felbont&aacute;sok:12Mpixel, 8Mpixel, 5Mpixel</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Fot&oacute;z&aacute;si m&oacute;dok: egy k&eacute;p, időz&iacute;tő (2/5/10 mp), </font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">sorozatk&eacute;pTimelapse m&oacute;d: k&eacute;pk&eacute;sz&iacute;t&eacute;s 5, 10 vagy 20 m&aacute;sodpercenk&eacute;nt</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Webkamera &eacute;s fed&eacute;lzeti kamera m&oacute;d</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Be&eacute;p&iacute;tett mozg&aacute;s&eacute;rz&eacute;kelő, k&eacute;pstabiliz&aacute;tor</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">HDR &uuml;zemm&oacute;d t&aacute;mogat&aacute;s</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Bőv&iacute;t&eacute;s: Be&eacute;p&iacute;tett MicroSD k&aacute;rtyaolvas&oacute;, ak&aacute;r 32GB t&aacute;mogatott k&aacute;rtyam&eacute;ret</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Be&eacute;p&iacute;tett mikrofon</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Nyelvek: magyar (alap) &eacute;s t&ouml;bbnyelvű kezelőmen&uuml;</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Akkumul&aacute;tor: cser&eacute;lhető 900 mAh </font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Műk&ouml;d&eacute;si idő: kb. 70 perc (1080p r&ouml;gz&iacute;t&eacute;s eset&eacute;n)</font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">Kimenetek:&nbsp; micro USB (t&ouml;lt&eacute;s &eacute;s adatcsere), micro HDMI (type D) vide&oacute;kimenet </font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">M&eacute;retek: 59(Sz) &times; 41(M) &times; 29(V)[mm]&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></div>\n            <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\"><font size=\"2\">S&uacute;ly: 44g (akkumul&aacute;tor n&eacute;lk&uuml;l), 58g (akkumul&aacute;torral)</font>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </div></span></font>\n        <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpFirst\">&nbsp;</div>\n        <div style=\"text-align: justify; text-indent: -18pt; margin: 0cm 0cm 0pt; mso-list: l0 level1 lfo1\" class=\"MsoNormal\" align=\"justify\"><span style=\"font-size: 12pt\"><font size=\"2\">Tartoz&eacute;kok:</font></span></div>\n        <div style=\"text-align: justify; text-indent: -18pt; margin: 0cm 0cm 0pt; mso-list: l0 level1 lfo1\" class=\"MsoNormal\" align=\"justify\"><span style=\"font-size: 12pt\"><font size=\"2\">&nbsp;</font></span></div>\n        <div style=\"text-align: justify; text-indent: -18pt; margin: 0cm 0cm 0pt; mso-list: l0 level1 lfo1\" class=\"MsoNormal\" align=\"justify\"><span style=\"font-size: 12pt\"><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; V&iacute;z&aacute;ll&oacute; tok (30 m&eacute;terig) z&aacute;rt h&aacute;tlappal, Nem v&iacute;z&aacute;ll&oacute;, nyitott h&aacute;tlap a tokhoz, Ker&eacute;kp&aacute;r adapter, Gyorsr&ouml;gz&iacute;tők (2db), Cs&iacute;ptetős tart&oacute;, &Aacute;llv&aacute;ny adapter, Tart&oacute;karok (3db), Sisak r&ouml;gz&iacute;tők (2db), 3M k&eacute;toldalas ragaszt&oacute;k (2db), &Aacute;talak&iacute;t&oacute;, T&eacute;pőz&aacute;ras p&aacute;nt, Gyorsk&ouml;t&ouml;zők, R&ouml;gz&iacute;tő sodrony, USB k&aacute;bel, H&aacute;l&oacute;zati t&ouml;ltő, T&ouml;rlőkendő</font></span></div>\n        <div style=\"text-indent: -18pt; margin: 0cm 0cm 0pt 36pt; mso-list: l0 level1 lfo1\" class=\"MsoListParagraphCxSpLast\" align=\"left\">&nbsp;</div>\n        <div style=\"text-align: justify; text-indent: -18pt; margin: 0cm 0cm 0pt; mso-list: l0 level1 lfo1\" class=\"MsoNormal\" align=\"center\"><span style=\"font-size: 12pt\">&nbsp;</span></div></font></font>\n  ', 0.62, 5, 12, 3, '', '', 1, 0, '', 'oem üzletág', 'ACTION WIFI BLACK', 'CAM', 'Kamera (kézi)', '', 1, 0, NULL, NULL, NULL, NULL, 1),
